(8, 8, 1436797020, 3, 'TRADEMAP', '', '/files/background/b54372969f0e8147740377c909af7a66.jpg', 'http://www.trademap.org/', 1, 5, 2, 1),
(9, 9, 1436797560, 3, 'TRADEMAP', '<p>Trademap is considered one of the world\'s biggest trade databases as it covers trade flows (mirror and direct) of over 220 countries and territories and 5,300 products defined at the 2, 4 or 6-digit level of the&nbsp;Harmonized System. Users can choose to see the data either with pre-calculated trade indicators (e.g. growth, market shares, average unit values, etc) or in times-series (e.g. monthly, quarterly and yearly) from 2001 onward.</p>', '/files/background/0e0f56f46aeda19b619691602acb97da.jpg', 'http://www.trademap.org/', 1, 5, 1, 1),
(10, 10, 1436797800, 3, 'TRADEWITHGEORGIA', '<p>Trademap is considered one of the world\'s biggest trade databases as it covers trade flows (mirror and direct) of over 220 countries and territories and 5,300 products defined at the 2, 4 or 6-digit level of the&nbsp;Harmonized System. Users can choose to see the data either with pre-calculated trade indicators (e.g. growth, market shares, average unit values, etc) or in times-series (e.g. monthly, quarterly and yearly) from 2001 onward.</p>', '/files/background/0b60d9834ffd854773f987f0f8f25b9e.jpg', 'http://www.trademap.org/', 1, 5, 1, 1),
(11, 11, 1436797980, 3, 'Rewiew World Biggest Trade Databse ', '<p>Trademap is considered one of the world\'s biggest trade databases as it covers trade flows (mirror and direct) of over 220 countries and territories and 5,300 products defined at the 2, 4 or 6-digit level of the&nbsp;Harmonized System. Users can choose to see the data either with pre-calculated trade indicators (e.g. growth, market shares, average unit values, etc) or in times-series (e.g. monthly, quarterly and yearly) from 2001 onward.</p>', '/files/background/770ae094682f54fb9fc4c8333122973d.jpg', 'http://www.trademap.org/', 1, 5, 4, 0),
(12, 12, 1436800440, 3, 'EXPORTGOV', '<p>Export.gov brings together resources from across the U.S. Government to assist American businesses in planning their international sales strategies and succeed in today&rsquo;s global marketplace. Though the Page visitors can view different market reports and other important information. &nbsp;&nbsp;</p>', '/files/background/4daeb28e6e5400bb755db02d9c7b3483.jpg', 'http://export.gov/', 1, 5, 2, 1),
(13, 13, 1436800620, 3, 'EXPORT.GOV', '<p>Export.gov brings together resources from across the U.S. Government to assist American businesses in planning their international sales strategies and succeed in today&rsquo;s global marketplace. Though the Page visitors can view different market reports and other important information. &nbsp;&nbsp;</p>', '/files/background/304ee2ece4cbd0671e98d4940ef928a1.jpg', 'http://export.gov/', 1, 5, 2, 1),
(14, 14, 1436858700, 3, 'See Different Market Reports and Industry Analyzes', '<p>Export.gov brings together resources from across the U.S. Government to assist American businesses in planning their international sales strategies and succeed in today&rsquo;s global marketplace. Though the Page visitors can view different market reports and other important information. &nbsp;&nbsp;</p>', '/files/background/c0505ff5d43aee5f5de5ff0c5978ef20.jpg', 'http://export.gov/', 1, 5, 5, 0),
(15, 15, 1436858880, 3, 'Find Out International Business Inteligent Reports and Trade Analyzes ', '<p>As independent market research experts, you can rely on us for unbiased historic trends and forecasts for every region, country, category, channel and consumer. Our innovative market research products, reliable reports and daily updates from expert analysts make Euro monitor International an essential resource for every organization.</p>', '/files/background/e8b2d8a04e9be60238422996904f647c.jpg', 'http://www.euromonitor.com/', 1, 5, 6, 0),
(16, 16, 1436859780, 3, 'Browse Market Information and Export Programmes of CBI', '<p>CBI (Centre for the Promotion of Imports from developing countries) is part of the Netherlands Enterprise Agency and commissioned by the Ministry of Foreign Affairs of the Netherlands. Established in 1971 in order to support producers / exporters to get a foothold on the market in the Netherlands, support to Business Support Organizations in improving their capabilities and to act as a Matchmaker between suppliers and buyers. In 1991 the activities were expanded to EU. - See more at:</p>', '/files/background/f98a9b13e0cdedac2ac757258c8b0823.jpg', 'http://www.cbi.eu/', 1, 5, 7, 0),
(17, 17, 1436861160, 3, 'Get the Information About EU Tariffs, Requirements and Trade Statistics ', '<p>The European Union is the world\'s largest single market and the Export Helpdesk is your online portal to access it!</p>\r\n<p>In just a few clicks companies can find the EU tariffs, requirements, preferential arrangements, quotas and statistics relating to imports from trade partner countries.</p>', '/files/background/d68199d86d4ea792ea15b615ed3dff65.jpg', 'http://exporthelp.europa.eu/thdapp/index.htm#', 1, 5, 8, 0),
(18, 18, 1436861700, 3, '', '', '/files/background/666efd8860d8dcb99f0e00f20aebba0a.jpg', 'http://geostat.ge/index.php?action=0&lang=eng', 1, 5, 6, 1),
(19, 19, 1436861760, 3, 'Check Out Georgia\'s Trade Statistics and Analyzes ', '<p>National Statistics Office of Georgia, the legal entity of public law, carries out its activities independently. It is an institution established to produce the statistics and disseminate the statistical information according to the Georgian legislation. National Statistics Office of Georgia is established by the Law of Georgia, dd 11 December 2009, on Official Statistics. <br />Besides, the activities of the Geostat are based on the basic principles of the official statistics:</p>', '/files/background/91b92edf00c63e753b6698a0a099bbb5.jpg', 'http://geostat.ge/index.php?action=0&lang=eng', 1, 5, 2, 0),
(20, 20, 1436862840, 3, 'Find Information About Custom Clerance procedures and taxes in Georgia', '<p>Revenue Service, a legal entity of public law of the Ministry of Finance of Georgia, executes state control on the whole territory of Georgia. Their main task is to support business in Georgia, create the most favorable environment for establishing of new businesses and their development, formation a just, simple and reliable tax system.</p>', '/files/background/90b401a27914339be34b264d0dd68dba.jpg', 'http://www.rs.ge/en/1340', 1, 5, 1, 0),
(21, 21, 1436863680, 3, 'Access the  worldwide Database of Import/Export Orianted Companies', '<p>Kompass is a worldwide database present on five continents in 66 countries.It offers international data coverage unique in the world. Its &ldquo;Glocal&rdquo; (Global + Local) organisation of more than 500 people working for Kompass worldwide means it offers close proximity to its clients and users, with homogeneous data regardless of the country of the company consulted.</p>', '/files/background/bf765491ccc405cef049271699db075f.jpg', 'http://ge.kompass.com/en', 1, 5, 9, 0),
(22, 22, 1436863920, 3, '', '', '/files/background/fb6a573a5f5625222fcc01322964d252.jpg', '', 1, 5, 9, 1),
(23, 23, 1436867220, 3, 'Access The World’s largest Online B2B Trading Platform ', '<p>Alibaba Group was established in 1999 by 18 people led by Jack Ma, a former English teacher from Hangzhou, China. From the outset, the company&rsquo;s founders shared a belief that the Internet would level the playing field by enabling small enterprises to leverage innovation and technology to grow and compete more effectively in the domestic and global economies. Since launching its first website helping small Chinese exporters, manufacturers and entrepreneurs to sell internationally, Alibaba Group has grown into a global leader in online and mobile commerce. Today the company and its related companies operate leading wholesale and retail online marketplaces as well as Internet-based businesses offering advertising and marketing services, electronic payment, cloud-based computing and network services and mobile solutions, among others.</p>', '/files/background/d492d49c8ed25ce6511250cb1dee0e6e.jpg', 'http://www.alibaba.com/', 1, 5, 10, 0),
(24, 24, 1436867700, 3, 'Visit International Trade Portal ', '<p>GlobalTrade.net is a knowledge resource where experts in international trade can post their expert content; an editing team vets all content posted. Content includes more than 14000 global trade / import export market surveys, experts\' analyses, tips, white papers, country profiles, experts&rsquo; views, webinars, news flows, video tutorials and presentations. As well as publishing expert content, GlobalTrade.net contains a free database of international trade service providers that are useful to importers and exporters. Among the listed global trade service providers&nbsp;: international marketing consultants, import-export companies, trade finance companies, banks, freight forwarders, quality control firms, lawyers, accountants, customs brokers, international trade instructors and insurance providers for their international operations. GlobalTrade.net allows international trade service providers to create a profile and to facilitate contact with the global trade market</p>', '/files/background/53652ee565ef446b66336a041e27abab.jpg', 'http://www.globaltrade.net/', 1, 5, 11, 0),
(25, 25, 1436867700, 3, 'GlobalTrade.net is a knowledge resource where experts in international trade can post their expert content; an editing team vets all content posted. Content includes more than 14000 global trade / import export market surveys, experts\' analyses, tips, whi', '<p>GlobalTrade.net is a knowledge resource where experts in international trade can post their expert content; an editing team vets all content posted. Content includes more than 14000 global trade / import export market surveys, experts\' analyses, tips, white papers, country profiles, experts&rsquo; views, webinars, news flows, video tutorials and presentations. As well as publishing expert content, GlobalTrade.net contains a free database of international trade service providers that are useful to importers and exporters. Among the listed global trade service providers&nbsp;: international marketing consultants, import-export companies, trade finance companies, banks, freight forwarders, quality control firms, lawyers, accountants, customs brokers, international trade instructors and insurance providers for their international operations. GlobalTrade.net allows international trade service providers to create a profile and to facilitate contact with the global trade market</p>', '', 'http://www.globaltrade.net/', 1, 5, 11, 1),
(26, 26, 1436869260, 3, 'Search For International Trade Companies', '<p>TradeBoss</p>', '/files/background/75cf952f92ec719091bd0931609bc522.jpg', 'http://www.tradeboss.com/default.cgi/action/aboutus/', 1, 5, 12, 0),
(27, 27, 1436880120, 3, 'EventsEye purpose is to cover major Trade Exhibitions all over the planet. We also focus on brand new Events, especially in emergent market regions. Our directory contains 1 936 Trade Show venues from 1 017 Cities, among 136 Countries.  Through EventsEye,', '<p>EventsEye purpose is to cover major Trade Exhibitions all over the planet. We also focus on brand new Events, especially in emergent market regions. Our directory contains <strong>1 936</strong> Trade Show venues from <strong>1 017</strong> Cities, among <strong>136</strong> Countries.Through EventsEye, you have an access to Trade Show Organizers &amp; venues websites as well as complete contact information (address, e-mail, phone, fax) with a simple click. Each time an exhibition Website &amp; e-mail are available, we provide the links to them. We actually provide links to as many as <strong>17 591</strong> websites and <strong>11 883</strong> e-mails.</p>', '/files/background/4a10839cc2fb583475d099912d319f4f.jpg', 'http://www.eventseye.com/', 1, 5, 12, 1),
(28, 28, 1436880420, 3, 'Discover International Business Events and Tradeshows ', '<p>EventsEye purpose is to cover major Trade Exhibitions all over the planet. We also focus on brand new Events, especially in emergent market regions. Our directory contains <strong>1 936</strong> Trade Show venues from <strong>1 017</strong> Cities, among <strong>136</strong> Countries.&nbsp;Through EventsEye, you have an access to Trade Show Organizers &amp; venues websites as well as complete contact information (address, e-mail, phone, fax) with a simple click. Each time an exhibition Website &amp; e-mail are available, we provide the links to them. We actually provide links to as many as <strong>17 591</strong> websites and <strong>11 883</strong> e-mails.</p>', '/files/background/7a425873e3daf52d8ef01c3df9136d86.jpg', 'http://www.eventseye.com/index.html', 1, 5, 13, 0),
(30, 30, 1436960160, 3, 'Calculate Import Tariff in Just a Few Clicks', '<p>The United States imposes tariffs (customs duties) on imports of goods. The duty is levied at the time of import and is paid by theimporter of record. Customs duties vary by country of origin and product. Goods from many countries are exempt from duty under various trade agreements. Certain types of goods are exempt from duty regardless of source. Customs rules differ from other import restrictions. Failure to properly comply with customs rules can result in seizure of goods and criminal penalties against involved parties.&nbsp;United States Customs and Border Protection (&ldquo;CBP&rdquo;) enforces customs rules.</p>', '/files/background/db60303277b454d9be70de026bb13b91.jpg', 'https://www.dutycalculator.com/', 1, 5, 14, 0),
(29, 29, 1436942460, 3, 'Discover Accredited Product Certification Bodies and Testing laboratories in Georgia', '<p>The Georgian Accreditation Center-GAC-is the nationally recognised accreditation body of Georgia. Its mission is to deliver best accreditation services to the Georgian economy.&nbsp;</p>', '/files/background/c0e2270ab0794db39b8606ec852e665b.jpg', 'http://gac.gov.ge/', 1, 5, 3, 0),
