(36, 36, 1437027840, 1, 'LTD KULA', '<p>Gori Feeding Cannery Kula&rdquo; was established in 2009. The company included two brands. The first &ndash; &ldquo;KULA&rdquo;- produced ecologically clean juice of fruit and vegetables. The other &ndash; &ldquo;Kula baby&rdquo; - produced natural juices for children.</p>', '/files/background/3b5bbe78a8cf120ce020beb6b0afa6ef.jpg', 'http://kula.ge/', 1, 5, 2, 1),
(37, 37, 1437466920, 1, 'Borjomi TM', '<p>&ldquo;Borjomi&rdquo; TM is produced by IDS Borjomi Georgia, which is a part of IDS Borjomi International &ndash; the biggest producer of natural mineral water and market leader in bottled natural mineral waters in the CIS and the Baltics.&nbsp;The company is an internationally recognized producer of mineral waters. Its product range includes &ldquo;Borjomi&rdquo;, &ldquo;Likani&rdquo;, &ldquo;Borjomi Springs&rdquo; and &ldquo;Bakuriani&rdquo; brands. IDS Borjomi Georgia is a leader in the mineral water market in Georgia. The world-famous &ldquo;Borjomi&rdquo; mineral water is the leading brand in the IDS Borjomi Georgia portfolio; it is exported to thirty countries worldwide.&nbsp;</p>', '/files/background/ab86c83a298444e286f574b464964c45.jpg', 'http://www.borjomi.com/ge/', 1, 5, 1, 1),
(38, 38, 1437467820, 1, 'Sairme Mineral Waters Ltd.', '<p>Company "Sairme Mineral Waters" produces and distributes sparkling mineral water and&nbsp;non-carbonated spring of the famous Georgian brand Sairme. The production of the company is located in the resort Sairme, in Bagdati district of the Imereti region,&nbsp;Georgia.</p>', '/files/background/fab70da22f02cfd2108e7ba3eec34fd7.jpg', 'http://www.sairme.ge/', 1, 5, 2, 1),
(39, 39, 1437471900, 1, 'GM Pharmaceuticals', '<p style="text-align: justify;">GM Pharmaceuticals is located in Tbilisi, Georgia. Production facility &nbsp;is equipped with equipment produced by companies such as BOSCH, FETTE, UHLMANN, HUTTLIN, SERVOLIFT, SKINETTA, ENFLEX, MILLIPORE, AGILENT TECHNOLOGIES, BOHLE, IMA and others. GM Pharmaceuticals is the only pharmaceutical plant throughout the region where a full production cycle of manufacturing finished pharmaceutical solid dosage forms &nbsp;is carried out by means of state-of-the-art technologies and in compliance with international GMP (Good Manufacturing Practice) standards. GM Pharmaceuticals is the only domestic manufacturer of the pharmaceutical products , fulfilling GMP requirements during all lines of operations . Using modern technologies, company manufactures tablets, film-coated tablets, sachets &nbsp;and Hard gelatin capsules. In order to completely meet the current market requirements, the company cooperates with a number of leading european manufactures and imports various medicinal products under contract manufacturing: ampoules, uspensions, gels. Company exports over 100 types of products to 10 countries worldwide: Armenia, Azerbaijan, Kyrgyzstan, Tajikistan, Uzbekistan, Moldova, Belarus, Kazakhstan, Ukraine, and Libya. Under licenses of Swiss Companies such as: Lallemand Pharma and Hoffmann-La Roche, GM Pharmaceuticals manufactures finished formulations &nbsp;designated for regional markets.</p>', '/files/background/f2d80fc621b08f111d119b1e6ace4d74.jpg', 'http://gmp.ge/', 1, 5, 3, 1),
(40, 40, 1437653940, 4, 'Trade Map', '<p>learn foreign trade statistics by years and countires Search countries with most Georgian products on export.</p>', '/files/background/ce28583291671099d96b01e5ddd2ad1f.jpg', 'http://tradewithgeorgia.com/en/trade-map/loadmap::self', 1, 5, 1, 0),
