(47, 47, 1437660180, 5, 'Freshwater aquaculture', '<p><em>Aquaculture</em> is the culture of aquatic animals or plants. It involves many of the same skills and activities common to agriculture, including animal husbandry and marketing--<em>aquaculture</em> can be thought of as underwater farming.</p>', '/files/background/f1f858bd8b956414986f9cfdfe1b6461.jpg', 'http://trade.404.ge/en/export-catalog?view=products&sort=DESC&subsector=52&products=89&exportmarkets=&certificate=&search=&pn=1&token=XVp5RtxktG', 1, 5, 4, 1),
