(49, 49, 1445940180, 1, 'Gori Feeding Cannery Kula', '<div class="cat_title">&ldquo;Gori Feeding Cannery Kula&rdquo; was established in 2009. The company included two brands. The first &ndash; &ldquo;KULA&rdquo;- produced ecologically clean juice of fruit and vegetables. The other &ndash; &ldquo;Kula baby&rdquo; - produced natural juice for children.</div>\r\n<div class="cat_text">\r\n<p>The first year in its existence, the company gained the name of honest producer of ecologically clean products. It became a leader in producting of natural juice in Georgia.</p>\r\n<p>In 2010 the company started producing preserved fruits and vegetables. It started to produce jams, sauces, marinades, tomatoe sauce, cold dishes, pomegranate sauce and other products. By the end of 2010 the company produced more than 150 kinds of ecologically clean products.</p>\r\n</div>', '/files/background/5ec2eae8def936601f80e903ccba6b73.jpg', 'http://kula.ge/', 1, 5, 3, 1),
(50, 50, 1445940600, 1, 'Nutex Ltd', '<p>The &ldquo;NUTEX&rdquo; Ltd was founded on October 2, 2007. since 2008 the company commenced and inactivated its intensive business in the market, by that period it owned 50% of the raw materials market in Kakheti. The company is also busy with purchasing the raw materials in the west part of Georgia, in particular in Samegrelo, Imereti and Guria.</p>', '/files/background/4ce6a127073617c79bb6694872e65c4f.jpg', 'www.nutex.ge', 1, 5, 3, 1),
