(1, 1, '', '', 1436119740, 1436119740, 1, '', 'Sial - Asian Food Market Place', '', '', '', '', '', '', '', '', '', '', 'China, Bangkog 1 Fusionopolis Walk #01-02 South Tower, Solaris Bangkog 138628', '17 April Everyday 01.06.2015 - 11.06.2015 15:00 - 17:00', 'No Fees Apply', '', 'on', '', '<p>short description</p>', '<p>The Business Excellence (BE) Briefing is suitable for companies &amp; organizations that are new to business excellence, and are interested in finding out how the Revised BE Framework can help strengthen management systems to deliver superior results.</p>\r\n<ul>\r\n<li><label></label>3.10 pm - Profiling Questionaire</li>\r\n<li><label></label>3.20 pm - The Revised BE Framework</li>\r\n<li><label></label>3.30 pm - Benefits of BE</li>\r\n<li><label></label>3.40 pm - Application Procedures for BE Certification (SQC, PD, I-Class, S-Class)</li>\r\n<li><label></label>4.00 pm - Support &amp; Assistance for SMEs</li>\r\n<li><label></label>4.30 pm - Combined Q&amp;A Session</li>\r\n</ul>\r\n<p>This briefing is suitable for:</p>\r\n<ul>\r\n<li class="text_formats">1. Organizations new to the Business Excellence (BE) Initiative.</li>\r\n<li class="text_formats">2. Organizations applying for any of the following BE Certifications for the first time:</li>\r\n</ul>', '', '', '', 'about/events/sial---asian-food-market-place', 1, 0, 5, 'no', 2, 1),
