(13, 13, '501014231', '', 1437064819, 0, 3, '', 'Mahua', 'giorgigvazava87a3bd3ccb558d87d9b5cfa08f13102835.jpg', '967', '', '51', '84', '10 days', '10 kg Box', 'fghfgh', '', '', '', '', '', '', 'on', '', '', 'Non-timber forest products (NTFPs), also special, non-wood, minor, alternative and secondary forest products, are useful substances, materials and/or commodities obtained from forests which do not require harvesting (logging) trees. They include game animals, fur-bearers, nuts, seeds, berries, mushrooms, oils, foliage, medicinal plants, peat, fuelwood, and forage.[1] Research on NTFPs have focused on their commodifiability for rural incomes and markets, as an expression of traditional knowledge or as a livelihood option for rural household needs, and, as a key component of sustainable forest management and conservation strategies. All research promote forest products as valuable commodities and tools that can promote the conservation of forests.', '', '', '', 'view/501014231/Mahua', 29, 1, 5, 'no', 1, 1),
