(38, 33, '', '', 1432843200, 1437642420, 2, '', 'Banking Supervision May Change Hands', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'on', '', '<p>Georgian Parliament recently suggested transferring the capacity of banking supervision from the National Bank of Georgia to a new public law entity called the Financial Supervision Agency.</p>', '<div class="article-contentall">\r\n<div class="article-content">Georgian Parliament recently suggested transferring the capacity of banking supervision from the National Bank of Georgia to a new public law entity called the Financial Supervision Agency. Proponents of this idea believe it is going to provide the banking sector with proper regulation &ndash; something that is severely sub-par at the moment. Opponents claim that this separation will weaken the NBG and violate banking secrecy. <br /><br /><em><strong>A new, separate regulatory body, Financial Supervision Agency is expected to replace the National Bank&rsquo;s financial supervision committee. The FSA is expected to become operational as of July 1, 2015.</strong></em><br /><br />Tamaz Mechiauri, Deputy Head of the Finance and Budget Committee at Parliament, was the one who submitted the bill in question. The amendment to the law is aimed at replacing the National Bank&rsquo;s financial supervision committee with a separate regulatory body named Financial Supervision Agency. The FSA is expected to become operational as of July 1, 2015. However, as Finance Minister Nodar Khaduri claims, despite being under NBG control, the FSA will be completely independent and answer only to the Parliament. It will be led by a council of seven members, each appointed for seven years. One of the members will be Governor of the NBG, but he/she will not be able to chair the council. The Parliament will nominate all other council members and they, in turn, will elect the chairman.<br />NBG and FSA will be oriented towards enhancing transparency of the Georgian financial sector as well as protecting the rights of consumers and investors alike. The scope of FSA activity duplicates the currently active financial supervision committee of the NBG and covers the following parts of the financial sector: commercial banks, non-banking deposit institutes, qualified credit institutes, micro-finance organizations, money transfer and currency exchange activity as well as the securities market. <br />According to Mr. Mechiauri, the reasoning behind the bill he proposed was to weaken the universal control of the NBG. The point is that the recent depreciation of Georgian national currency has unleashed a wide range of speculations about the depreciation being mostly caused by commercial banks rigging the currency market rather than by economic factors. And yet despite the abundance of such claims, the NBG has turned a blind eye. <br />A year earlier, the Financial Monitoring Service was separated from the NBG as an independent body responsible to the prime minister alone. According to Roman Gotsiridze, ex-governor of the NBG, removing the banking\r\n<div class="article_ads">&nbsp;</div>\r\nsupervision capacity as well will ruin the bank. He considers this to be an attempt to control not only the commercial banks, but also the entire business community. <br />&ldquo;This bill revokes the confidentiality of banking information and any tax body will be able to see our accounts. Previously, something like this could be authorized only by a court decision. This step abolishes the NBG as such, leaving it only a technical function,&rdquo; Gotsiridze says. <br />The Association of Young Businessmen and Financiers approves of the initiative, though. According to Shota Gulbani, Vice President of AYBF, separation of the FSA from the NBG will enhance the transparency of the banking sector and will leave no room for speculations. <br />&ldquo;The NBG and the government are playing a blame-game at the time of the currency crisis. To avoid such misunderstandings and insinuations in the future, Parliament has decided to assume the responsibility of staffing the council,&rdquo; he said. <br />Irakli Dogonadze, Executive Director of the Center for Analysis and Prognosis at Tbilisi State University, thinks that FSA separation is viable as a temporary remedy to discharge the currency crisis, since the National Bank&rsquo;s monetary policy poised and still poises many question marks. However, in the long-term, he recommends making the NBG a universal and strong regulatory body for the entire financial system. <br />\r\n<div class="cls">&nbsp;</div>\r\n</div>\r\n<div class="cls">&nbsp;</div>\r\n</div>\r\n<div class="privacy">\r\n<div class="article_author">Author: <a href="http://www.georgianjournal.ge/author.html?view=articles&amp;authorid=72">Nino Patsuria</a></div>\r\n</div>', '', '', '', 'about-us/news/Banking-Supervision-May-Change-Hands', 1, 0, 5, 'no', 2, 1),
(39, 34, '', '', 1432977420, 1437643020, 2, '', '“From Shanghai to Rotterdam Through Georgia Rather than Russia” - TBC Bank President on Anaklia Port and the New Silk Road', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'on', '', '<p>Soon the Georgian government will declare the company which, as a result of the tender, will carry out the Anaklia Port project.</p>', '<p>Soon the Georgian government will declare the company which, as a result of the tender, will carry out the Anaklia Port project. The list of contenders includes Anaklia Development Consortium, which is a union of TBC Holding and Konti Group. Mamuka Khazaradze, founder of the consortium, is holding one meeting after another with potential foreign partners for construction of the port. His interview with Georgian Journal took place on May 22, soon after his return from China.<br /><br /><em><strong>&ldquo;What we are talking about here is the creation of an industrial zone near the Anaklia Port, with not only the Chinese, but many other foreign companies represented, including those from non-EU countries.&rdquo;<br /></strong></em><br /><strong>&ndash; TBC Group participates in the tender for construction of the Anaklia Port. Just hours ago, you were in China. What meetings did you hold there?</strong><br /><br />&ndash; I met with representatives of two multinational companies, which are second and third largest in their fields worldwide. We also met with the Chinese Railways Administration representatives as well as those of COSCO Pacific Limited, which is included in the world&rsquo;s top three when it comes to transportation. In addition, we also held meetings with representatives of the China Development Bank, which has investment reserves worth 300 billion USD. The Chinese government has a strategy that envisions restoration of the historical Silk Road. Construction of the Anaklia Port fits into this strategy, allowing the flow of cargo to pass from Shanghai to Rotterdam through Georgia rather than Russia or any other path. <br />Another significant meeting we had was with the managers of one of the China&rsquo;s largest free trade and industrial zones, and they also became interested in our project. What we are talking about here is the creation of an industrial zone near Anaklia Port, with not only Chinese, but many other foreign companies represented, including those from non-EU countries. Being a transit country and an industrial country are two very different things, and we aim to become an industrial country with a significant transit function. We enjoy significant financial support from the leading U.S. financial agencies and banks such as OPIC and U.S. Ex-Im Bank, along with many European financial institutions. Our investing partners are Goldman Sachs and Berkley, which provide a significant share of the financial contributions. <br />The Chinese side will be one of the components in this massive consortium. If the project becomes reality, it will significantly influence our national currency, not</p>\r\n<div class="article_ads">&nbsp;</div>\r\n<p>to mention regional development and employment. <br /><br /><em><strong>&ldquo;The Anaklia Port project will take 10 years to complete and its cost will range from two to 2.5 billion dollars.&rdquo;</strong></em><br /><br /><strong>&ndash; How much do you and your partners plan to put into the Anaklia Development Project and how many years will it take?</strong><br /><br />&ndash; The project&rsquo;s scale is so massive that no single entity has the capacity to finance it alone. Funds will be attracted through the consortium. Cost of the first stage of the project, which encompasses construction of the free trade area and the industrial zone, is approximately 800 million dollars. In total, the Anaklia Port project will take 10 years to complete and its cost will range from two to 2.5 billion dollars. If circumstances are favorable and if our plans are carried out as intended, goods produced in Georgia will successfully make it to the European market and the scale of both investments and the project itself will increase. Many players in the market will become interested in it; I would not even rule out it finding a spot for itself at the stock exchange. The port is to become one of the largest hubs in the entire region, uniting financial, logistical and industrial power under one roof, so to say.<br /><br /><strong>&ndash; Since our Ministry of Economy expressed interest in the Anaklia Port project, 12 companies expressed their desire to participate. Out of these, only seven were shortlisted, and now there are only two left: yours and a Georgian-Chinese union, Anaklia Port and Industrial Eco Park. What advantages do you have over your competitor?</strong><br /><br />&ndash; Our advantage lies in one very important thing: diversification of investors. If carried out by us, the project will feature not only Georgian and Chinese companies, but also a whole multitude of international businesses, including those from Europe and the U.S. Another trump card that we have is written agreements with the large, reputable banks that I mentioned before &ndash; they have agreed to cooperate with our consortium. We have a good chance of winning, and if we do, I will share our plans in greater detail.</p>', '', '', '', 'about-us/news/From-Shanghai-to-Rotterdam-Through-Georgia-Rather-than-Russia---TBC-Bank-President-on-Anaklia-Port-and-the-New-Silk-Road', 1, 0, 5, 'no', 2, 1),
(40, 35, '', '', 1433497920, 1437645120, 2, '', 'Hard Times for Greengrocery in Georgia', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'on', '', '<p>The once-profitable greengrocery business is going through hard times in Georgia.</p>', '<p>The once-profitable greengrocery business is going through hard times in Georgia. Although several months ago even the Russian market was officially open for Georgian greens, the producers cannot take their product there &ndash; mainly due to the fact that they still haven&rsquo;t bounced back from the 2008 war. Consequences of the war resulted in Georgian greens being substituted by Azerbaijani and Iranian greens, despite them being of much lower quality. For obvious reasons, the export of Georgian greens has decreased in Ukraine as well. Traders who still remain at the market struggle to profit due to devaluation of hryvnia. Farmers who produce greens ask the authorities for help; in turn, powers that be see the panacea in entering the European market.<br /><br /><em><strong>&ldquo;Many farmers don&rsquo;t even harvest their crops, choosing to simply plough the fields with ripe greens instead.&rdquo;<br /></strong></em><br />There are about a thousand greenhouses in the Imereti region alone, with 5,500 small and medium entrepreneurs yielding about 25,000 tons of greens annually. According to the recent years&rsquo; figures, more than 40 percent of Georgia-produced greens are exported to Ukraine. A comparatively lesser amount goes to Belarus, Azerbaijan, Latvia, Bulgaria, Moldova, Estonia, Romania and Lithuania. Export volume is decreasing, though: If in 2013 Georgia exported 2,200 tons of greens, in 2014 the volume decreased to 1,900 tons.<br /><br /><em><strong>Archil Lomidze, farmer and greengrocer:</strong></em><br /><br />&ldquo;Let me put it plainly: One trailer can carry 13 tons of greens. Last year, 1 kg of greens cost 2 USD, this year nobody pays even 70 cents. You do the math. The greens taken to Ukraine were sold for 30 hryvnias per kilogram, which roughly amounted to 4 USD, but this year these 30 hryvnias devaluated to 1 USD. The prices have never been so low, and this is true for Georgia as well. When 1 USD cost 1.70 GEL, the local price for greens was always within the range of 3.5-4 USD. Now the exchange rate has worsened and people sell greens for less than it takes to produce them. Many farmers don&rsquo;t even harvest their crops, choosing to simply plough the fields with ripe greens instead. Return to the Russian market is not yet feasible and nobody knows what the prospects are. Russia imports spices from India and greens from Iran, Azerbaijan and North Ossetia. Nobody knows when the situation in Ukraine is going to be sorted out, and the European market is a distant dream.<br />Most European countries</p>\r\n<div class="article_ads">&nbsp;</div>\r\n<p>get their greens from countries such as Israel, Spain, Turkey and Iran, whose supply is steady and stable. We can&rsquo;t even secure that, and don&rsquo;t get me started on quality. I doubt you&rsquo;d be able to put together even 100 kg of greens that would look and taste the same. The only likely way out of this is unification of small enterprises and creation of bigger ones that will satisfy the European demand in quality as well as stability and volume. But this cannot be achieved without state support.&rdquo;<br /><br /><em><strong>&ldquo;Europe consumes more and more greens annually, and if Georgia manages to carve out a niche for itself in the ever-increasing demand, it would greatly assist with development of Imereti region.&rdquo;</strong></em><br /><br />The project aimed to facilitate the export of greens to the European market is being carried out by Industrial Development Group together with the Ministry of Economy. To this end, a Dutch company was invited to Georgia in order to investigate the situation and prepare the initial action plan. After its work was complete, a memorandum on mutual understanding was signed between entrepreneurs and Industrial Development Group; according to it, the entrepreneurs took upon themselves the responsibility to set up annexes that would increase their greenhouses&rsquo; output by 50 percent. These annexes, if established properly, will ensure attainment of European certification, signifying the producers&rsquo; adherence to a unified standard of agricultural production. The standard embraces the whole cycle of agricultural production (location selection, soil preparation, sorting and packaging of the product). For the European consumer, this standard means that the foodstuff is produced with strict observance of the production rules and any dangerous environmental influence as well as use of chemicals is brought to minimum. The standard includes 234 demands. On its part, Industrial Development Group will assist with attracting finances and preparing specialists, as well as establishing contacts with Dutch trade houses to ensure a stable export of Georgian greens to the European market for many years forward. <br /><br /><em><strong>Paata Charakashvili, Head of Industrial Development Group:</strong></em><br /><br />&ldquo;Georgia&rsquo;s main exports in this field are dill, coriander and parsley. Now the producers are starting to grow new crops, such as broccoli, salad leaves and oregano. It is obligatory to diversify the market, but the European market places very strict demands on those who want to enter it. Still, Europe consumes more and more greens annually, and if Georgia manages to carve out a niche for itself in the ever-increasing demand, it would greatly assist with development of Imereti region.<br />In Europe, there are established rules of play. A signed agreement specifies a definite price and it is not liable for variation within the period of time stipulated by the contract. We think the price of Georgian greens on the European market will be within 4-5 EUR per 1 kg. This integration of the greens producers can serve as an example for other producers. In this case, a merger of enterprises will be decisive because with our small volume of production we can&rsquo;t hit big markets, be they Europe or China, where we plan to take our agricultural products as well.&rdquo;</p>', '', '', '', 'about-us/news/Hard-Times-for-Greengrocery-in-Georgia', 1, 0, 5, 'no', 2, 1),
(41, 36, '', '', 1433759160, 1437647160, 2, '', 'Business Confidence Index drops for Georgia', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'on', '', '<p>Business confidence in Georgia has dropped by 24.5 points to an all-time low of 3.6 on a scale of [-100; +100] points, though it was steadily optimistic for most of 2014 and in the first quarter of 2015.</p>', '<p>Business confidence in Georgia has dropped by 24.5 points to an all-time low of 3.6 on a scale of [-100; +100] points, though it was steadily optimistic for most of 2014 and in the first quarter of 2015.<br /><br />According to the survey, which included 168 companies, business confidence declined on all measures, across all sectors, and for all company sizes. Moreover, it is reflected in business perceptions concerning both current performance and future expectations.<br /><br />The sharp decline in terms of business confidence seems</p>\r\n<div class="article_ads">&nbsp;</div>\r\n<p>to be related to the recent depreciation of Georgia&rsquo;s currency and the recent political developments. The drop in business confidence took seven months, during which Georgian consumer confidence has been steadily declining, influencing consumer demand and sales.<br /><br />While the retail sector was the first to be influenced by the slump in demand, second quarter data shows that the Georgian financial sector is also starting to feel the heat. Financial sector confidence dropped by a record 50.8 points (from 50.9 index points in the first quarter of 2015 to a mere 0.1 points in the second quarter).</p>', '', '', '', 'about-us/news/Business-Confidence-Index-drops-for-Georgia', 1, 0, 5, 'no', 2, 1),
(42, 37, '', '', 1434018540, 1437647340, 2, '', '“International Bank of Azerbaijan – Georgia” – Eight successful years in Georgia', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'on', '', '<p>JSC &ldquo;International Bank of Azerbaijan &ndash; Georgia&rdquo; emerged in the country in 2007. Today, eight years later,</p>', '<p>JSC &ldquo;International Bank of Azerbaijan &ndash; Georgia&rdquo; emerged in the country in 2007. Today, eight years later, IBA-Georgia stands as a universal financial institution, offering a wide spectrum of services. The bank plays a significant role in creating conditions for strengthening of traditional economic relations between structures of Azerbaijan and Georgia and extending credit to prospective projects, which eventually leads to increasing goods turnover between countries. A good example of this is financing of a Georgian part of a Marabda-Kartsakhi railroad construction, with its total volume being approximately 800 million US dollars. <br /><br />&ldquo;Back in the day, when we were deliberating on starting a business in Georgia, we were fully aware that it would be hard to establish a foothold at Georgia&rsquo;s well-developed banking market. However, I think that our initial goals and aims were reached and IBA-Georgia took its place at the Georgian market,&rdquo; says Samir Veliyev, the bank&rsquo;s director general, in a conversation with Georgian Journal.<br />Even though IBA-Georgia isn&rsquo;t yet listed among the market&rsquo;s largest players, it maintains a traditional golden mean at it, as its basic stats show. The bank&rsquo;s stability is founded on its participation in transnational projects, such as Poti methanol terminal, as well as: parts of a new Tbilisi - Senaki concrete highway, a Marabda-Kartsakhi railroad, a new gas pipeline, etc. All these projects are unprecedented in our region, scale-wise.<br />All of them are also interstate, which means that the risk-taking factor in financing them is low. This serves to improve the bank&rsquo;s image of a stable partner and simultaneously represents its strong side.<br />&ldquo;We have an interstate gas pipeline construction project upcoming, which will once again affirm interconnection and strategic partnership of our two countries,&rdquo; says Samir Veliyev.</p>\r\n<p><img style="width: 100%; border-width: 0px; margin: 10px 0 10px 0;" src="http://www.georgianjournal.ge/images/GJ/2015/23/azer-%20bank%20logo.jpg" alt="" width="1101" height="132" /></p>\r\n<p>According to this year&rsquo;s data, the bank&rsquo;s assets have increased by 20,5 percent in a year, now comprising 145,9 million GEL. As Mr. Veliyev says, on one hand increase in the assets was caused by changes in the financing structure of the balance sheet, while on the other it happened due to high dollarization of the bank&rsquo;s assets. Shifts in the Georgian lari&rsquo;s exchange rate have influenced this as well.<br />The bank&rsquo;s mid-term development strategy involves increasing the share of high-income segments in the bank&rsquo;s business, improving its information technologies and increasing its operating efficiency. The latter is done through automating and optimizing business processes.<br />In the near future, the bank plans to open a new head office; as a rule,</p>\r\n<div class="article_ads">&nbsp;</div>\r\n<p>this is one of the significant factors for the bank&rsquo;s future development.<br />&ldquo;We relate this new office to our stable future, which will allow us to rise to a new level of service. I&rsquo;d also like to add that when choosing territory for the new building, we were aiming for maximum comfort for our clients, starting with parking space and ending with service quality. Opening of the new office is planned for this year&rsquo;s autumn, and we are looking forward to seeing our clients at the grand opening,&rdquo; says Mr. Veliyev, who was at the helm of the bank almost since the day of its founding.<br />According to him, if a manager reaches goals that were set, brings plans to fruition and develops the business, he can call himself a successful manager. Considering the road walked by IBA-Georgia, it can be firmly said that the bank has truly managed to find its own way, the way to success.<br />&ldquo;We do not have some special recipe for success &ndash; what we do have is everyday hard labor of our entire collective. One of the support pillars of our business is Azerbaijani investors who actively make use of our services. We have a double responsibility, so to say: on one hand, we have to create comfortable and, most importantly, familiar service conditions for Azerbaijani investors in Georgia, and on the other hand, we need to tailor them to competitive products and tariffs of other players at the market,&rdquo; Mr. Veliyev says.<br /><br />Author: Mari Javakhishvili</p>', '', '', '', 'about-us/news/International-Bank-of-Azerbaijan-Georgia-Eight-successful-years-in-Georgia', 1, 0, 5, 'no', 2, 1),
(43, 38, '', '', 1434106440, 1437648840, 2, '', 'Does Georgian meat have a future at the European market?', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'on', '', '<p>On September 1 of 2014, Deep and Comprehensive Free Trade Area (DCFTA), the main part of the Georgia-EU Association Agreement, took effect. Today</p>', '<p>On September 1 of 2014, Deep and Comprehensive Free Trade Area (DCFTA), the main part of the Georgia-EU Association Agreement, took effect. Today, we can say with confidence that EU member countries are far more familiar with Georgian products such as hazelnuts, kiwi and currants than they were nine months ago.<br /><br />According to Geostat, in the first quarter of 2015, nuts took the third place in the list of top ten Georgia&rsquo;s exported products, generating 52 million USD, which comprised 10 percent of total exports. In total, Georgia&rsquo;s trade turnover in January-May of 2015 comprised 637 million USD, which is 0.4 percent more than the last year&rsquo;s stat. Geostat also shows that export to EU countries comprised 30 percent of Georgia&rsquo;s total export in January-April of 2015. <br />However, unlike wine, mineral water and other reputable Georgian exports, products classified as high-risk will take much longer to enter the EU market. This category includes, first and foremost, meat and dairy. According to specialists, the main obstacle for this is the stringent EU food safety standard, which Georgia does not live up to &ndash; at this stage, at least. <br />According to Lia Todua, manager of Momxmarebeli.ge (Consumer.ge) program by Center for Strategic Research and Development of Georgia, the European standard applies not just to the final product, but to the entire production process:<br />&ldquo;In Europe, food safety begins with livestock health, which means regular vaccination and constant observation for contact with ill or unvaccinated animals. Besides, all livestock should be registered and undergo veterinary supervision. In addition, there are norms for slaughtering, processing of meat, hygiene and so on. It will take several years for our industry to match all these requirements.&rdquo; <br />She also warns that while large producers are forced to adhere to norms small livestock businesses in Georgia operate essentially uncontrolled. <br />Another thing that, as specialists claim, impedes Georgia-produced meat from making it to the European market is lack of accredited laboratories that would conduct veterinary control on a level that would satisfy the EU standard. According to specialists, having a laboratory is a very costly affair, and many small-scale producers simply cannot afford it. <br />Nino Zambakhidze, Chair of the Georgian Farmers&rsquo; Association, considers the future of Georgian meat on the European market a very distant one. According to her, the situation is a bit better when it comes to cows, since there exist slaughterhouses in Georgia that satisfy the international standards. However,</p>\r\n<div class="article_ads">&nbsp;</div>\r\n<p>when it comes to smaller livestock or poultry, things don&rsquo;t look too good &ndash; large companies run their own slaughterhouses, while farmers usually cannot afford such a luxury. Introducing stringent safety standards on processing livestock would cripple them completely.<br />&ldquo;High-risk Georgian products will not appear at the European market before 2020. Besides, why would you want to export it when your country is 80 percent import-dependent? Products such as meat and dairy can only be exported only when your country is deemed trustworthy, which means absence of illnesses in livestock, and this is not the case here. We don&rsquo;t even have quarantine zones at the border to prevent foreign livestock from wandering in,&rdquo; says Nino Zambakhidze.<br />As she claims, another big problem in this entire endeavor is relative ignorance of farmers themselves. They are uninformed about EU standards and requirements and are poorly educated in general. Apparently, when farmers hear that their animals need to be registered or vaccinated, they assume that this is done only to collect more taxes from them. &ldquo;An issue that we frequently encounter is being farmers hiding their livestock. When National Food Agency was conducting large-scale vaccination, farmers did not put their animals up for it, since they were taking advantage of having a socially vulnerable status and did not want to lose it,&rdquo; explains Nino Zambakhidze, concluding that in general, Georgia is far from ready to export its high-risk products to Europe and will most likely remain so until 2020.<br />Her skepticism is shared by Juan Echanove, Food Safety and Rural Development Attach&eacute; of EU Delegation to Georgia. According to him, Georgia would be better off focusing on reducing its import dependency.<br />&ldquo;Priority for Georgia should be to replace import. It is a shame that khachapuri is produced with imported wheat, it is a shame that your cheese is made from imported milk powder, and this is precisely what you need to think about. As for products such as meat and dairy, chances for Georgia to export them are slim due to lack of control in the field. Under the previous government, Georgia completely neglected food safety control and animal disease control. The country still suffers from this, and that&rsquo;s why Europe will not be ready to open your doors to your animal-derived products in near future,&rdquo; said Juan Echanove.</p>', '', '', '', 'about-us/news/Does-Georgian-meat-have-a-future-at-the-European-market', 1, 0, 5, 'no', 2, 1),
(44, 39, '', '', 1444907640, 1437650040, 1, '', 'Content Inc. Summit', '', '', '', '', '', '', '', '', '', '', 'Cleveland, OH', '11 Sep', 'Free', 'http://linkebi.ge', 'on', '', '<p>Are you an entrepreneur looking to get more out of your marketing or to drive innovation in your industry</p>', '<p>Are you an entrepreneur looking to get more out of your marketing or to drive innovation in your industry? Then you&rsquo;ll want to check out the Content Inc. Summit, a one-of-a-kind, day-long workshop happening in Cleveland on Friday, September 11, 2015 following Content Marketing World 2015. Exclusive Small Business Trends $195 member discount available to the Content Inc. Summit. <br /><strong>Discount Code:</strong> <strong>SMALLBIZ</strong> (Use code SMALLBIZ to save $195!)</p>', '', '', '', 'about-us/events/Content-Inc-Summit', 1, 0, 5, 'no', 2, 1),
(45, 40, '', '', 1443872220, 1437651420, 1, '', 'Adobe Max', '', '', '', '', '', '', '', '', '', '', 'Los Angeles, USA', 'Oct 03', 'Free', 'http://max.adobe.com/', 'on', '', '<p>MAX provides strictly unplugged, old-school inspiration with a mix of people from creative leaders</p>', '<p>MAX provides strictly unplugged, old-school inspiration with a mix of people from creative leaders, designers, broadcast and video pros, tech and business strategists, photographers, and more. This shared energy and passion sparks new ideas, drives new partnerships, and breaks new ground every year. MAX attracts inspirational and iconic speakers that share their personal stories. GRAMMY-award winning band Kings of Leon will be there and you can connect with 5,000 other creatives at daily social events.</p>', '', '', '', 'about-us/events/Adobe-Max', 1, 0, 5, 'no', 2, 1),
(46, 41, '', '', 1444736460, 1437651660, 1, '', 'Dreamforce', '', '', '', '', '', '', '', '', '', '', 'San Francisco, USA', 'Oct 13', 'Free', 'http://www.salesforce.com/dreamforce/DF15/', 'on', '', '<p>Whether you&rsquo;re a company of five or a Fortune 500, you&rsquo;ll learn a lot of innovative ways to improve your business at Dreamforce.&nbsp;</p>', '<p>Whether you&rsquo;re a company of five or a Fortune 500, you&rsquo;ll learn a lot of innovative ways to improve your business at Dreamforce. With over 1,400 sessions and thousands of live solutions from the world&rsquo;s largest cloud ecosystem, Dreamforce has tailored content specific to your business size and type, for any role in your company.</p>', '', '', '', 'about-us/events/Dreamforce', 1, 0, 5, 'no', 2, 1),
(47, 42, '', '', 1447328820, 1437652020, 1, '', 'World Business Forum New York 2015', '', '', '', '', '', '', '', '', '', '', 'New York City, NY', 'Nov 12', 'Free', 'https://wbf.wobi.com/', 'on', '', '<p>In 2015 the World Business Forum will present two days of powerful stories; of individuals who face shocks - both personal and organizational</p>', '<p>In 2015 the World Business Forum will present two days of powerful stories; of individuals who face shocks - both personal and organizational - and who use those shocks to achieve the extraordinary. Speakers include Sir Richard Branson, Jim Collins, a former faculty member at the Stanford Graduate School of Business, Walter Isaacson, once the 14th editor of TIME magazine in 1996 and named Chairman and CEO of CNN in 2001, Adam Grant, author of the New York Times bestseller Give and Take and Herminia Ibarra, Professor of Leadership and Learning and Professor of Organizational Behavior at INSEAD.</p>', '', '', '', 'about-us/events/World-Business-Forum-New-York-2015', 1, 0, 5, 'no', 2, 1),
(48, 43, '', '', 1448711460, 1437652260, 1, '', 'Global Small Business Forum', '', '', '', '', '', '', '', '', '', '', 'Chicago, IL', '28 Nov', 'Free', 'http://globalsmallbusinessforum.com/', 'on', '', '<p>The Global Small Business Forum 2015 held in Chicago will help entrepreneurs and small business owners export successfully and network with their peers.&nbsp;</p>', '<p>The Global Small Business Forum 2015 held in Chicago will help entrepreneurs and small business owners export successfully and network with their peers. It will answer such questions as: What\'s the best way to ship goods? How will I get paid? Do I need a license? Should I sell direct or indirect? Does my business have what it takes to sell in China?</p>', '', '', '', 'about-us/events/Global-Small-Business-Forum', 1, 0, 5, 'no', 2, 1),
