(74, 59, '926331691', '176.73.234.42', 1438075121, 0, 3, '', 'more test', 'giorgigvazava87034f3be218f4cf9b5899988a103331e4.jpeg', '865', '', '375', '379', '', '', '', '', '', '', '', '', '', 'on', '', '', 'PARENTS, TEACHERS and THERAPISTS have expressed a need for EDUCATIONAL ACTIVITIES to address the individualised NEEDS of young people. By meeting these needs they hope to provide the best chance for ACADEMIC SUCCESS and develop a “love for learning.” This site will focus on three areas namely, EARLY CHILDHOOD EDUCATION, SKILL DEVELOPMENT (preventative work) and the ability to SUPPORT LEARNING (intervention) when difficulties arise.\n\nEARLY CHILDHOOD EDUCATION requires an understanding of CHILD DEVELOPMENT, visual and auditory PERCEPTUAL SKILLS, PHONOLOGICAL PROCESSING, THINKING SKILLS, MEMORY, gross and fine MOTOR SKILLS, HANDWRITING and much more. The PRIMARY SCHOOL years go on to include READING/LITERACY, SPELLING, MATHS, CREATIVE WRITING, STUDY SKILLS and EXAM WRITING.\n\nSome of the BARRIERS to LEARNING that a young person may experience are THINKING SKILL / COGNITIVE ERRORS, LEARNING DIFFICULTIES, DISABILITIES, DYSLEXIA, EMOTIONAL DIFFICULTIES, ABSENTEEISM, PHYSICAL HEALTH and/or CONTEXTUAL FACTORS to mention but a few. The range of activities on this site (progressively developed) will provide a fabulous AFFORDABLE way for children to EASILY ACCESS INDIVIDUALISED PROGRAMMES from KINDERGARTEN through to the primary years as they PLAY and LEARN. The thoroughly researched THEORETICAL FRAMEWORK used to underpin this site is that of the PASS MODEL of Prof. J.P. DAS and J.A. NAGLIERI.', '', '', '', 'view/926331691/more-test', 29, 1, 5, 'no', 2, 1),
