(117, 102, '', '', 1444716000, 1444924800, 1, '', 'CPHI 2015', '', '', '', '', '', '', '', '', '', '', 'Spain, Madrid', '', 'EUR 500', 'http://www.cphi.com/europe/home ', 'on', 'https://www.youtube.com/watch?v=vL5RxizEfNM', '<p>CPhI brings together the global pharmaceutical community, connecting buyers and suppliers at exhibitions, conferences and online to identify business opportunities.</p>', '<p style="text-align: justify;">CPhI Madrid 2015, the comprehensive pharmaceutical event bringing together leaders and key decision makers from the global pharmaceutical industry in Spain.</p>\r\n<p style="text-align: justify;">Hosting a range of exhibitors in the field of pharma ingredients, machinery and equipment, finished dosage, bio-solutions and outsourcing, this event is your unique opportunity to initiate business and build partnerships in the Spanish&nbsp;and regional pharmaceutical market.</p>', '', '', '', 'about-us/events/httpwwwcphicomeuropehome', 1, 0, 5, 'no', 2, 1),
(118, 103, '', '', 1441173600, 1438783200, 1, '', 'RIGA FOOD 2015', '', '', '', '', '', '', '', '', '', '', 'Riga,Latvia', '', 'EUR 800', 'http://www.bt1.lv/bt1/rigafood/?link=10000000', 'on', 'https://www.youtube.com/watch?v=QgMunl067bM', '<p>The 20th international trade fair for food, beverages, food processing equipment and technology, packaging, innovation, HoReCa equipment and services "Riga Food 2015" will take place at Kipsala International Exhibition Centre, Riga, Latvia from 2&ndash;5 September.</p>', '<p style="text-align: justify;">"Riga Food 2015" will reportedly showcase the newest products and services of companies from more than 35 countries &ndash; the United States, Austria, Belarus, Belgium, Czech Republic, France, Estonia, India, Italy, Canada, Kazakhstan, Cyprus, Russia, China, Nepal, Latvia, Lithuania, the Netherlands, Poland, Slovakia, Finland, Switzerland, Turkey, Ukraine, Hungary, Uzbekistan, Germany, Sweden and other countries.<br /><br />Companies from Spain and India will again take part in &ldquo;Riga Food&rdquo; after several years of break. It is a sign that, despite the difficult political and economic situation in the world, the food industry develops and interest about the Baltic food market is big enough.</p>', '', '', '', 'about-us/events/httpwwwbt1lvlink=10000000', 1, 0, 5, 'no', 2, 1),
(119, 104, '', '', 1442815200, 1443103200, 1, '', 'POLAGRA FOOD 2015', '', '', '', '', '', '', '', '', '', '', 'Poznan,Poland', '', 'Not Defined', 'http://www.polagra-food.pl/pl/', 'on', 'https://www.youtube.com/watch?v=TeBf4EPV2Ko ', '<p>POLAGRA FOOD is a project of a long tradition which actively follows the changes taking place in the food industry and which is continually open to the needs resulting from the economic and social situation.</p>', '<p style="text-align: justify;">Aiming at creating new perspectives for food producers, POLAGRA FOOD project is&nbsp;&nbsp;taking actions providing possibilities for foreign merchants to visit the fair. POLAGRA FOOD ADMINISRATION also creates tools and organizes special events which are to intensify the dialog and mutual cooperation between our exhibitors and their clients.</p>\r\n<p style="text-align: justify;">POLAGRA FOOD administration is&nbsp;&nbsp;deeply convinced that such a formula of the food industry&rsquo;s most important event will again benefit the development of the sector in 2015. one of the main goals of&nbsp;POLAGRA FOOD exhibition is to&nbsp;&nbsp;is to provide support in terms of searching for new markets as well as to implement innovations which will meet the needs of customers.</p>', '', '', '', 'about-us/events/httpwwwpolagra-foodplen', 1, 0, 5, 'no', 2, 1),
(120, 105, '', '', 1444318380, 1444318380, 1, '', 'Prince Harry and Georgian businessman on the same tribune at Georgia vs. Namibia match', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'on', '', '<p>On October 7, in Exeter, southwest England, Georgian National Rugby Team defeated Namibia in a World Cup game.</p>', '<p>On October 7, in Exeter, southwest England, Georgian National Rugby Team defeated Namibia in a World Cup game. It is noteworthy that Prince Harry from England&rsquo;s royal family attended the match and observed the tense game with great curiosity. Moreover, the camera has also captured Georgian businessman Levan Vasadze who was sitting in the same tribune along with the President of Georgian Rugby Union Gia Nijaradze and Givi Chichinadze, the Governor of Imereti (Georgia&rsquo;s western region).</p>', '', '', '', 'about-us/news/Prince-Harry-and-Georgian-businessman-on-the-same-tribune-at-Georgia-vs-Namibia-match', 1, 0, 5, 'no', 1, 1),
(121, 106, '', '', 1444319940, 1445011140, 2, '', 'Prince Harry and Georgian businessman on the same tribune at Georgia vs. Namibia match', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'on', '', '<p>On October 7, in Exeter, southwest England, Georgian National Rugby Team defeated Namibia in a World Cup game.</p>', '<p>On October 7, in Exeter, southwest England, Georgian National Rugby Team defeated Namibia in a World Cup game. It is noteworthy that Prince Harry from England&rsquo;s royal family attended the match and observed the tense game with great curiosity. Moreover, the camera has also captured Georgian businessman Levan Vasadze who was sitting in the same tribune along with the President of Georgian Rugby Union Gia Nijaradze and Givi Chichinadze, the Governor of Imereti (Georgia&rsquo;s western region).</p>', '', '', '', 'about-us/news/Prince-Harry-and-Georgian-businessman-on-the-same-tribune-at-Georgia-vs-Namibia-match', 1, 0, 5, 'no', 2, 0),
(122, 107, '', '', 1444320720, 1445011920, 2, '', 'The Mountain Resorts of Georgia Prepare for Winter’s Hot Season!', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'on', '', '<p>The mountains of Georgia are becoming more and more attractive for foreign tourists as well as for the local population.</p>', '<p>The mountains of Georgia are becoming more and more attractive for foreign tourists as well as for the local population. One can find articles about Gudauri, Bakuriani and other Georgian winter resorts in the foreign press and the aim of those articles is to attract more people. That is why the Ministry of Economy and Sustainable Development of Georgia, Ltd. &ldquo;Mountain Resorts Development Company&rdquo; are already actively involved in the preparation process. Their work area includes the Gudauri, Bakuriani (Didveli, Kokhta, Mitarbi) and Goderdzi ski resorts. For the places to be ready for tourists, several projects are underway. Currently, on the Kokhta and Mitarbi mountains, new ski lifts are being installed, which will contribute to the further development of ski tourism in the historical Georgian resort.</p>\r\n<p>&nbsp;</p>\r\n<p><img style="text-align: left;" src="http://www.georgianjournal.ge/images/GJ/2015/40/logo%20-%20eng.jpg" alt="" width="250" height="175" />&nbsp;On Kokhta Mountain, the new ski lift will have an intermediate station. The construction will be completed in December 2015. New touristic infrastructure for 500 persons will be built in the surrounding area &ndash; hotels, aparthotels, cottages, restaurants and leisure facilities.<br /><br />On Mitarbi Mountain, two new ski lifts and one platter lift will be installed. Construction will be completed by the end of 2016. New infrastructure for 300 persons will be built in the surrounding area &ndash; hotels, aparthotels, cottages, restaurants and leisure facilities. <br /><br />The implementation of the abovementioned projects will contribute to further fruitful development of ski tourism, creating new workplaces, as well as a favorable investment environment. <br /><br />The projects are implemented jointly by state and private sectors. The</p>\r\n<div class="article_ads">&nbsp;</div>\r\n<p>latter is presented by &ldquo;Akhali Mitarbi&rdquo; Ltd., which is a part of GRDC holding. <br /><br />The construction of the Kokhta and Mitarbi ski lifts will be funded by the government (48 million GEL) and the private sector (70 million GEL). It will be one of the biggest investments in ski tourism.</p>\r\n<p>&nbsp;</p>\r\n<p>The ski lifts of Kokhta and Mitarbi will be installed by a leading company in this field &ndash; Doppelmeyr. At the Kokhta mountain resort, the season will open on December 27th .<br /><br />In Bakuriani, the additional attraction of a Toboggan, a two-rail mountain sledge, will be installed close to the first ski lift. Construction will be completed by the end of 2015.<br /><br />Therefore, the Gudauri and Goderdzi ski resorts are also actively involved in the preparation processes. At the beginning of December, the season opening will be carried out at the Goderdzi ski resort and afterwards, at Gudauri and Bakuriani. <br /><br />So those who decide to spend the winter holidays in Georgia are going to have an unforgettable time. So, if you have already made up your mind, hurry up and book your places.</p>', '', '', '', 'about-us/news/The-Mountain-Resorts-of-Georgia-Prepare-for-Winters-Hot-Season', 1, 0, 5, 'no', 2, 0),
(123, 108, '', '', 1444409460, 1445014260, 2, '', 'The 10 Dishes That Will Make You Fall in Love With Georgian Food', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'on', '', '<p>When you arrive in Tbilisi, border agents don\'t just stamp your passport;</p>', '<p>When you arrive in Tbilisi, border agents don\'t just stamp your passport; they hand you a bottle of wine. It\'s a fitting welcome to Georgia, a mountainous country sandwiched between Europe and Asia, where dinner guests are exalted as "gifts from God" and traditional feasts called supras unfold in biblical proportions, sometimes lasting for days on end, seriouseats.com website reports. <br /><br />It\'s easy to lose track of time at the Georgian table. On a recent visit to the country\'s capital, I joined some friends for a dinner that entailed a dizzying array of salads, followed by steaming vats of heady stews and braises, gallons of orange wine, and occasional forays into polyphonic harmony, a signature feature of Georgian folk music. Staggering back to my hotel at 4 a.m., stuffed and delirious, I felt like I had emerged from a culinary fever dream. <br /><br />The good news is, you no longer have to board a flight to the Caucasus to have a supra. In New York City alone, five Georgian restaurants have sprung up in the last three years. Georgia\'s distinctive orange wine, once known to only the savviest sommeliers, is now cropping up on wine lists across the country (some are even dubbing it the new ros&eacute;). And for DIYers, there\'s Darra Goldstein\'s encyclopedic, unrivaled cookbook, The Georgian Feast, newly released in second edition.</p>', '', '', '', 'about-us/news/The-10-Dishes-That-Will-Make-You-Fall-in-Love-With-Georgian-Food', 1, 0, 5, 'no', 2, 0),
(124, 109, '', '', 1444409640, 1445014440, 2, '', 'The Man Who Thinks With His Fingers', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'on', '', '<p>According to the self-taught sculptor Levan Bujiashvili, he thinks with his fingers, and his work fully reflects this.</p>', '<p>According to the self-taught sculptor Levan Bujiashvili, he thinks with his fingers, and his work fully reflects this. It also seems that Mr. Bujiashvili ran out of space to display his sculptures, and this is why they are scattered all over Tbilisi and other Georgian cities. When walking down Rustaveli Avenue in particular, it is hard to miss tourists and locals alike posing for photos with Bujiashvili&rsquo;s statues. Some want to get acquainted with the artist who created them, but few actually follow through with that desire. Luckily,<em>Georgian Journal</em> did. We invited the prolific sculptor for an interview, and here is what he had to say:<br /><br /><em><strong>&ldquo;It only takes one touch to feel what I can make from a stone.&rdquo;</strong></em><br /><br />&ndash; The results of my work are there for all to see. I think that these sculptures have contributed their share of&nbsp;positivity to the capital&rsquo;s main boulevard. I am not so fond walking through it myself, but some time ago I had to do so. And to be honest, I found seeing tourists pose with my sculptures to be quite pleasant. Children also seemed to be very fond of them.<br /><br /><strong>&ndash; How much of your work decorates Rustaveli Avenue, exactly?</strong><br /><br />&ndash; Initially there were 50 pieces in total, but later some of them got stolen. Now only 42 remain. When I created these sculptures, I named them after my friends and also put down my own name. Since then, many people have sought me out. I can therefore proudly say that a large share of my success is owed precisely to the fact that my work decorates the country&rsquo;s main avenue. It was a correct step for me to make.<br /><br />Also, another place with my sculptures is the Artists&rsquo; Bar near Tbilisi&rsquo;s Dry Bridge.</p>\r\n<p><strong>&ndash; Another favorite tourist spot, is it not?</strong></p>\r\n<p><strong><img style="text-align: left;" src="http://www.georgianjournal.ge/images/GJ/2015/40/erti%20kargi%20adamianis%20ezo.jpg" alt="" width="250" height="188" />&nbsp;&ndash; Yes! There stands my &ldquo;Unknown Artist&rsquo;s Sculpture.&rdquo; I tried to keep the scale natural when creating it. It was made specifically for tourists to be photographed with, and the concept worked. The place was chosen strategically, and the sculpture fits the overall theme.<br /><br />Another one of my works, composed of 21 pieces, stands in Rustavi. Gori and Zestafoni also have several. When choosing my next creation for a city, I always pay attention to whether it would be acceptable for children; if there are no complaints from them, I take it as a step in the right direction.<br /><br /><em><strong>&ldquo;I</strong></em></strong><strong><em><strong>made a family of stone turtles and added a few bottles of mineral water to the composition to specify their origin.&rdquo;</strong></em><br /><br /><strong>&ndash; Do you have a muse that inspires you?</strong><br /><br />&ndash; Sometimes I invent a muse: When I like a person, I pretend that this person is immaculate and flawless. This does not happen in real life, though. Others have their own lives and I have mine. But if they leave a trace in my thoughts, they become beautifully reflected in my art. I never had an inspiring muse in the classic sense. Here is how my mind works: I am happy when I&rsquo;m busy with my art; everything else revolves around it. I also do not trust alcohol to help me with my work &ndash; all of my sculptures were created when I was fully sober. For me, drinking is associated with something completely different. I do not know whether it is a good or a bad thing.<br /><br /><strong>&ndash; Have you ever had to redo any of your works?</strong><br /><br />&ndash; Of course, especially when working with bronze. Since I do not have a classical education, I frequently have to rework things. I can redo a sculpture a thousand times, as long as I get the necessary result, and this process does not cause me any discomfort. <br /><br />The bigger the sculpture the more interesting it is to work with it. As for materials, aside from wood, I work with bronze, copper and burnished metal. For example, when taking a walk along a riverbank, I look at stones and think, &ldquo;I can make something from this one or that one.&rdquo; It only takes one touch to feel what I can make from a stone. Just like that, I think with my fingers. </strong></p>\r\n<p><strong>&ndash; In what countries besides Georgia can one encounter your work?<br /><br />&ndash; Just recently I was at a symposium in Baku. It was a meeting of sculptors from all over the world who made their sculptures from used items. I was the only one invited from Georgia. The symposium was supported by Mehriban Aliyeva and opene<img style="text-align: right;" title="The Man Who Thinks With His Fingers" src="http://www.georgianjournal.ge/images/GJ/2015/40/baqo-kuebis%20ojaxi.jpg" alt="geotv.ge" width="424" border="0" />d by her daughter. The work that I brought with me was met with appreciation. I made a family of stone turtles and added a few bottles of mineral water to the composition to specify their origin. Today this family decorates one of Baku&rsquo;s oldest districts. <br /><br />Also, in the old part of Lithuania&rsquo;s capital, Vilnius, there is a spot where artists like to gather. It is decorated by my &ldquo;flamingo.&rdquo;<br /><br />By the way, in the near future there will be another one of my pieces, featuring ballerinas, added to Tbilisi. But I won&rsquo;t tell you where it will be located. You&rsquo;ll have to find that out for yourself in a month.</strong></p>', '', '', '', 'about-us/news/The-Man-Who-Thinks-With-His-Fingers', 1, 0, 5, 'no', 2, 0),
(125, 110, '', '', 1444410000, 1445014800, 2, '', 'Rustavi 2: The Saga Continues', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'on', '', '<p>Will the events around Rustavi 2 mark the beginning of the ruling party&rsquo;s end?</p>', '<p><img style="margin-bottom: 10px;" src="http://www.georgianjournal.ge/pictures/image2/c08fbcfb9551e283948e91992f97e322.jpg" alt="" width="100%" /></p>\r\n<p><strong>Will the events around Rustavi 2 mark the beginning of the ruling party&rsquo;s end?</strong> <br /><br />&ldquo;With their decision, the authorities have closed down Rustavi 2.&rdquo; This is what the Director General of the TV Company, Nika Gvaramia said during an extraordinary press-conference, after it was reported that the Sakartvelo TV Company which owns 51 percent of Rustavi 2 shares, was arrested. Gvaramia also said that the Public Registry office intentionally delayed the registration of USD 6 million, which was raised by the company. He also made no secret that those 6 million dollars were to be invested by the former Defense Minister, Davit Kezerashvili&rsquo;s relative, Demetre Chiqovani. But as the lawyers of Kibar Khalvashi say, they addressed the court because Rustavi 2 was planning to sell the majority of its shares to another enterprise and that would mean changing of the biggest shareholder. Kibar Khalvashi claims that during the previous government, Rustavi 2 was illegitimately confiscated from him. A few weeks ago, by Khalvashi&rsquo;s request, the court arrested the property of Rustavi 2. <br /><br /><em><strong>The director general of the TV Company, Nika Gvaramia says that the processes are tied to the upcoming parliamentary elections. For former Prime Minister Bidzina Ivanishvili the independent media is totally unacceptable, especially during the pre-election period, he claims. Gvaramia hopes society will stand by the freedom of speech and calls for financial help. </strong></em></p>\r\n<p>&nbsp;</p>\r\n<p><em><img style="text-align: right;" src="http://www.georgianjournal.ge/images/GJ/2015/40/kvesitadze.jpg" alt="" width="350" height="263" />Gvaramia says the processes are tied to the upcoming parliamentary elections. For former Prime Minister Bidzina Ivanishvili the independent media is totally unacceptable, especially during the pre-election period, he claims. Gvaramia hopes society will stand by the freedom of speech and calls for financial help. <br />Somehow, the political environment in the country has always directly reflected on Rustavi 2. The company changed its owner twice and one of them was Kibar Khalvashi, a businessman with a not quite agreeable reputation. He was friends with the former Prosceutor General and former Defense Minister, Irakli Okruashvili. Later, Rustavi 2 was passed on to the Karamanashvili brothers. Some say, one of them was then-President Mikheil Saakashvili&rsquo;s close friend and trusted man. <br /><br />Inarguably, a few years ago, Kibar Khalvashi was an instrument in the hands of the National Movement, to keep control over Rustavi 2. Accordingly, there is a possibility of him being the same kind of instrument today, this time in the hands of the current authorities.</em></p>\r\n<p><em>Inarguably, a few years ago, Kibar Khalvashi was an instrument in the hands of the National Movement, to keep control over Rustavi 2. Accordingly, there is a possibility of him being the same kind of instrument today, this time in the hands of the current authorities.</em></p>\r\n<p><em>The whole picture becomes even more aggravated if we remember that the case of Erosi Kitsmarishvili&rsquo;s sudden death is still not investigated. Kitsmarishvili was a founder of Rustavi 2 and the parliamentary opposition thinks his bizarre demise is tied with the current government&rsquo;s plans to appropriate Rustavi 2.</em></p>\r\n<p><img style="text-align: left;" src="http://www.georgianjournal.ge/images/GJ/2015/40/gvaramia-pk.jpg" alt="" width="300" height="171" />What is the free media, after all? In my opinion, it is when the members of society are able to receive information from different sources and to draw conclusions by themselves. On the other hand, I also agree that the media is not only the fourth estate. It is also an important instrument that can form public opinion. As they say in Georgia, this often looks very much like brainwashing. However, all the members of our society have to agree, that the free and diverse media, be it a newspaper or a broadcaster, whether biased or professionally accomplished, is a precondition of democracy. And the democratic state is the fundamental condition that will ensure our transition from the post-soviet slump to the free society. Before our authorities realize that, the parliamentary opposition has already announced mass protests in support of Rustavi 2. The situation was worsened when the three participants of the rally were detained by the police. The reason was that they physically abused one of the Parliament Members, Davit Lortkipanidze and damaged his jacket. They are now in pretrial detention and may face 7 years in prison if found guilty. So, with the situation being what it is, the parliamentary opposition has announced the beginning of the current government&rsquo;s end.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '', '', '', 'about-us/news/Rustavi-2-The-Saga-Continues', 1, 0, 5, 'no', 2, 0),
(126, 111, '', '', 1444496880, 1445015280, 2, '', 'Ankara explosion: Blasts hit rally in Turkish capital', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'on', '', '<p>Two explosions have hit a peace rally in the Turkish capital Ankara, causing multiple casualties, reports say.</p>', '<p><img style="margin-bottom: 20px;" src="http://www.georgianjournal.ge/pictures/image2/acd4e49cd66f6de03d25d53a7a5f2724.jpg" alt="" width="100%" /></p>\r\n<p>Two explosions have hit a peace rally in the Turkish capital Ankara, causing multiple casualties, reports say. <br />Turkish news agency Dogan said that at least 20 people have been killed. TV footage shows scenes of panic and people lying on the ground covered in blood, amid protest banners, BBC reports. <br />The blasts took place near the city\'s central train station.<br />The target appears to have been a march calling for an end to the violence with the Kurdish separatist group, the PKK.<br />Prime Minister Ahmet Davutoglu is being briefed by the interior and health ministers, state news agency Anadolu says.<br />Government officials say the blasts were a terrorist attack and are investigating reports that a suicide bomber was behind at least one of the explosions.<br />The leader of the pro-Kurdish HDP party has blamed the state for the attack, and cancelled all election rallies.<br />The HDP was among those calling for Saturday\'s rally for "peace and</p>\r\n<div class="article_ads">&nbsp;</div>\r\n<p>democracy", which was due to start at 12:00 local time.<br />The party tweeted that there were "numerous dead and injured", and that police "attacked" people carrying the injured away, BBC informs. <br />Local resident Emre told the BBC that he heard two separate explosions and saw a number of dead bodies. Angry people tried to attack police cars, he said.<br />An HDP rally in the city of Diyarbakir was bombed in June, ahead of general elections.<br />Turkey is holding another election next month, and the BBC\'s Mark Lowen in Istanbul says it was feared that another similar attack was imminent.</p>', '', '', '', 'about-us/news/Ankara-explosion-Blasts-hit-rally-in-Turkish-capital', 1, 0, 5, 'no', 2, 0),
(127, 112, '', '', 1444584240, 1445016240, 2, '', 'Accidentally Discovering Georgia: An American Photographer Happily Lost in Svaneti', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'on', '', '<p>Robert Cooper is an American photojournalist from Texas. He has resided in Tbilisi for the last year.</p>', '<p><img style="margin-bottom: 10px;" src="http://www.georgianjournal.ge/pictures/image2/1417a091178762af8917195c9c348def.jpg" alt="" width="100%" /></p>\r\n<p>Robert Cooper is an American photojournalist from Texas. He has resided in Tbilisi for the last year. <br /><br /><em><strong>These images capture some of my experience in Mestia, Ushguli, Iprari, and Adishi. Svaneti and the area around Kazbegi offer some of the more beautiful views in Georgia. There&rsquo;s no shortage of photo opportunities in either region.</strong></em></p>\r\n<p><em>I purchased my ticket to Kutaisi when I was in Vilnius, Lithuania. It wasn&rsquo;t a planned trip and I bought the Wizz air ticket with cash at the airport the morning of the flight. I knew very little about Georgia &ndash; so little that I assumed that I was flying into Tbilisi. <em><br />Go through the gallery:</em></em></p>', '', '', '', 'about-us/news/Accidentally-Discovering-Georgia-An-American-Photographer-Happily-Lost-in-Svaneti', 1, 0, 5, 'no', 2, 0),
(128, 113, '', '', 1444671000, 1445016600, 2, '', '“This truly is moving” - Ashton Kutcher comments about Batumi’s Ali and Nino statue', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'on', '', '<div class="blog_text">The well-known Hollywood actor, Ashton Kutcher, made a comment about one of Georgia&rsquo;s landmarks</div>\r\n<p>&nbsp;</p>', '<p><img style="margin-bottom: 10px;" src="http://www.georgianjournal.ge/pictures/image2/20bb93965803f9e2050532e451ade6e3.jpg" alt="" width="100%" /></p>\r\n<p>The well-known Hollywood actor, Ashton Kutcher, made a comment about one of Georgia&rsquo;s landmarks , the statue of Ali and Nino. &lsquo;This truly is moving,&rdquo; wrote Kutcher on his Facebook page about the animated statue that was installed in the coastal city of Batumi in 2011.<br /><br />Ali and Nino was damaged a few months ago, during its relocation. Namely, Nino&rsquo;s statue fell from the crane. However, Batumi&rsquo;s trademark was quickly restored and installed at a new place, close to the observation wheel, where the heavy storms will not threaten it. <br /><br />This 8-meter-tall moving monument, which symbolizes unending love and unity between two nations, has become one of the city\'s symbols. It was made by a Georgian artist and sculptor Tamar Kvesitadze, modeled after two main characters of Azerbaijani writer Kurban Said\'s novel of the same name. Many say that it also symbolizes a connection between Europe and Asia.<br /><br />As for the <a href="http://aplus.com/a/tamara-kvesitadze-ali-and-nino-georgia-batumi-sculpture?c=3156&amp;utm_campaign=i102&amp;utm_source=a88554" target="_blank"><strong>article </strong></a>shared</p>\r\n<div class="article_ads">&nbsp;</div>\r\n<p>by Ashton Kutcher via his facebook page, it was published by aplus.com website, whose founder is Kutcher himself. "There have been many great love stories in the history of mankind &mdash; from Adam and Eve, to Romeo and Juliet, to John Lennon and Yoko Ono, to your neighbor and that Tinder guy she\'s been dating for the past couple of months. But here\'s a love story you probably haven\'t heard: Ali and Nino," the article reads. <br /><br />The post gave rise to the positive reaction from his friends and fans. They write that this statue is located in Georgia and that Ashton should consider seeing it.</p>', '', '', '', 'about-us/news/This-truly-is-moving---Ashton-Kutcher-comments-about-Batumis-Ali-and-Nino-statue', 1, 0, 5, 'no', 2, 0),
(129, 114, '', '', 1444757580, 1445016780, 2, '', 'Manliness overload! – How Georgian rugby players prepare for the victories (Video)', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'on', '', '<p>Now as the group stage of Rugby World Cup 2015 has ended and Georgian National Team has more than achieved</p>', '<p>Now as the group stage of Rugby World Cup 2015 has ended and Georgian National Team has more than achieved its main goal, let us remember how The Lelos were preparing for the championship. This video was uploaded to the Georgian Rugby Union Facebook page and it shows how selflessly Georgian players practice to meet all the requirements of the World Cup. <br /><br />Camera man: Vakho Chikvaidze; Editor: Lasha Lortkipanidze<br /><br /><a href="http://video.ambebi.ge/files-3/2015/10-13/georgian-rugby-union-official1qtp.mp4" target="_blank">Video</a></p>', '', '', '', 'about-us/news/Manliness-overload--How-Georgian-rugby-players-prepare-for-the-victories-Video', 1, 0, 5, 'no', 2, 0),
(130, 115, '', '', 1444931040, 1445017440, 2, '', 'October declared a Georgian Wine Month in the U.S.', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'on', '', '<p>The Georgian Wine Month has started in the USA. The event began in New York, by sampling Georgian wine.</p>', '<p><img style="margin-bottom: 10px;" src="http://www.georgianjournal.ge/pictures/image2/1e8b45e0b95bf4b54a711b0ca42e6995.jpg" alt="" width="100%" /></p>\r\n<p style="text-align: justify;">The Georgian Wine Month has started in the USA. The event began in New York, by sampling Georgian wine. It was conducted by an American company Tastingwork, the members of the Georgian Wine Agency and its head, Lisa Granik. <br /><br />The participants of the degustation were 22 companies. They presented traditional wines as well as wines that were made using European methods. In the framework of this event, the workshop was held, concerning the history of Georgian wine. It was conducted by a wine magister, Lisa Granik.</p>', '', '', '', 'about-us/news/October-declared-a-Georgian-Wine-Month-in-the-US', 1, 0, 5, 'no', 2, 0);
