(131, 116, '', '', 1444764000, 1445023200, 2, '', 'Georgia: rise and shine - Kazbegi from a foreigner\'s eye', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'on', '', '<p>Georgia&rsquo;s highland town Kazbegi located in the north-eastern part of the country has fascinated</p>', '<p><img style="margin-bottom: 10px;" src="http://www.georgianjournal.ge/pictures/image2/101a341c90c6a3d96115591e7614ac09.jpg" alt="" width="100%" /></p>\r\n<p>Georgia&rsquo;s highland town Kazbegi located in the north-eastern part of the country has fascinated and left many foreigner visitors speechless for centuries. Great Russian poet Alexander Pushkin impressed with its beauty even dedicated a rhyme to the 14th century Gergeti Trinity Church standing under famous Mount Kazbegi. <br /><br />This historical part of Georgia has flourished and attracted more and more tourists&nbsp;as the years passed by.<br /><br /><a href="http://www.cntraveller.com/recommended/coast-countryside/design-hotels-georgia" target="_blank">Cntraveller.com </a>has published an article by Jonathan Bastable who got to know Georgia when it was a sleepy Soviet republic and after returning for the first time since independence, he found it more lively, modern and eye-catching. <br /><br />Here is what the foreign traveler writes about Kazbegi, its beautiful landscape and a new hotel located there:<br /><br />&ldquo;In the highlands of Kazbegi, mornings are the best time of day. The Russian poet Boris Pasternak, who loved the Caucasus, compared this rocky part of Georgia to a \'great rumpled bed\'. And it is quite a thing to wake up at cock\'s crow and, from the comfort of your own rumpled bed, to look out across the valley to the lonely Church of the Trinity on the nearest peak. The distant chapel has the distinctively Georgian spire: an inverted cone, like the upturned tip of a brand-new crayon. The adjacent bell tower has the same pointed lid on it, and together they look like salt and pepper pots placed on a flowing green tablecloth.<br /><br />The Caucasian uplands are craggier, more flinty than the Alps or Pyrenees. Their pikes and ridges are as sharp and dangerous as the blade of a shashka - the \'long knife\' wielded by the Circassian tribesmen who once populated this country. The mountains are so tightly packed they seem to be jostling for space. The taller ones stand at the back, like children in a class photo - and, like some schoolchildren, they often have their heads in the clouds. Ah, but when those clouds part and the summit of Mount Kazbek appears, you know why this part of the world so captivates visitors, and why Georgians insist that their homeland is a God-given corner of paradise. Kazbek at dawn is a superb sight: a soaring white crest that (it has been said) resembles a cardinal\'s hat. When the risen sun shines directly on its snowy east face, the mountain blazes like a searchlight, and is almost too bright to look at.</p>', '', '', '', 'about-us/news/Georgia-rise-and-shine---Kazbegi-from-a-foreigners-eye', 1, 0, 5, 'no', 2, 0),
(132, 117, '', '', 1444852260, 1445025060, 2, '', 'Freedom of Speech', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'on', '', '<p>All of our governments of various periods in the last twenty-five years have been at a loss when it came to the relationships</p>', '<p><img style="text-align: left;" src="http://www.georgianjournal.ge/pictures/image2/40885ea6d190852c804203b0910f6ee2.jpg" alt="" width="283" height="279" />&nbsp;<strong>All of our governments of various periods in the last twenty-five years have been at a loss when it came to the relationships</strong> <strong>with media because media forms itself much quicker as a democratic institution than governments in general.</strong><br />The Human Rights theme is not my bread-and-butter in life, but I know by heart the entire text of the Bill of Rights and, frankly, I have developed a taste for human freedoms as such from that most read, cherished and celebrated political document in the history of mankind. Nothing is sweeter and more important for us the humans than freedom to speak our mind. It is the most pivotal freedom for Homo sapiens. The rest of the freedoms are based on this particular freedom &ndash; the freedom of expression. If you are deprived of a chance to speak out, slavery is guaranteed, and the only thing that can help to get back into normal human existence is again the freedom of speech. The American constitution went into force in 1789, and all of a sudden, it became known that the human rights were not specified in the text of the country&rsquo;s major governing blueprint. The lacking significant part of the main law of the land was immediately added to the text in the form of amendments &ndash; the first ten amendments to the Constitution of the United States of America. The very first one out of these ten amendments says that no law or act by government may abridge the freedom of speech or of the press. The Georgian constitution emphasizes the same human right, based on the same human value, based on the same human ideal. Formally! In reality, we are right in the middle &ndash; if not at the beginning &ndash; of the road, propelling us towards the model of societal structure which honors the so called human rights to the utmost. But we are working on it! Our society is changing to a certain extent albeit very slowly. Starting from the very moment of grabbing the latest chance of political independence as a result of the soviet collapse about a quarter of a century ago, our political behavior is under permanentimprovement and reconstruction. We have been diligently trying to acquire the glossy western fa&ccedil;ade, thus paving the way towards European structures and institutions as well as American strategic partnership for feeling better in terms of internal</p>\r\n<p>tranquility and international security. But not always we manage to reach the successful end. And the reasons for our failures are amply detectable. One of the most noticeable for both the foreign and the domestic eye happens to be the attitude of Georgian administrations of various times towards the media of mass communication, especially the TV broadcasting, which often becomes the victim of the angered governmental powers. The classical knowledge of PR and journalism is prompting the governments of the world to be careful with a written and broadcast word because they have the ability to stir the minds and move the hearts of those masses, by which the rulers of the nations are usually elected and reelected, or brought down and trashed like historical waste. In most cases, this axiomatic philosophy of interaction between media and government is alive and working. Moreover, this is the proverbial truth which most of the countries are no longer ignoring because they know exactly what kind of &lsquo;rascals&rsquo; they are having to do in the person of the ladies and gentlemen of the press. The government officials are often trained on a very high level for their skill of handling media. Media needs to be treated fairly and correctly because media is today powerful, educated, informed and adroit, and they know well how to handle governments, and do this with absolute professional precision. Do we know this much in Georgia? I doubt! Here, the media-governmental mutual exacerbation is a commonplace thing. We have seen in this country the officially authorized armed-to-the-teeth minions of law taking over TV stations right in the middle of their presence on the air. We have seen the broadcasting media going off the air due to their persistent anti-administration commentary. We have lately been witnessing the disappearance from the air of several TV talk-shows because they would feed to public the flaws of the government rather than its merits. We have also observed the attempt of severe financial debilitation of a critically-poised TV station which usually enjoys the outstanding rating in the market. These are the facts that defy the effective functionality of democratic institutions in favor of our society, and make our chances thinner for perpetuation of freedom of speech in Georgia. We are a new, inexperienced political culture, therefore our political stance might sooner be hostile than amicable towards politically crucial institutions like means of mass communication. All of our governments of various periods in the last twenty-five years have been at a loss when it came to the relationships with media because media forms itself much quicker as a democratic institution than governments in general. Governments take longer to reconcile themselves with freedom of speech &ndash; one of the most significant components of democracy, especially if the new democracy is coming from the rigid depths of long-standing social order of communistic make. Governments need to be prompted so that they discern better between the good and the evil. If our government is one of those who needs that kind of a prompter, this editorial might very well qualify as one, the main message of which is not to fight media but to remember once and for all: If you cannot beat them, join them!</p>', '', '', '', 'about-us/news/Freedom-of-Speech', 1, 0, 5, 'no', 2, 0),
(133, 118, '', '', 1445026020, 1445026020, 1, '', 'The Four Seasons (Shadow Theatre)', '', '', '', '', '', '', '', '', '', '', 'Hall Small Stage', '', '6, 8 GEL', '', 'on', '', '<p>Writer, director: Gela Kandelaki</p>', '<p>Writer, director: Gela Kandelaki<br />Cast: Vadim Shubitidze, Elene Murjikneli, Paata Shengelia, Anzhela Abshilava, Giorgi Chanturia, Elene Zurabashvili<br /><strong>Duration: 70 minutes</strong></p>', '', '', '', 'about-us/events/The-Four-Seasons-Shadow-Theatre', 1, 0, 5, 'no', 2, 1),
(134, 119, '', '', 1445803200, 1446235200, 1, '', 'The exhibition "Georgians in World War II," dedicated to the 70th anniversary of the victory over fascism.', '', '', '', '', '', '', '', '', '', '', '3, Rustaveli Ave', '', 'Free', '', 'on', '', '<p>Simon Janashia State Museum</p>', '<p><strong>Simon Janashia </strong></p>\r\n<p><em>State Museum 3, Rustaveli Ave.</em></p>\r\n<p>Tel: 299-80-22</p>\r\n<p>Museum is working every day except Monday.</p>\r\n<p>From 10:00 till 18:00 from - June 26 till - October 31</p>', '', '', '', 'about-us/events/The-exhibition-Georgians-in-World-War-II-dedicated-to-the-70th-anniversary-of-the-victory-over-fascism', 1, 0, 5, 'no', 2, 1),
(135, 120, '048438377', '176.73.234.42', 1445040535, 0, 3, '', 'Nabeglavi', 'giorgigvazava87e208335defbd361dc1a789938b34dfab.jpg', '1413', '', '135', '266', '1 year', 'bottle', 'Oscar', '', '', '', '', '', '', 'on', '', '', 'Nabeglavi is a natural sodium bicarbonate mineral water. It has been applied for a long time for prevention and therapy of chronic stomach and liver diseases. Moreover, the mineral maintenance of the water has a complex good effect for most of the systems of the human body: cardiovascular, nervous, endocrine, excretory. Key features and advantages of this water is a combination of minerals that allows Nabeghlavi to be used not only for medical purposes, but also for daily drinking. This means that it can be used every day and with no limitations - but taken into consideration that for people with high stomach acidity it is recommended to use "Nabeglavi" warm and CO2-free, with low stomach acidity - carbonated and chilled.', '', '', '', 'view/048438377/Nabeglavi', 44, 1, 5, 'no', 2, 1),
(136, 121, '778540332', '176.73.234.42', 1445042488, 0, 4, '', 'Other personal service activities n.e.c.', '', '', '', '535', '552', '', '', '', '', '', '', '', '', '', 'on', '', '', 'If you\'re interested in setting up shop on the internet to promote your service, these simple strategies will help you bring in the business. Lately, I\'ve been receiving a lot of questions from people selling a service--or thinking about selling a service--over the web, asking what you need to do differently than those people marketing a physical product. It\'s a good question. Because while almost all the selling and traffic generation techniques I teach work equally well for both product- and service-based business models, there are a few unique challenges faced by those selling services that warrant special discussion.', '', 'thats cool', '', 'view/778540332/552', 45, 1, 5, 'no', 2, 1),
