(155, 140, '153762867', '212.72.128.130', 1446557141, 0, 4, '', 'Funeral Guide', '', '', '', '533', '536', '', '', '', '', '', '', '', '', '', 'on', '', '', 'Whether you&rsquo;re planning for yourself or for a loved one, the funeral service is one of the most important elements of a person&rsquo;s final arrangements. With the opportunity for great personalization, the funeral service can truly reflect the', '', '', '', 'view/153762867/536', 58, 1, 5, 'no', 2, 1),
(145, 130, '', '', 1443934800, 1444147200, 1, '', 'CPHI 2016', '', '', '', '', '', '', '', '', '', '', 'Fira de Barcelona Gran Via', '', 'Spain, Barcelona', 'http://www.cphi.com/europe/home', 'on', '', '<p>CPhI Worldwide 2015 is the best place to network with more than 36,000 pharma industry professionals from 140+ countries, source new suppliers, build relationships with existing partners and identify new business opportunities.&nbsp;Meet the entire pharma industry in one location: join&nbsp;36,000 senior pharma professionals from&nbsp;150+ countries in one place.</p>', '<p>Each year <strong>CPhI</strong> is hosted in a different country and city and in 2016 it is placed in Fira Gran Via in Barcelona, Spain. Because the EXPO is moving each year it is always hard to book a suitable accommodation in advance. To this end our team at Fair Point secured contracts with plethora of hotels and hotel chains ensuring we can provide our current and future clients with the best hotel deals months in advance. Take advantage of our exclusive and best priced accommodation offers and contact our travel agents via filling the hotel reservation form or book directly online with our hotel reservation engine. <strong>It was never easier to secure a suitable hotel for CPhI Worldwide</strong>.</p>', '', '', '', 'about-us/events/CPHI-2016', 1, 0, 5, 'no', 1, 1),
(146, 131, '292710298', '92.54.232.22', 1445594008, 0, 4, '', '444', '', '', '', '437', '444', '', '', '', '', '', '', '', '', '', 'on', '', '', 'BLC has been providing the full range of legal services to the largest Energy companies in Georgia for over 10 years. Therefore, the expertise of BLC team in Energy law is indispensable. Attorneys of BLC have participated in preparation and negotiation of a number of Production Sharing Agreements in Georgia on behalf of international companies for extraction of oil & gas. BLC provides legal counsel to oil companies on issues of equipment supply, licenses and tax matters.', '', '', '', 'view/292710298/444', 56, 1, 5, 'no', 1, 1),
(147, 132, '190559166', '92.54.232.22', 1445594035, 0, 4, '', '444', '', '', '', '437', '444', '', '', '', '', '', '', '', '', '', 'on', '', '', 'anking and Finance law is truly the cornerstone of the business of the company, distinguishing BLC from any other legal practice in Georgia. BLC has provided extensive counseling and representation to international and local banks and financial institutions in the process of their registration, acquisition of the license, mergers and acquisition of shares, complex financing deals, securities and pledges, legal analysis and due diligence studies.\n ', '', '', '', 'view/190559166/444', 56, 1, 5, 'no', 1, 1),
(148, 133, '', '', 1430888400, 1431093600, 1, '', 'SIAL China 2015', '', '', '', '', '', '', '', '', '', 'N/A', 'Shanghai New International Expo Centre', '', 'Shanghai', 'http://www.sialchina.com/', 'on', '', '<p id="u5662-22" class="Paragraph-Style-tab">From 6th - 8th May 2015, the 16th edition of SIAL CHINA 2015 took place in Shanghai New International Expo Centre. Taking over 115,000 sqm (+ 20% vs 2014) exhibition area, 2,734 exhibitors (+ 14% vs 2014) from 62 countries and regions. 2015&rsquo;s growth marks a new milestone in SIAL CHINA&rsquo;s history. 58 international pavilions and 11 Chinese provinces and association pavilions brought their high quality products to the visitors and buyers from all over the world</p>', '<ul>\r\n<li id="u5662-22" class="Paragraph-Style-tab"><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=349" target="_blank">Aroma Product</a></li>\r\n<li class="Paragraph-Style-tab"><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=337" target="_blank">Kula&nbsp;</a></li>\r\n<li class="Paragraph-Style-tab"><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=909" target="_blank">Ltd Vaziani</a></li>\r\n<li class="Paragraph-Style-tab"><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=809" target="_blank">Ltd Healthy Water</a></li>\r\n<li class="Paragraph-Style-tab"><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=821" target="_blank">Marneuli Food Factory</a></li>\r\n<li class="Paragraph-Style-tab"><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=1085" target="_blank">Georgian Products Renaissance</a></li>\r\n</ul>\r\n<p id="u5662-40" class="Paragraph-Style-tab">&nbsp;</p>', '', '', '', 'about-us/events/Sial-China-2015', 1, 0, 5, 'no', 2, 0),
(204, 189, '', '', 1458018000, 1458223200, 1, '', 'DUPHAT 2016', '', '', '', '', '', '', '', '', '', 'N/A', 'Dubai International Convention & Exhibition Center', '', 'Dubai, UAE', 'http://duphat.ae/', 'off', '', '<p>DUPHAT is the premier Pharmaceutical and Technology event in the Middle East launched in 1995 by INDEX<sup>&reg;</sup> Conferences and Exhibitions Org. Est., a member of INDEX Holding in collaboration with the government through the Dubai Health Authority with the aim to provide a high-quality conference and a wide-ranging exhibition. The event is held under the patronage of H.H. Sheikh Hamdan Bin Rashid Al Maktoum, Deputy Ruler of Dubai, Minister of Finance, UAE and President of Dubai Health Authority. DUPHAT 2016 &ndash; The 21st Dubai International Pharmaceuticals &amp; Technologies Conference &amp; Exhibition has developed to be one of the most recognized and significant pharmaceutical event in the Middle East and North Africa.</p>', '<ul>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=397" target="_blank">Aversi-Rational</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=461" target="_blank">Ltd Ynnovas</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=1029" target="_blank">GM Pharmaceuticals&nbsp;</a></li>\r\n</ul>', '', '', '', 'about-us/events/DUPHAT-2016', 1, 0, 5, 'no', 2, 0),
