(149, 134, '', '', 1435467600, 1435672800, 1, '', 'Summer Fancy Food Show 2015', '', '', '', '', '', '', '', '', '', '3311', 'The Jacob K. Javits Convention Center', '', 'New York City, USA', 'https://www.specialtyfood.com/shows-events/summer-fancy-food-show/exhibiting/post-show-report/', 'on', '', '<p>The 2015 Summer Fancy Food Show was filled with great energy, top buyers, and of course fabulous food. North America&rsquo;s largest specialty food trade event also boasted its first country partner sponsor, Italy, and its first opening night party. Both were a big success.</p>\r\n<p>The show took place June 28 &ndash; 30, 2015, at Javits Center in New York. Buyers from top names in retailing and foodservice were out in force in search of new products, new vendors, and new connections to help meet record consumer demand for specialty food. In all, 23,200 attendees came to the show, up 5.8 percent from the 2014 Summer Fancy Food Show.</p>', '<ul>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=349" target="_blank">Ltd Aroma Product</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=337" target="_blank">Ltd Kula</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=533" target="_blank">Ltd Geoplant</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=1085" target="_blank">Georgian Products Renaissance</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=1093" target="_blank">Ltd Campa&nbsp;</a></li>\r\n</ul>', '', '', '', 'about-us/events/Summer-Fancy-Show-2015', 1, 0, 5, 'no', 2, 0),
(205, 190, '', '', 1443070800, 1443448800, 1, '', 'Discover Georgia in New York ', '', '', '', '', '', '', '', '', '', 'N/A', 'Chelsea Market', '', 'New York, USA', 'https://www.facebook.com/events/1684554361776027/', 'on', '', '', '<ul>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=337" target="_blank">KULA</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=349" target="_blank">AROMAPRODUCT</a></li>\r\n<li><a href="https://moreislove.com/en/products/act/search/Ria-Keburia/?brand=104" target="_blank">MORE is LOVE</a></li>\r\n</ul>', '', '', '', 'about-us/events/Discover-Georgia-in-new-York-', 1, 0, 5, 'no', 2, 0),
(150, 135, '', '', 1441170000, 1441461600, 1, '', 'Riga Food 2015', '', '', '', '', '', '', '', '', '', 'A6', 'Kipsala International Exhibition Centre', '', 'Riga, Latvia ', 'http://www.bt1.lv', 'on', '', '<p>At Riga Food food industry professionals from the European Union and other countries meet every year to promote their businesses and learn about the latest developments in food and beverages production, processing, the latest technologies, packaging solutions, solutions from stores and public catering enterprises, hotel equipment and services. In order to maximize the chances for successful contacts for every participant and visitor to the exhibition, the displays in the show are divided up into thematic zones. The international food sector business forum held within Riga Food is an opportunity to meet officials and business people from various countries, make contacts/networking, exchange information and expand your business into international markets.</p>', '<ul>\r\n<li><a href="http://tradewithgeorgia.com/en/export-catalog?view=companies&amp;search=kula" target="_blank">Kula&nbsp;</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=537" target="_blank">Nutex/nutsge</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=533" target="_blank">Ltd Geoplant</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=1025" target="_blank">Georgian Beer Company</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=809" target="_blank">Healthy water</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=789" target="_blank">Euronut</a></li>\r\n<li><a href="http://saga-2008.ge/index.php/ru/component/content/category/80-chvens-shesaxeb">Saga-2008</a></li>\r\n</ul>', '', '', '', 'about-us/events/Riga-Food-2015', 1, 0, 5, 'no', 2, 0),
(151, 136, '', '', 1444453200, 1444831200, 1, '', 'ANUGA 2015', '', '', '', '', '', '', '', '', '', 'E61G-D68G', 'Koelnmesse', '', ' Köln, Germany', 'www.anuga.com', 'on', '', '<p style="text-align: justify;">Around 160,000 trade visitors from 192 countries Quality of the visitors convinces the exhibitors across the board Anuga in Cologne unparalleled as a business and information platform Partner country Greece demonstrates the diversity of its food industry After a record number of exhibitors, Anuga 2015 also increased its attendance figures. Around 160,000 trade visitors from 192 countries attended Anuga in Cologne from 10 to 14 October 2015. Anuga is unparalleled as a business and information platform for the global food industry. Once again in&nbsp;2015, it has clearly underlined its position as the leading international trade fair. Anuga 2015 presented over 7,000 exhibitors from 108 countries. The share of foreign exhibitors was 89 percent and the share of foreign visitors was 68 percent. The exhibitors were particularly impressed by the quality of the visitors.</p>', '<ul>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=821" target="_blank">Marneuli food factory&nbsp;</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=809" target="_blank">Ltd Healthy Water</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=593" target="_blank">Anka Fair Trade</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=1053" target="_blank">Ltd Aer Company&nbsp;</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=537" target="_blank">Ltd Nutex</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=337" target="_blank">Kula</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=789" target="_blank">Ltd Euronut&nbsp;</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=1085" target="_blank">Gerogian Products Renaissance</a></li>\r\n</ul>\r\n<p>&nbsp;</p>', '3495e54ff6b3085aea1a0446ff137a15.pdf', '', '', 'about-us/events/anuga-2015', 1, 0, 5, 'no', 2, 0),
