(188, 173, '', '', 1456030800, 1456408800, 1, '', 'GulFood 2016', '', '', '', '', '', '', '', '', '', 'N/A', 'UAE, DUBAI', '', 'Dubai World Trade Center', 'http://www.gulfood.com/', 'on', '', '<p style="text-align: justify;">Gulfood is&nbsp;your&nbsp;unrivalled opportunity to source and select from an incredible&nbsp;global product showcase. A&nbsp;warm welcome&nbsp;awaits you at this buzzing event, where you will network with thousands of industry peers and people passionate about driving the market forward. Take time to review the latest trends and innovations of the food &amp; drink sectors, .foodservice &amp; hospitality equipment, as well as the restaurant &amp; cafe industry.</p>\r\n<ul>\r\n<li style="text-align: justify;">Almost 5,000&nbsp;exhibitors</li>\r\n<li>Biggest European showcase ever</li>\r\n<li>Largest South American participation</li>\r\n<li>New country pavilions</li>\r\n</ul>', '<ul>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=593" target="_blank">Anka Fair Trade</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=541" target="_blank">Nutex/Nutsge</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=1085" target="_blank">Georgian Products Renaissance</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=597" target="_blank">Ltd Euro Nuts 2009</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=789" target="_blank">Ltd Euronut</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=625" target="_blank">Ltd Barambo</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=757" target="_blank">Ltd Khiliani</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=1053" target="_blank">Ltd Aer Company</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=1025" target="_blank">Georgian Beer Company&nbsp;</a></li>\r\n</ul>', '', '', '', 'about-us/events/Gulfood-2016', 1, 0, 5, 'no', 2, 0),
(189, 174, '', '', 1476331200, 1476547200, 1, '', 'Gulfood 2016', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'on', '', '<p>Gulfood is&nbsp;your&nbsp;unrivalled opportunity to source and select from an incredible&nbsp;global product showcase. A&nbsp;warm welcome&nbsp;awaits you at this buzzing event, where you will network with thousands of industry peers and people passionate about driving the market forward. Take time to review the latest trends and innovations of the food &amp; drink sectors, .foodservice &amp; hospitality equipment, as well as the restaurant &amp; cafe industry.</p>\r\n<ul>\r\n<li>Almost 5,000&nbsp;exhibitors</li>\r\n<li>Biggest European showcase ever</li>\r\n<li>Largest South American participation</li>\r\n<li>New country pavilions</li>\r\n</ul>', '', '', '', '', 'about-us/events/Gulfood-2016', 1, 0, 5, 'no', 1, 1),
(190, 175, '', '', 1476590400, 1476972000, 1, '', 'Sial Paris 2016', '', '', '', '', '', '', '', '', '', 'N/A', 'Paris, Madrid', '', 'PARIS NORD VILLEPINTE', 'https://www.sialparis.com/', 'off', '', '<p>SIAL is a unique global food event featuring the world&rsquo;s leading retail and foodservice buyers in one location. &nbsp;Occurring every two years, SIAL attracts&nbsp;<strong>over 150,000 visitors</strong> from not only the European Union but also from the rest of Europe, the Middle East, Africa and Asia.&nbsp;</p>\r\n<p>6,500 exhibitors, suppliers to the agri-food industry</p>\r\n<p>85% international exhibitors &ndash; 104 countries represented</p>\r\n<p>France is the most represented country</p>\r\n<p>20 exhibition sectors and food channels</p>\r\n<p>Top 5 sectors: meat, dairy products, savoury grocery, frozen foods, sweet grocery</p>\r\n<p>82% of exhibitors were satisfied with their event and 89% would recommend SIAL</p>\r\n<p>Average of 200 meetings per stand, 1/3 new contacts</p>', '<ul>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=1053" target="_blank">Aer Company</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=537" target="_blank">Nutex/Nutsge</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=725" target="_blank">Georgian Herbs</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=349" target="_blank">Aromaproduct</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=789" target="_blank">Euronut</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=597" target="_blank">Euronuts 2009</a></li>\r\n<li><a href="http://saga-2008.ge/index.php/ru/" target="_blank">Saga - 2008</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=337" target="_blank">Kula&nbsp;</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=1085" target="_blank">GPR</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=601" target="_blank">NENA</a></li>\r\n</ul>\r\n<p>&nbsp;</p>', '', '', '', 'about-us/events/Sial-Paris-2016', 1, 0, 5, 'no', 2, 0);
