(202, 187, '', '', 1442811600, 1443103200, 1, '', 'Polagra Food 2015', '', '', '', '', '', '', '', '', '', '87', 'Poznan Congress Center ', '', 'Poznan, Poland', 'http://www.polagra-food.pl/en/', 'on', '', '<p style="text-align: justify;">Poznań International Fair (Międzynarodowe Targi Poznańskie) is the leader of Polish exhibition industry. It constitutes 60% of the Polish exhibition industry and it was the first organizer of fairs in Central and Eastern Europe.&nbsp;</p>\r\n<p style="text-align: justify;">Polagra Food is a project of a long tradition which actively follows the changes taking place in the food industry and which is continually open to the needs resulting from the economic and social situation.</p>\r\n<p style="text-align: justify;">Aiming at creating new perspectives for food producers, we are taking actions providing possibilities for foreign merchants to visit the fair. Polagra&nbsp;also creates tools and organize special events which are to intensify the dialog and mutual cooperation between our exhibitors and their clients.</p>', '<ul>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=1053" target="_blank">Aer Company</a></li>\r\n<li><a href="http://wineman.ge/" target="_blank">Wine Man</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=809" target="_blank">Healthy Water</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=593" target="_blank">Anka Fear Trade</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/export-catalog?view=companies&amp;search=aroma" target="_blank">Aroma Product</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=789" target="_blank">Euronut</a></li>\r\n<li><a href="http://saga-2008.ge/index.php/ru/component/content/category/80-chvens-shesaxeb">Saga 2008</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=337" target="_blank">Ltd Kula</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=537" target="_blank">Ltd Nutex/Nutsge</a></li>\r\n</ul>', '', '', '', 'about-us/events/Polagra-2015', 1, 0, 5, 'no', 2, 0),
(203, 188, '', '', 1444712400, 1444917600, 1, '', 'CPHI 2015', '', '', '', '', '', '', '', '', '', '10H17', 'IFEMA, Feria De Madrid', '', 'Madrid, Spain', 'http://www.cphi.com/europe/home', 'on', '', '<p>CPhI Worldwide 2015 is the best place to network with more than 36,000 pharma industry professionals from 140+ countries, source new suppliers, build relationships with existing partners and identify new business opportunities.&nbsp;Meet the entire pharma industry in one location: join&nbsp;36,000 senior pharma professionals from&nbsp;150+ countries in one place.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '<ul>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=1029" target="_blank">GM Pharmaceuticals&nbsp;</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=1025" target="_blank">Aversi Rational&nbsp;</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=461" target="_blank">Ltd Ynnovas&nbsp;</a></li>\r\n</ul>', '', '', '', 'about-us/events/CPHI-2015', 1, 0, 5, 'no', 2, 0),
