(233, 218, '880198952', '188.169.220.128', 1449569901, 0, 3, '', 'Rkatsiteli Kakhetian', '1d72f99f116a1e098a5746ab85871305.jpg', '1419', '', '114', '152', 'N/A', 'Glass bottle', 'N/A', '0.750 ml', '', '', '', '', '', 'on', '', '', 'White dry wine Produced from the selected grapes sort of Rkatsiteli, cultivated in the Kardenakhi micro-zone of Kakheti region. Wine is produced using the traditional Kakhetian technology. Wine characterized with dark amber color, specific smooth taste, varietal aromas with fruit tones. Mass concentration of sugar.', '', '', '', 'view/880198952/Rkatsiteli-Kakhetian', 261, 1, 5, 'yes', 2, 0),
(234, 219, '332099387', '188.169.220.128', 1449570654, 0, 3, '', 'Kindzmarauli', 'shalvino.wineaa361d051f99516db771ad8e327d7009.jpg', '1419', '', '114', '152', 'N/A', 'Glass Bottle', 'N/A', '0.750 ml', '', '', '', '', '', 'on', '', '', 'Kindzmarauli Appellation of origin controlled red naturally semi sweet wine Produced from the selected grapes sort of Saperavi. Wine characterized with rich garnet color, specific harmonic taste and strong varietal aromas with berry tones. Mass concentration of sugar: 38gr/dm3 11,5% Alc./Vol.', '', '', '', 'view/332099387/Kindzmarauli', 261, 2, 5, 'yes', 2, 0),
(235, 220, '256923142', '188.169.220.128', 1449570743, 0, 3, '', 'Shalvino Rose', 'shalvino.wine0581dad5aadc98d88f7c40f58f16b910.jpg', '1419', '', '114', '152', 'N/A', 'Glass Bottle', 'N/A', '0.750 ml', '', '', '', '', '', 'on', '', '', 'Sweet rose wine Produced from the selected grapes sort of Saperavi, cultivated in the Kardenakhi micro-zone of Kakheti region. Wine is produced using special technology. Wine characterized with rose color, specific variatal aroma and pleasant taste with peach and delicate fruit aromas. Mass concentration of sugar: 52 gr/dm3 12% Alc./Vol.', '', '', '', 'view/256923142/Shalvino-Rose', 261, 3, 5, 'no', 1, 0),
(236, 221, '979674893', '188.169.220.128', 1449571045, 0, 3, '', 'Rose', 'shalvino.winedfc9218468db3b578a010e33bcb91cc5.jpg', '1419', '', '114', '152', 'N/A', 'Glass Bottle', 'N/A', '0.750 ml', '', '', '', '', '', 'on', '', '', 'Dry red wine. Produced from the selected grapes sort of Saperavi, cultivated in the Kardenakhi micro-zone of Kakheti region. Balanced, aromatic wine characterized with rose color, pleasant taste and delicate fruit aromas with wild flowers notes. &nbsp;Mass concentration of sugar:', '', '', '', 'view/979674893/Rose', 261, 4, 5, 'yes', 2, 0),
(237, 222, '765807439', '188.169.220.128', 1449571608, 0, 3, '', 'Black Eyes', 'shalvino.wine935958dafd3478345267037d712d5f98.jpg', '1419', '', '114', '152', 'N/A', 'Glass Bottle', 'DAWA Silver Medal 2015', '0.750', '', '', '', '', '', 'on', '', '', 'Red, naturally sweet wine Produced from the selected grapes sort of Saperavi, cultivated in the Kardenakhi, Akhoebi micro-zone of Kakheti region. Wine has rich garnet color and strongly developed specific bouquet with berry and black chocolate notes. &nbsp;Mass concentration of sugar: 78 gr/dm3 15.5% Alc./Vol.', '', '', '', 'view/765807439/Black-Eyes', 261, 5, 5, 'yes', 2, 0),
(238, 223, '159027012', '92.241.71.134', 1449572228, 0, 3, '', 'SAPERAVI', '', '1420', '', '114', '152', '', '', '', '', '', '', '', '', '', 'on', '', '', 'A red dry wine made of indigenous Saperavi grape variety.\nColor: It is deeply saturated pomegranate color.\nAromas: On the nose it offers of blackberry and zippy acidity.\n\n', '', '', '', 'view/159027012/SAPERAVI', 257, 6, 5, 'no', 1, 1),
(239, 224, '545321472', '188.169.13.242', 1449588226, 0, 3, '', 'Fresh and Frozen Blueberry', 'control77b2114a2d361295bd7070aa24252a48.jpg', '1069', '', '50', '63', '40 days', '0.125 gr Clamshell and 4,0 kg balk', '', '150 t', '', '', '', '', '', 'on', '', '', 'We cultivate and export fresh blueberry to Europe and Asian countries as well. Please visit our web site www.vanrik.com for detailed information. We are global Gap certified grower and can guarantee the best quality of our product. We are very much interested in entering your fruit market and offer our blueberries to your clients.', '77b2114a2d361295bd7070aa24252a48.pdf', '', '', 'view/545321472/freash-and-frozen-Blueberry', 321, 6, 5, 'yes', 2, 0),
(240, 225, '012971616', '95.104.119.228', 1449649569, 0, 3, '', 'Cherry juice', 'sopo.gfc2e1a491107e7d8f6be2dac6d4e1dd191.jpg', '1396', '', '113', '139', '2 years', 'Glass bottle', 'N/A', '1 Liter', '', '', '', '', '', 'on', '', '', '-Without conservantes- Cherry juice is produced in Georgia, in an ecologically clean zone of Shida Kartli region, in the city of Gori. It doesn\'t contain any conservantes, colorings, emulsifiers and other extra artificial additions. The juice produced of direct squeezing preserves maximum of its healthy properties.', '', '', '', 'view/012971616/Cherry-juice', 337, 7, 5, 'yes', 2, 0),
(241, 226, '589981833', '176.221.176.35', 1449663614, 0, 3, '', 'Mukuzani', 'mabramiab5ae72df3861978f6a4283598dce6327.jpg', '1420', '', '114', '152', 'N/A', 'Glass Bottle', 'Mundus Vini 2015 - Gold Medal', '0.75 L', '', '', '', '', '', 'on', '', '', 'Mukuzani is a red dry wine of appellation of origin, made of Saperavi grapes grown in Mukuzani viticulture micro zone, Kakheti region. Wine with dark raspberry color and strong extract. When tasting it, one will immediately recognize the subtle oak flavor. Floral and orchards aroma, with prevailing cherry tones will be notable at closer smelling.', '', '', '', 'view/589981833/Mukuzani', 345, 8, 5, 'yes', 2, 0),
(242, 227, '335405866', '94.100.224.111', 1449664107, 0, 3, '', 'Unsaturated Polyester Resin', 'gelage795d3c35de5433e874ee37a176bbe0de7c.jpg', '2082', '', '123', '183', '6-12month', '0.250kg/1kg/18kg/230kg', 'N/A', '', '', '', '', '', '', 'on', '', '', 'Composite Materials Georgia - CMG 18kg/230kg . 1. Casting type polyester resins 2. Fiber type polyester resins 3. Acrylic type polyesters', '', '', '', 'view/335405866/Unsaturated-Polyester-Resin', 381, 9, 5, 'yes', 2, 0),
(243, 228, '213668538', '176.221.176.35', 1449664280, 0, 3, '', 'Khvanchkara', 'mabramia278b5ac39c88f131328d66eeb2587729.jpg', '1420', '', '114', '152', 'N/A', 'Glass Bottle', 'N/A', '0.75 L', '', '', '', '', '', 'on', '', '', 'Khvanchkara is a red semi-sweet wine, made of Aleksandrouli and Mujuretuli grapes, grown in Racha-Lechkhumi region. Wine is a dark ruby-colored, tender mild and with well balanced sweetness and acidity, which makes it especially piquant. The wine is rich with raspberry, ripe plum and cherry tones, which is an excellent and inimitable combination.', '', '', '', 'view/213668538/Khvanchkara', 345, 10, 5, 'yes', 2, 0),
