(249, 234, '741585631', '212.72.128.130', 1449842783, 0, 3, '', 'Cream Enjoy', 'info9a1e3010213cbd074740f6b424f1486f.jpg', '5225', '', '124', '191', 'N/A', 'N/A', 'N/A', 'N/A', '', '', '', '', '', 'on', '', '', 'Cream ENJOY is made from natural materials. It removes smell from armpit, feet and groin. Regulates perspiration, it is used for cracked heels and also the bite of mosquitoes. It calms sweaty, irritated areas. It doesn\'t contain aluminium chlorohydrate, aluminium acetate, alcohol, parabens, lead acetate, boric acid', '9a1e3010213cbd074740f6b424f1486f.jpg', '', '', 'view/741585631/Cream-Enjoy', 393, 15, 5, 'yes', 2, 0),
