(251, 236, '651206378', '176.221.176.35', 1450700430, 0, 3, '', 'Kindzmarauli', 'mabramia3db6595869ff444ac1bc2133b2aee443.jpg', '1420', '', '114', '152', 'N/A', 'Glass Bottle', '5th Georgian National Wine Competition - Gold Medal; Chisnau Wines & Spirits Contest in Moldova - Gold Medal', '0.75 L', '', '', '', '', '', 'on', '', '', 'Kindzmarauli is a red semi-sweet wine of appellation of controlled origin,made of Saperavi grapes grown in Kindzmarauli viticulture micro zone,Kakheti region.Kindzmarauli is transparent wine of ripe cherry color with pronounced fruit and berry tones.Pleasant velvety tannins create mild flavor and makes the wine more balanced, piquant and wonderful.', '', '', '', 'view/651206378/Kindzmarauli', 345, 17, 5, 'yes', 2, 0),
(252, 237, '779582489', '176.221.176.35', 1450700659, 0, 3, '', 'Akhasheni', 'mabramia23110e6850616935915e5542e0375a9e.jpg', '1420', '', '114', '152', 'N/A', 'Glass Bottle', 'N/A', '0.75 L', '', '', '', '', '', 'on', '', '', '&ldquo;Akhasheni&rdquo; is a red semi-sweet wine of appellation of origin, made of Saperavi grapes grown in Akhasheni viticulture micro zone, Kakheti region. The wine is sweet by nature and has a dark pomegranate color. Sweet cherry and black plum aromas prevail in the scent. It has well balanced velvety taste.', '', '', '', 'view/779582489/Akhasheni', 345, 18, 5, 'yes', 2, 0),
(253, 238, '047958603', '176.221.176.35', 1450705966, 0, 3, '', 'Saperavi', 'mabramia34f36bf4eb61f0c2a6cd1d18edfcfb68.jpg', '1420', '', '114', '152', 'N/A', 'Glass Bottle', 'Decander World Wine Awards 2014 ; ProWein 2014 ', '0.75 L', '', '', '', '', '', 'on', '', '', 'Saperavi is a red dry table wine made of Saperavi grapes grown in Kakheti region. The cherry color wine, with slight pomegranate tones around the glass is very impressive at sight. The wine has different aromas with sweet cherry and raspberry tones prevailing which lasts long after tasting.', '', '', '', 'view/047958603/Saperavi', 345, 19, 5, 'yes', 2, 0),
(254, 239, '425199679', '176.221.176.35', 1450706243, 0, 3, '', 'Pirosmani', 'mabramia5a85408d01ebd077c5507bfe4b2f2245.jpg', '1420', '', '114', '152', 'N/A', 'Glass Bottle', 'N/A', '0.75 L', '', '', '', '', '', 'on', '', '', 'Pirosmani is a red semi-dry table wine made of Saperavi grapes grown in Kakheti region. The wine has darkish pomegranate color. Bouquet is clean, without other tones and with characteristic aroma. Taste is harmonious with pleasant sharpness.', '', '', '', 'view/425199679/Pirosmani', 345, 20, 5, 'yes', 2, 0),
(255, 240, '903545755', '176.221.176.35', 1450706412, 0, 3, '', 'Alazani Valley', 'mabramia939602e1b1fe81ad185e7afe652f3c91.jpg', '1420', '', '114', '152', 'N/A', 'Glass Bottle', 'N/A', '0.75 L', '', '', '', '', '', 'on', '', '', 'Alazani Valley is a red semi-sweet table wine made of Saperavi grapes grown in Kakheti region. Wine has dark cherry color and pleasant aromas with berry jams and dried fruit tones and well balanced acidity.', '', '', '', 'view/903545755/Alazani-Valley', 345, 21, 5, 'yes', 2, 0),
(256, 241, '310770905', '176.221.176.35', 1450706629, 0, 3, '', 'Tsinandali', 'mabramia69ed931f23f1cc4f0e48959d8a351b84.jpg', '1420', '', '114', '152', 'N/A', 'Glass Bottle', 'N/A', '0.75 L', '', '', '', '', '', 'on', '', '', 'Tsinandali\'s white dry wine of appellation of origin,made of grapes Rkatsiteli and Mtsvane Kakhuri,grown in Tsinandali viticulture micro zone, in Kakheti region.The wine is of greenish light-straw color and has pronounced floral aroma.Citrus and tropical flowers flavor prevail in its taste.The wine has moderate acidity and a ripe peach aftertaste.', '', '', '', 'view/310770905/Tsinandali', 345, 22, 5, 'yes', 2, 0),
(257, 242, '201111607', '176.221.176.35', 1450706775, 0, 3, '', 'Vazisubani', 'mabramia579c53f675dc725e73e9e7214990d64b.jpg', '1420', '', '114', '152', 'N/A', 'Glass Bottle', 'N/A', '0.75 L', '', '', '', '', '', 'on', '', '', 'Vazisubani is a white dry wine of appellation of origin, made of Rkatsiteli and Mtsvane grapes grown in Vazisubani viticulture micro zone, Kakheti region. The wine has a bright golden color and an expressive aroma of apple and melon.', '', '', '', 'view/201111607/Vazisubani', 345, 23, 5, 'yes', 2, 0),
(258, 243, '267263337', '176.221.176.35', 1450707092, 0, 3, '', 'Gurjaani', 'mabramiaddf6b90c230330863b10015f2678b752.jpg', '1420', '', '114', '152', 'N/A', 'Glass Bottle', 'N/A', '0.75 L', '', '', '', '', '', 'on', '', '', 'Gurjaani is a white dry wine of appellation of origin, made of Rkatsiteli and Mtsvane grapes grown in Gurjaani viticulture micro zone, Kakheti region. The wine has a bright golden color and an expressive aroma of apple and melon.', '', '', '', 'view/267263337/Gurjaani', 345, 24, 5, 'yes', 2, 0),
(259, 244, '008859246', '176.221.176.35', 1450707269, 0, 3, '', 'Alazani Valley', 'mabramiab0ce8af8fb8b5c036aa9d375e30caeaf.jpg', '1420', '', '114', '152', 'N/A', 'Glass Bottle', 'N/A', '0.75 L', '', '', '', '', '', 'on', '', '', 'Alazani Valley is a white semi-sweet wine made of Rkatsiteli and Mtsvane grapes grown in Kakheti region. The wine of light-straw color and delicate flavor has a strong bouquet, where honey, caramel and dried fig tones prevail.', '', '', '', 'view/008859246/Alazani-Valley', 345, 25, 5, 'yes', 2, 0),
(260, 245, '755946174', '176.221.176.35', 1450707430, 0, 3, '', 'Rkatsiteli', 'mabramiab13d2522d142160829e1a07afd90f5eb.jpg', '1420', '', '114', '152', 'N/A', 'Glass Bottle', 'N/A', '0.75 L', '', '', '', '', '', 'on', '', '', 'Rkatsiteli is a white dry wine made from grapes Rkatsiteli and Mtsvane grown in Kakheti region. The wine has light-straw color, pleasant, well expressed bouquet and tones of wildflowers. Moderate acidity and pronounced varietal floral aroma gives the wine harmonious taste.', '', '', '', 'view/755946174/Rkatsiteli', 345, 26, 5, 'yes', 2, 0),
(261, 246, '', '', 1416808800, 1417010400, 1, '', 'Sial Middle East 2014', '', '', '', '', '', '', '', '', '', 'N/A', 'NATIONAL EXHIBITION CENTRE, ABU DHABI', '', 'Abu Dhabi, United Arab Emirates', 'http://sialme.com/', 'on', '', '<p>SIAL Middle East 2014 is the largest Middle Eastern Food Exhibition giving opportunity to millions of food lovers and 1000 of companies to come on a single platform to savor the taste of success. The event held for a period of three days in Abu Dhabi and promotes motley of food and related products right from grocery products to food supplements</p>', '<ul>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=1093" target="_blank">Campa</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=1053" target="_blank">Aer company</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/export-catalog?view=companies&amp;sort=ASC&amp;sector=&amp;certificate=&amp;search=nutex&amp;pn=1">Nutsge/Nutex</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=349" target="_blank">Aromaproduct</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=1045" target="_blank">Sairme</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=337" target="_blank">Kula</a></li>\r\n<li><a href="http://tradewithgeorgia.com/en/user?t=manufacturer&amp;i=413" target="_blank">Aqua Geo</a></li>\r\n</ul>', '', '', '', 'about-us/events/Sial-Middle-East-2014', 1, 0, 5, 'no', 2, 0),
(262, 247, '921062462', '176.73.131.92', 1451078649, 0, 3, '', 'woman`s bag AN', 'info7e9dd10a49f9db9e944a4531f55ae913.jpg', '2256', '', '118', '168', 'N/A', 'N/A', 'N/A', '', '', '', '', '', '', 'on', '', '', 'A leather bag #AN320/1, price 149 GEL, $62. Used material is high quality leather and metal accessories. Size: height-22cm, width 27cm, bottom-10cm', '', '', '', 'view/921062462/womans-bag-AN', 481, 27, 5, 'yes', 2, 0),
(263, 248, '066104008', '178.134.73.98', 1452073501, 0, 3, '', 'Kindzmarauli', 'akaki55fd1e78397f51c1e892cdee7aa95777.jpg', '1419', '', '114', '152', 'N/A', 'Glass', 'Gold Medal (ProdExpo 2015, Moscow/Russia)', '750 ML', '', '', '', '', '', 'on', '', '', 'Red, naturally semisweet. Made in Kindzmarauli microzone in Kakheti Region. It has colour of garnet, with a red beam. Has pleasant tones of wild berries and cherries. It tastes soft; remained sugar balances acidity. Kindzmarauli is applied as an aperitif, and together with a dessert. Wine perfectly balances fried meat and salty cheese.', '', '', '', 'view/066104008/Kindzmarauli', 489, 28, 5, 'no', 1, 0),
(264, 249, '866079834', '178.134.73.98', 1452074356, 0, 3, '', 'Saperavi', 'akakif82883acf50479d21f1b1ffb5223e5b6.jpg', '1419', '', '114', '152', 'N/A', 'Glass', 'Gold Medal (ProdExpo 2015, Moscow/Russia)', '750 ML', '', '', '', '', '', 'on', '', '', 'Dry red wine. From Kakheti Region; the valley of the river Duruji, where the soil is rich with black slate. Wine of garnet colour, well developed high-quality aroma in which tone of cherry and prunes harmoniously merge with pleasant oak tones, and the pleasant tart taste. Saperavi befitting almost all meat and cheese dishes.', '', '', '', 'view/866079834/Saperavi', 489, 29, 5, 'yes', 2, 0),
(265, 250, '022275708', '178.134.73.98', 1452074798, 0, 3, '', 'Mukuzani', 'akaki9b536f7a7f4217e0aa56f7737992d034.jpg', '1419', '', '114', '152', 'N/A', 'Glass', 'Gold Medal (ProdExpo 2015, Miscow/Russia)', '750 ML', '', '', '', '', '', 'on', '', '', 'Red, dry. Made in a microzone of Mukuzani; Kakheti Region. It is called the prince of Georgian wines. Dark garnet colour, well developed bouquet. Tone of cherry and blackcurrant harmoniously merge with pleasant vanilla and oak tones. Strong and complex therefore it is better to drink with fried dishes and cheese, especially with mutton dishes.', '', '', '', 'view/022275708/Mukuzani', 489, 30, 5, 'yes', 2, 0),
(266, 251, '083815712', '178.134.73.98', 1452075930, 0, 3, '', 'Akhasheni', 'akakic966fe726a5c27ec5e78cf0eaa1c6edc.jpg', '1419', '', '114', '152', 'N/A', 'Glass', 'Gold Medal (ProdExpo 2015, Miscow/Russia)', '750 ML', '', '', '', '', '', 'on', '', '', 'Red, semisweet. Made in Akhasheni microzone in Kakheti Region. Pleasant, well expressed, characteristic of Saperavi, aroma with attractive tones of plums and cherries; pleasant harmonious taste leaves feeling of integrity and complexity. Remained sugar gives pleasant feeling of sweet. Akhasheni is applied as aperitif, and together with a dessert.', '', '', '', 'view/083815712/Akhasheni', 489, 31, 5, 'yes', 2, 0),
(267, 252, '303855310', '178.134.73.98', 1452076523, 0, 3, '', 'Tsinandali', 'akaki5b24a36e37dcbc31ef16cfb9f2bf50fc.jpg', '1419', '', '114', '152', 'N/A', 'Glass bottle', 'Gold Medal (ProdExpo 2015, Miscow/Russia)', '750 ML', '', '', '', '', '', 'on', '', '', 'White, dry wine is made in a microzone of Tsinandali in Kakheti Region. High quality is caused by the carbonate soil and the micro-climate widespread in this zone. Wine of colour of straw, well developed bouquet where dominates tone of ripe apples and peaches. Wine has strong aroma, pleasant acidity well balances fish dishes and white meat.', '', '', '', 'view/303855310/Tsinandali', 489, 32, 5, 'yes', 2, 0),
(268, 253, '775050716', '178.134.73.98', 1452076760, 0, 3, '', 'Alazani Valley Red', 'akaki08bce86b3de4ead6ca2cec109645a46d.jpg', '1419', '', '114', '152', 'N/A', 'Glass bottle', 'N/A', '750 ML', '', '', '', '', '', 'on', '', '', 'Semisweet red wine, is produced in Georgia; in the vineyards widespread on the Alazani valley in Kakheti Region where the unique micro climate causes high quality of wine. Wine of gentle-scarlet colour, has the pleasant aroma, with pleasant sweet taste which creates a harmony. Wine is taken as an aperitif as well as in the form of a dessert.', '', '', '', 'view/775050716/Alazani-Valley-Red', 489, 33, 5, 'yes', 2, 0),
(269, 254, '186150425', '178.134.73.98', 1452077200, 0, 3, '', 'Alazani Valley White', 'akakia5a9f40b62de97e66035ad2076ed4830.jpg', '1419', '', '114', '152', 'N/A', 'Glass', 'N/A', '750 ML', '', '', '', '', '', 'on', '', '', 'Semisweet white wine; produced in Georgia, in the vineyards which are spread on the valley of the river Alazani in Kakheti Region. Wine has colour of straw, with good high-quality aroma. With pleasant sweet taste, which is felt together with gentle aroma that creates harmonious unity. Wine is taken generally together with a dessert.', '', '', '', 'view/186150425/Alazani-Valley-White', 489, 34, 5, 'yes', 2, 0),
