(451, 436, '587063736', '91.151.137.73', 1453719098, 0, 3, '', 'Platyphylline hydrotartrate', 'info87b01d1300bb4913261f5b519f54036e.jpg', '2039', '', '124', '191', 'N/A', '', 'N/A', '', '', '', '', '', '', 'on', '', '', 'Platyphylline hydrotartrate is the main substance for the antispasmodic drugs. The active ingredient is extracted from the plant named Senecio Rhombifolius. Senecio Rhombifolius Is Caucasian endemic plant, spread in Georgia. The plant grows in the alpine climate. Its dosage forms are well established and used as a safe and effective medicine.', '', '', '', 'view/587063736/Platyphylline-hydrotartrate', 461, 202, 5, 'no', 2, 0),
