(455, 440, '797472841', '217.11.165.207', 1453789401, 0, 3, '', 'Kindzmarauli Original', 'info9dbadca7ba89bb493394fbe726377076.jpg', '1419', '', '114', '152', 'Unlimited', 'Glass Bottle', '', '', '', '', '', '', '', 'on', '', '', 'Kindzmarauli is an Appellation Controlled naturally semi-sweet red made from Saperavi grapes cultivated in the Kindzmarauli region in Kakheti. It has a deep garnet color and round, velvety, intense taste with blackberry and raspberry tones. The wine is exceptionally enjoyable with desserts and fruits, and leaves a long lasting, pleasant aftertaste.', '', '', '', 'view/797472841/Kindzmarauli-Original', 353, 206, 5, 'no', 2, 1),
(456, 441, '835646172', '217.11.165.207', 1453790239, 0, 3, '', 'Rkatsiteli', 'info99f3fd46f71e894f4ea5a3532c95ec2f.jpg', '1419', '', '114', '152', 'Unlimited', 'Glass bottle', 'N/A', '', '', '', '', '', '', 'on', '', '', 'Varietal dry white wine made from one of the most famous and widely spread grape varieties of Georgia - Rkatsiteli. It has a light golden color and a very harmonious fresh taste. Fresh fl ower and fruit tones are most noticeable in its bouquet.', '', '', '', 'view/835646172/Rkatsiteli', 353, 206, 5, 'no', 2, 0),
(457, 442, '531460943', '217.11.165.207', 1453790361, 0, 3, '', 'Mtsvane', 'info373c96a61efbf6857e280f6f20a941ef.jpg', '1419', '', '114', '152', 'Unlimited', 'Glass Bottle', 'N/A', '', '', '', '', '', '', 'on', '', '', 'Dry white varietal wine made from the unique Mtsvane grapes from the Kakheti region. It has a light straw color with a greenish tint. This wine has a tender, light fl avor and harmonious taste dominated by citrus and tropical fruit.', '', '', '', 'view/531460943/Mtsvane', 353, 207, 5, 'no', 2, 0),
(458, 443, '004311029', '217.11.165.207', 1453790488, 0, 3, '', 'Alazani', 'infofdd518aadcec738cddbdd893381107b1.jpg', '1419', '', '114', '152', 'Unlimited', 'Glass Bottle', 'N/A', '', '', '', '', '', '', 'on', '', '', 'This semi-sweet White wine is made from one of Georgia&rsquo;s most well-known grape varieties &ndash; Rkatsiteli. It gives wine a medium body along with expressed citrus and plum aromas. Soft and live acidity accompanies the entire taste making it very pleasant and enjoyable.', '', '', '', 'view/004311029/Alazani', 353, 208, 5, 'no', 2, 0),
(459, 444, '658048557', '217.11.165.207', 1453790594, 0, 3, '', 'Tsinandali', 'info444048855348518ad1b4b0de218bce8a.jpg', '1419', '', '114', '152', 'Unlimited', 'Glass Bottle', '', '', '', '', '', '', '', 'on', '', '', 'This famous Appellation Controlled white dry wine Tsinandali is made from hand selected grapes of Mtsvane Kakhuri and Rkatsiteli varieties harvested from the Tsinandali microzone in Kakheti. It has a wonderful ruity fl avor, a surprisingly soft, delicate taste and a light straw color.', '', '', '', 'view/658048557/Tsinandali', 353, 209, 5, 'no', 2, 0),
