(462, 447, '097777912', '217.11.165.207', 1453797251, 0, 3, '', 'Kisi', 'info938d6d75674fcc626a21cadc60182632.jpg', '1419', '', '114', '152', 'Unlimited', 'Glass Bottle', 'N/A', '', '', '', '', '', '', 'on', '', '', 'Kisi is a unique varietal white dry wine. Its grapes are cultivated in limited areas of the Kvareli region in Kakheti. The fl avor is light and tender, with crispy citrus and fruity tones, the taste is harmonic and slightly sour. The wine is of light straw color with a golden tint.', '', '', '', 'view/097777912/Kisi', 353, 212, 5, 'no', 2, 0),
(463, 448, '219678013', '217.11.165.207', 1453797389, 0, 3, '', 'Khikhvi', 'info8e89a8980d7613b0ff93accdeee7efed.jpg', '1419', '', '114', '152', 'Unlimited', 'Glass Bottle', 'N/A', '', '', '', '', '', '', 'on', '', '', 'This unique varietal dry white is made from grapes harvested in limited vineyards in Kakheti. This is an old Georgian grape variety and is exceptionally unique and complex. The wine is straw colored with a slight greenish tint, with multiple varietal fl avors of peach, apricot, melon, citruses, lemon and wildfl owers.', '', '', '', 'view/219678013/Khikhvi', 353, 213, 5, 'no', 2, 0),
(464, 449, '510331219', '217.11.165.207', 1453801195, 0, 3, '', 'Saperavi', 'info179cfff590d004129aca6ff26dc6e664.jpg', '1419', '', '114', '152', 'Unlimited', 'Glass Bottle', 'N/A', '', '', '', '', '', '', 'on', '', '', 'This dry red made from an Georgian endemic grape variety Saperavi, which gives the most eminent Georgian red wines. It has a rich dark-garnet color. Flavors of black cherry and ripe fruits are present in the bouquet, harmonious taste with a pleasant astringency and prune tones.', '', '', '', 'view/510331219/Saperavi', 353, 214, 5, 'no', 2, 0),
(465, 450, '567473308', '217.11.165.207', 1453801248, 0, 3, '', 'Alazani', 'infof92e39313fbe88b970a2dae00be5de22.jpg', '1419', '', '114', '152', 'Unlimited', 'Glass Bottle', 'N/A', '', '', '', '', '', '', 'on', '', '', 'This semi-sweet Red wine made from Saperavi. It has a dark ruby color and perfectly balanced taste and is characterized with a harmonious, light, velvety aftertaste accompanied with aromas of fresh fruits.', '', '', '', 'view/567473308/Alazani', 353, 215, 5, 'no', 2, 0),
(466, 451, '363999788', '217.11.165.207', 1453801306, 0, 3, '', 'Mukuzani', 'info80f00a67839763d5173749bc5cbfb5f1.jpg', '1419', '', '114', '152', 'Unlimited', 'Glass Bottle', 'N/A', '', '', '', '', '', '', 'on', '', '', 'Mukuzani is an Appellation Controlled dry red made from Saperavi grapes cultivated in the Mukuzani microzone. This wine is unique in its harmonious, soft, velvet taste, exciting in its aromas of black current and blackberries, colored in an intense dark ruby.', '', '', '', 'view/363999788/Mukuzani', 353, 216, 5, 'no', 2, 0),
(467, 452, '995601504', '217.11.165.207', 1453801369, 0, 3, '', 'Kindzmarauli Original', 'infob0a6e646e5ce6723e674d096038177b8.jpg', '1419', '', '114', '152', 'Unlimited', 'Glass Bottle', 'N/A', '', '', '', '', '', '', 'on', '', '', 'Kindzmarauli is an Appellation Controlled naturally semi-sweet red made from Saperavi grapes cultivated in the Kindzmarauli region in Kakheti. It has a deep garnet color and round, velvety, intense taste with blackberry and raspberry tones. The wine is exceptionally enjoyable with desserts and fruits, and leaves a long lasting, pleasant aftertaste.', '', '', '', 'view/995601504/Kindzmarauli-Original', 353, 217, 5, 'no', 2, 0),
(468, 453, '394085189', '217.11.165.207', 1453801531, 0, 3, '', 'Saperavi Barrel Select', 'infobf844cd5801f5ec475795f2586c830b8.jpg', '1419', '', '114', '152', 'Unlimited', 'Glass Bottle', 'N/A', '', '', '', '', '', '', 'on', '', '', 'Saperavi Barrel Select is a dry red wine made from Saperavi, which is justifi ably considered to be one of the most outstanding endemic Georgian grape varieties. Aged in oak barrels for 24 months, it acquires a dark ruby color and harmonious taste accompanied with tones of black cherry and ripe fruits, also a pleasant astringency is present.', '', '', '', 'view/394085189/Saperavi-Barrel-Select', 353, 218, 5, 'no', 2, 0),
(469, 454, '785340259', '217.11.165.207', 1453801592, 0, 3, '', 'Kakhetian Royal Red', 'info0dd7d0317b1dc83e97907b1e4f507187.jpg', '1419', '', '114', '152', 'Unlimited', 'Glass Bottle', 'N/A', '', '', '', '', '', '', 'on', '', '', 'Made from hand selected grapes of the Saperavi variety, Kakhetian Royal is an exclusive dry red wine. Its harmonious and full velvety taste showcases the characteristics of traditional Georgian wine. The magnifi cent bouquet presents black current and cherry fl avors.', '', '', '', 'view/785340259/Kakhetian-Royal-Red', 353, 219, 5, 'no', 2, 0),
(470, 455, '882834628', '217.11.165.207', 1453801942, 0, 3, '', '  Saperavi Golden', 'infoc71a73a14ff775f464eeaa19e5c00f67.jpg', '1419', '', '114', '152', 'unlimited', 'Glass Bottle', 'N/A', '', '', '', '', '', '', 'on', '', '', 'Saperavi Golden is an exclusive varietal dry red wine made from hand selected Saperavi grapes cultivated in the Kindzmarauli zone. The wine is aged in oak barrels 3 years allowing it to reach its full potential of complexity and reveal its best characteristics. This wine is characterized with a rich dark-garnet color and well expressed deep flavor.', '', '', '', 'view/882834628/--Saperavi-Golden', 353, 220, 5, 'no', 2, 0),
(471, 456, '498608614', '217.11.165.207', 1453802436, 0, 3, '', 'Chacha Classic', 'infoee875068f59d7cbfca0a82ae0d1b4749.jpg', '6302', '', '114', '152', 'Unlimited', 'Glass Bottle', 'N/A', '', '', '', '', '', '', 'on', '', '', 'This exceptional Grape Chacha is produced from the distillation of red and white wines fermented on skins of controlled temperature. Chacha has a flint color, wonderful harmonious and smooth taste. Using traditional Georgian methods and modern technologies.', '', '', '', 'view/498608614/Chacha-Classic', 353, 221, 5, 'no', 2, 0),
(472, 457, '671325543', '217.11.165.207', 1453802481, 0, 3, '', 'Chacha Aged in Oak', 'infoe2e0c5412d0bb8df2bee0fd5a4721038.jpg', '6302', '', '114', '152', 'Unlimited', 'Glass Bottle', 'N/A', '', '', '', '', '', '', 'on', '', '', 'This exceptional Grape Chacha is produced from the distillation of red and white wines fermented on skins of controlled temperature. Chacha has a flint color, wonderful harmonious and smooth taste. Using traditional Georgian methods and modern technologies. Chacha Aged in oak barrel during 12 months.', '', '', '', 'view/671325543/Chacha-Aged-in-Oak', 353, 222, 5, 'no', 2, 0),
