(520, 505, '192010726', '178.134.36.99', 1453980681, 0, 3, '', 'Dill', 'info9682c57c296cf1d843acea4206ade260.jpg', '999', '', '50', '55', '14 days', '50 gr.', 'International Quality Grown Award', '300', '', '', '', '', '', 'on', '', '', 'Dill grows up to 40&ndash;60 cm (16&ndash;24 in), with slender hollow stems and alternate, finely divided, softly delicate leaves 10&ndash;20 cm (3.9&ndash;7.9 in) long. The ultimate leaf divisions are 1&ndash;2 mm (0.039&ndash;0.079 in) broad, slightly broader than the similar leaves of fennel, which are threadlike, less than 1 mm (0.039 in) broad, but harder in texture', '', '', '', 'view/192010726/Dill', 769, 261, 5, 'no', 2, 0),
