(523, 508, '424956694', '178.134.36.99', 1453980822, 0, 3, '', 'Parsley', 'info23aa2df54fda152c3262b79a2915e2a0.jpg', '999', '', '50', '55', '14 days', '50 gr.', 'International Quality Grown Award', '100 tones', '', '', '', '', '', 'on', '', '', 'Where it grows as a biennial, in the first year, it forms a rosette of tripinnate leaves 10&ndash;25 cm (3.9&ndash;9.8 in) long with numerous 1&ndash;3 cm (0.4&ndash;1.2 in) leaflets, and a taproot used as a food store over the winter.', '', '', '', 'view/424956694/Parsley', 769, 264, 5, 'no', 2, 0),
(524, 509, '502166712', '212.72.128.130', 1453980921, 0, 3, '', 'Mint 0.5 L', 'mariamdzidziguri172a735658e36f69cd819371137f095ea3.jpg', '1415', '', '114', '154', '9 Monthes', 'Glass bottle', 'N/A', '15000', '', '', '', '', '', 'on', '', '', 'Mint 0.5 L', '', '', '', 'view/502166712/Mint-05-L', 777, 265, 5, 'no', 2, 0),
(525, 510, '039956415', '178.134.36.99', 1453981019, 0, 3, '', 'Coriander', 'info2e1dd5d3188647024d086fa81618494f.jpg', '999', '', '50', '55', '14 days', '50 gr.', ' International Quality Grown Award', '100 tones', '', '', '', '', '', 'on', '', '', 'It is a soft plant growing to 50 cm tall. The leaves are variable in shape, broadly lobed at the base of the plant, and slender, feathery higher on the stems. The flowers are borne in small umbels, white or very pale pink, asymmetrical, with the petals pointing away from the center of the umbel longer (5&ndash;6 mm) than those pointing toward it', '', '', '', 'view/039956415/Coriander', 769, 266, 5, 'no', 2, 0),
(528, 513, '383408193', '178.134.36.99', 1453981187, 0, 3, '', 'Celery', 'infoec5403b31957d276a04d2388f0ab2086.jpg', '999', '', '50', '55', '14 days', '50 gr.', ' International Quality Grown Award', '50 tones', '', '', '', '', '', 'on', '', '', 'elery leaves are pinnate to bipinnate with rhombic leaflets 3&ndash;6 cm (1.2&ndash;2.4 in) long and 2&ndash;4 cm broad. The flowers are creamy-white, 2&ndash;3 mm in diameter, and are produced in dense compound umbels. The seeds are broad ovoid to globose, 1.5&ndash;2 mm long and wide. Modern cultivars have been selected for solid petioles, leaf stalks.', '', '', '', 'view/383408193/Celery', 769, 269, 5, 'no', 2, 0),
(526, 511, '730109698', '212.72.128.130', 1453981023, 0, 3, '', 'Suliko 0.5 L', 'mariamdzidziguri1769a7536c6d35c63261f31e376be59647.jpg', '1415', '', '114', '154', '9 Monthes', 'Glass bottle', 'N/A', '30000 Bottle', '', '', '', '', '', 'on', '', '', 'Suliko 0.5 L', '', '', '', 'view/730109698/Suliko-05-L', 777, 267, 5, 'no', 2, 0),
(527, 512, '354468230', '82.211.146.199', 1453981054, 0, 3, '', 'Euronut', 'salemanager82d66e21216a5001517b63c692f2ab2e5b.jpg', '1040', '', '113', '6305', 'one year', 'jute bags, big bags, vacuum pack, pp bags, paper bags.', 'E/N', '2000 tons', '', '', '', '', '', 'on', '', '', 'We produce raw hazelnut kernel, hazelnut meal, diced hazelnut kernel, blanched hazelnut kernel etc', 'd66e21216a5001517b63c692f2ab2e5b.jpg', '', '', 'view/354468230/Euronut', 789, 268, 5, 'no', 2, 0),
(529, 514, '597255541', '178.134.36.99', 1453981373, 0, 3, '', 'Rucola', 'info05844f3a740ff7daf3ed54367c2242f6.jpg', '987', '', '50', '55', '14 days ', '50 gr.', 'International Quality Grown Award', '10 tones', '', '', '', '', '', 'on', '', '', 'Eruca sativa grows 20&ndash;100 centimetres in height. The leaves are deeply pinnately lobed with four to ten small lateral lobes and a large terminal lobe. The flowers are 2&ndash;4 cm in diameter, arranged in a corymb in typical Brassicaceae fashion; with creamy white petals veined with purple, and with yellow stamens;', '', '', '', 'view/597255541/Rucola', 769, 270, 5, 'no', 2, 0),
(530, 515, '708469188', '178.134.36.99', 1453981540, 0, 3, '', 'Watercress', 'info2d2637884a1b8e6a83a55f943dd6c02b.jpg', '999', '', '50', '55', '14 days ', '50 gr.', 'International Quality Grown Award', '20 tones', '', '', '', '', '', 'on', '', '', 'A 100-gram serving of watercress provides 11 calories and is particularly rich in vitamin K (table). It also contains significant amounts of vitamin A, vitamin C, riboflavin, vitamin B6, calcium, manganese, and folate (table). Watercress has low contents of carbohydrates, protein, fat and dietary fiber.', '', '', '', 'view/708469188/Watercress', 769, 271, 5, 'no', 2, 0),
(531, 516, '339673178', '91.151.138.137', 1453981601, 0, 3, '', 'Mexidol ', 'infobbed5ff58cbbeef34f913772b5ca9383.jpg', '1997', '', '124', '191', '3 Years', 'Jar', 'N/A', '', '', '', '', '', '', 'on', '', '', 'Mexidol is a high-end antioxidant and antihypoxic drug with a unique multipurpose action mechanism. As a basis of antioxidant neuroprotection, Mexidol positively alteres the main components of pathogenesis of a disease, related with the processes of free-radicals. Mexidol successfully used in neurology, psychiatry, surgery and addictology.', '', '', '', 'view/339673178/Mexidol-', 461, 272, 5, 'no', 2, 0),
(532, 517, '598587875', '178.134.36.99', 1453981726, 0, 3, '', 'Basil', 'info0ede19058a055adf6d662249ed2661d5.jpg', '1004', '', '50', '55', '14 days', '50 gr.', 'International Quality Grown Award', '5 tones.', '', '', '', '', '', 'on', '', '', 'asil grows between 30&ndash;130 cm tall, with opposite, light green, silky leaves 3&ndash;11 cm long and 1&ndash;6 cm broad. The flowers are small, white in color and arranged in a terminal spike. Unusual among Lamiaceae, the four stamens and the pistil are not pushed under the upper lip of the corolla, but lie over the inferior lip.', '', '', '', 'view/598587875/Basil', 769, 273, 5, 'no', 2, 0),
(533, 518, '163880156', '178.134.36.99', 1453981895, 0, 3, '', 'Mint', 'info7ee1344fc8017a99a9ef253de9afeb39.jpg', '999', '', '50', '55', '14 days ', '50 gr.', 'International Quality Grown Award', '5 tones.', '', '', '', '', '', 'on', '', '', 'Mints will grow 10&ndash;120 cm tall and can spread over an indeterminate area. Due to their tendency to spread unchecked, some mints are considered invasive.', '', '', '', 'view/163880156/Mint', 769, 274, 5, 'no', 2, 0),
(534, 519, '619096585', '178.134.36.99', 1453982127, 0, 3, '', 'Radish', 'infod376c4bc698f1d78867efd33fd168ba2.jpg', '1004', '', '50', '55', '14 days ', '150 gr.', 'International Quality Grown Award', '10 tones.', '', '', '', '', '', 'on', '', '', 'Radishes are annual or biennial brassicaceous crops grown for their swollen tap roots which can be globular, tapering, or cylindrical. Smaller types have a few leaves about 13 cm long with round roots up to 2.5 cm in diameter or more slender, long roots up to 7 cm long', '', '', '', 'view/619096585/Radish', 769, 275, 5, 'no', 2, 0),
(535, 520, '927483205', '178.134.36.99', 1453982281, 0, 3, '', 'Salad Mix', 'infocb2d94fce7a6c60f8454a81bced83fff.jpg', '987', '', '50', '55', '14 days', '150 gr.', 'International Quality Grown Award', '50 tones.', '', '', '', '', '', 'on', '', '', 'Lettuce- Lolla Rosa, Lolla bionda, Iceberg', '', '', '', 'view/927483205/Salad-Mix', 769, 276, 5, 'no', 2, 0),
(536, 521, '630553981', '178.134.36.99', 1453982431, 0, 3, '', 'Cucumber', 'info7974d3d36c5cd3055c924d4ea70f4e3c.jpg', '992', '', '50', '55', '14 days', '500 gr.', 'International Quality Grown Award', '30 tones.', '', '', '', '', '', 'on', '', '', 'The cucumber is a creeping vine that roots in the ground and grows up trellises or other supporting frames, wrapping around supports with thin, spiraling tendrils. The fruit of the cucumber is roughly cylindrical, elongated with tapered ends, and may be as large as 60 centimeters long and 10 centimeters in diameter.', '', '', '', 'view/630553981/Cucumber', 769, 277, 5, 'no', 2, 0),
(537, 522, '809822547', '178.134.36.99', 1453982569, 0, 3, '', 'Green Onion', 'info3382c0d030672f636a85a6425fdf6bf4.jpg', '980', '', '50', '55', '14 days ', '150 gr.', ' International Quality Grown Award', '20 tones.', '', '', '', '', '', 'on', '', '', 'Scallion, green onion, and spring onion are English names for various Allium species. All of the Allium have hollow green leaves (like the common onion), but these are used while they lack a fully developed root bulb. Used as a vegetable, they are eaten either raw or cooked. Scallions have a milder taste than most onions.', '', '', '', 'view/809822547/Green-Onion', 769, 278, 5, 'no', 2, 0),
(538, 523, '699928103', '178.134.36.99', 1453982697, 0, 3, '', 'Tomato', 'infoe6033dfd31971b9c5410b2aa99c64011.jpg', '979', '', '50', '55', '14 days', '500 gr.', 'International Quality Grown Award', '30 tones.', '', '', '', '', '', 'on', '', '', 'The species originated in Central and South America and its use as a food originated in Mexico, and spread throughout the world following the Spanish colonization of the Americas. The plants typically grow to 1&ndash;3 meters in height and have a weak stem that often sprawls over the ground and vines over other plants.', '', '', '', 'view/699928103/Tomato', 769, 279, 5, 'no', 2, 0),
(539, 524, '499936652', '178.134.36.99', 1453982849, 0, 3, '', 'Papper', 'info96703cd7a6582a372e7e55c0fbd37114.jpg', '1004', '', '50', '55', '14 days ', '500 gr.', 'International Quality Grown Award', '20 tones', '', '', '', '', '', 'on', '', '', 'Paper is a thin material produced by pressing together moist fibres of cellulose pulp derived from wood, rags or grasses, and drying them into flexible sheets. It is a versatile material with many uses, including writing, printing, packaging, cleaning, and a number of industrial and construction processes.', '', '', '', 'view/499936652/Papper', 769, 280, 5, 'no', 2, 0),
(540, 525, '273960619', '212.72.128.130', 1454048530, 0, 3, '', 'Natural wine vinegar', 'gnp-2011f1f30462f6e3412355d0e8947840bb90.jpg', '1407', '', '113', '149', '24 Monthes', '500 m/l  and  300 m/l glass  container', 'N/A', '', '', '', '', '', '', 'on', '', '', 'Company GNP presents 100% natural filtered peasant vinegar prepared with natural methods from the country of centuries-old wine traditions. Find the substitute for vinegar essences and vinegar of unknown origins in natural wine vinegar if you want to supply you body with healthy food.', '', '', '', 'view/273960619/Natural-wine-vinegar', 797, 281, 5, 'no', 2, 0),
(541, 526, '246237431', '212.72.128.130', 1454048749, 0, 3, '', 'Tomato Sauce ', 'gnp-20115776609b5c7cad78cad647a33fbcfd14.jpg', '1405', '', '113', '149', '24 Monthes', '500 m/l  and  300 m/l glass containe', 'N/A', 'N/A', '', '', '', '', '', 'on', '', '', 'The product with distinctive Georgian taste is used to cook everything with tomato. It gives unique taste to any kind of roast meat and fish added as sauce. It raises tonus and soberness and accelerates food digestion process', '', '', '', 'view/246237431/Tomato-Sauce-', 797, 282, 5, 'no', 2, 0),
