(580, 565, '884994786', '212.72.128.130', 1454399426, 0, 3, '', 'Rose wine', 'kakhetian4e4ecf0eef5d8ddf8596f01c3cfb5fab.jpg', '1418', '', '114', '152', '24 Monthes', 'Glass bottle', 'N/A', '80000 Bottles', '', '', '', '', '', 'on', '', '', 'Is produced from Saperavi, Muscat and Mtsvane grape varieties cultivated in Kakheti region. Due to manufacturing technology the wine has light pink color, soft harmonius taste with a gentle bouquet of spring flowers and a tone of roses. Excellent pair with fruit and sweets also can be served with sea food, salads and cold dishes', '', '', '', 'view/884994786/Rose-wine', 845, 315, 5, 'no', 2, 0),
