(582, 567, '436689428', '212.72.128.130', 1454399890, 0, 3, '', 'Saperavi', 'kakhetian4fa6d1b8c64ddfce735725d163b971e6.jpg', '1418', '', '114', '152', '24 Monthes', 'Glass bottle', 'N/A', '600000 Bottles', '', '', '', '', '', 'on', '', '', 'Red dry wine. Made from Saperavi grape variety cultivated in Mukuzani and Teliani micro-zones (Kakheti region, Eastern Georgia). Wine has very dark ruby color, distinct floral and fruity bouquet, with mild tartness and tones plums, ripe fruits and cherry. The taste is balanced and harmonious, with a long finish.', '', '', '', 'view/436689428/Saperavi', 845, 317, 5, 'no', 2, 0),
(583, 568, '507104051', '212.72.128.130', 1454400201, 0, 3, '', 'OLD KAKHETI 17 YEARS OLD', 'kakhetian11eeec147935cb7a10a2e1d3b8655a13.jpg', '6302', '', '114', '151', 'Expiry date is not limited at +5-20 Celsius', 'Glass bottle', 'N/A', '100000 Bottles', '', '', '', '', '', 'on', '', '', 'Georgian Brandy &bdquo;OLD KAKHETI &ldquo; , 17 year aged It is made from 17 years aged brandy spirits from famous wine making region of Georgia, Kakheti. Stored in georgian oak barrels &ldquo;Iberika&rdquo;. Brandy is chestnut colored, enriched with golden rays.', '', '', '', 'view/507104051/OLD-KAKHETI-17-YEARS-OLD', 845, 318, 5, 'no', 2, 0),
(584, 569, '332701949', '212.72.128.130', 1454400588, 0, 3, '', 'CHACHA - PREMIUM CLASSIC', 'kakhetianbc40df6499f4b443ccf168db46c2e018.jpg', '6302', '', '114', '151', 'Expiry date is not limited at +5-20 Celsius', 'Glass bottle', 'N/A', '200000 Bottles', '', '', '', '', '', 'on', '', '', 'Chacha Premium Classic is national product of Georgia &ndash; Grape Vodka, brilliant beverage, with an ancient traditions. Is made through the old traditional methods, passed from generation to generation. Is made of grape residue left after the separation from wine. Stored in oak barrels no less than 9 months.', '', '', '', 'view/332701949/CHACHA---PREMIUM-CLASSIC', 845, 319, 5, 'no', 2, 0),
