(589, 574, '591932081', '176.73.49.177', 1454415088, 0, 3, '', 'Saperavi', 'ketuniakesia074078bf3297ff9c4ccd45daba95122.jpg', '1419', '', '114', '152', 'The product’s shelf life is unlimited if its storage terms are kept accurately.  ', '6x750ml. cartoon box', 'Golden medal  - The 6th “International Wine Award” – 2014, Tbilisi, Georgia.; Double Gold – CWSA  (China Wine & Spirits Awards) 2015 – Hong Kong', '', '', '', '', '', '', 'on', '', '', 'SAPERAVI - Dry red wine. This wine is made from the selected Saperavi grape variety grown in Kakheti, in Shumi&rsquo;s own Valley of Roses vineyard, cultivated in the village of Tsinandali. Wine has a deep pomegranate color, with a ripe cherry and blackberry aroma. It has a strongly developed, complex bouquet and a balanced, harmonious taste.', '', '', '', 'view/591932081/Saperavi', 849, 322, 5, 'no', 2, 0),
(590, 575, '938115860', '212.72.128.130', 1454415098, 0, 3, '', 'Tsinandali', 'ketuniakesi0f7f3bf09006309c9565578674e2be4b.jpg', '1419', '', '114', '152', 'The product’s shelf life is unlimited if its storage terms are kept accurately.  ', '6x750ml. Cartoon box', 'COMMENDED - “International Wine Challenge 2014” – London, UK.;  Gold Medal – CWSA China Wine & Spirits Awards) 2015 – Hong Kong', 'N/A', '', '', '', '', '', 'on', '', '', 'TSINANDALI - Dry white wine AOC. The wine is made from selected Rkatsiteli and Mtsvane grape varieties grown in Kakheti, in Shumi&rsquo;s own, soil rich, Valley of Roses vineyard. The vineyard is cultivated in the strictly controlled micro-zone of Tsinandali.This light straw colored wine has strongly expressed citrus tones and aroma of tropical fruits.', '', '', '', 'view/938115860/Tsinndali', 849, 323, 5, 'no', 2, 0),
(591, 576, '666693865', '176.73.49.177', 1454415386, 0, 3, '', 'Khvanchkara', 'ketuniakesi4aca970e16857cbe8423c20f76b83b88.jpg', '1419', '', '114', '152', 'The product’s shelf life is unlimited if its storage terms are kept accurately.  ', '6x750ml. cartoon box', 'Golden medal  - The 6th “International Wine Award” – 2014, Tbilisi, Georgia.; Golden medal  - 16th Mundus Vini grand international wine award 2015 , spring tasting – Dusseldorf, Germany.', '', '', '', '', '', '', 'on', '', '', 'KHVANCHKARA naturally s/sweet red wine AOC. Wine is made from Aleksandrouli and Mujuretuli grape varieties grown in Shumi&rsquo;s own Velnaari vineyard, cultivated in the micro-zone of Khvanchkara, Racha. Wine is of dark ruby color. It is characterized by a complex, well developed bouquet.It has pleasant, soft tones of ripe berries rich ending.', '', '', '', 'view/666693865/Khvanchkara', 849, 324, 5, 'no', 2, 0),
(592, 577, '763162118', '92.51.84.98', 1454488693, 0, 3, '', 'Tsolikouri ', 'n.pailodzefc967ca071a5d0e9fb62beaf1fed5248.jpg', '1419', '', '114', '152', '24 months ', 'Glass bottle ', 'IWC (Silver medal), IWSC (Silver medal) Decanter (Recommended)', '750 ml ', '', '', '', '', '', 'on', '', '', 'White dry wine &ldquo;Tsolikouri&rdquo; is made from the Tsolikouri grape variety cultivated in the Tvishi specific viticulture district of Lechkhumi. The wine has a light-amber color and a fresh, delicate taste with a fruity aroma. Grape variety &ndash; 100% Tsolikouri Appellation &ndash; Tvishi specific zone', 'fc967ca071a5d0e9fb62beaf1fed5248.jpg', '', '', 'view/763162118/Tsolikouri-', 861, 325, 5, 'no', 2, 0),
(593, 578, '259244352', '212.72.128.130', 1454488938, 0, 3, '', 'Tamada- Napareuli dry red wine', 'lominadzeninucafe90fd8e0969d1eb98654b3e7d1ef240.jpg', '1419', '', '114', '152', 'Unlimited', 'Glass bottle, 0.75L', 'CWSA Best Value 2014 (China Wine & Spirits Awards) -  Medal : DOUBLE GOLD MEDAL', '300000 Bottles', '', '', '', '', '', 'on', '', '', 'Mature but still bright ruby blended with blue and brick hues. Black mulberry and sweet cherry enhanced with spicy oak and vanilla overtones. Palate is tasteful and exuberant bearing raspberry and cherry fruit flavours. Velvety tannins enhance the wine structure. Oak maturation is complemented with excellently expressed vinosity.', '', '', '', 'view/259244352/Tamada--Nnapareuli-dry-red-wine', 865, 326, 5, 'no', 2, 0),
(594, 579, '839725729', '92.51.84.98', 1454489089, 0, 3, '', 'Tvishi ', 'n.pailodze61244a06136fe54d49df5dddf75b4525.jpg', '1419', '', '114', '152', '24 months ', 'Glass bottle 750 ml', 'IWSC (Silver medal), IWC (Silver medal), Decanter (Recommended)', '300000', '', '', '', '', '', 'on', '', '', 'Appellation controlled white semi-sweet wine Tvishi is made from the Tsolikouri grape variety cultivated in the Tvishi specific viticulture district of Lechkhumi. The wine has a light-amber color and a fresh, delicate taste with a fruity aroma. Grape variety 100% Tsolikouri Appellation &ndash; Tvishi specific zone', '', '', '', 'view/839725729/Tvishi-', 861, 327, 5, 'no', 2, 0),
(595, 580, '119164464', '212.72.128.130', 1454489436, 0, 3, '', 'Tamada - Kindzmarauli semi sweet red wine', 'lominadzeninuca847719ef1b6ecfa9f1fa3c1e79e26792.jpg', '1419', '', '114', '152', 'Unlimited', 'Glass bottle 0.75L', 'CWSA Best Value 2015 (China Wine & Spirits Awards) - Medal : DOUBLE GOLD MEDAL', '300000 Bottles', '', '', '', '', '', 'on', '', '', 'Live dark ruby red with obvious blue hue. Blackberry and dark cherry have generously affected the aromas. The violet aroma &ndash; the symbol of recognition for Kindzmarauli wine, is splendidly blended with spicy black pepper. Rich but soft harmonic tannin structure, an exuberant palate with a full and velvety middle. Inviting long finish.', '', '', '', 'view/119164464/Tamada-Kindzmarauli-semi-sweet-red-wine', 865, 328, 5, 'no', 2, 0),
(596, 581, '948165089', '212.72.139.22', 1454489576, 0, 3, '', 'Tamada - Tsinadali Dry White Wine', 'lominadzeninuca9fbbb87c4a81dc2bb60d29f4af638a63.jpg', '1419', '', '114', '152', 'unlimited', 'Glass Bottle , 0.75 L', 'CWSA Best Value 2014 (China Wine & Spirits Awards) - Medal : Gold', '70000', '', '', '', '', '', 'on', '', '', 'Light straw complemented with some amber hue from the ageing. Ageing overtones and floral aromas blended with mature yellow plum flavours typical with this style of wine. The palate is powered with delicate body and intriguing almost hard acidity. This combination produced a wine with a fresh, crispy and lingering after-palate and vinosity.', '', '', '', 'view/948165089/Tamada---Tsinadali-Dry-White-Wine', 865, 329, 5, 'no', 2, 0),
(597, 582, '429721309', '212.72.139.22', 1454490393, 0, 3, '', 'Old Tbilisi - Saperavi', 'lominadzeninuca3700039e08d684bc195ac56a47a8d7ad.jpg', '1419', '', '114', '152', 'N/A', 'Glass Bottle , 0.75L', 'N/A', '500000', '', '', '', '', '', 'on', '', '', 'Lively and intense with expressed ruby colour. This young wine outstandingly exhibits black mulberry and mature older fruits gently mixed with sweet cherry aromas. Unique fruit flavours are echoed on the palate. Mid weight but powerful, rich and with a soft tannin structure, it is well balanced with acidity.', '', '', '', 'view/429721309/Old-Tbilisi---Saperavi', 865, 330, 5, 'no', 2, 0),
(598, 583, '031867924', '212.72.139.22', 1454496658, 0, 3, '', 'Tamada - Tvishi Semi sweet white wine', 'lominadzeninuca8c4526e071aaa289fc1df94007ed2242.jpg', '1419', '', '114', '152', 'Unlimited', 'Glass Bottle , 0.75L', 'N/A', '25000', '', '', '', '', '', 'on', '', '', 'Naturally semi-sweet wine. Straw-coloured with greenish tints. Tvishi is a complex, rich wine with fruity aromas, characterized by sharply expressed melon, banana, pear and grapefruit. Aromatic sweetness and light acidity create a lingering taste', '', '', '', 'view/031867924/Tamada---Tvishi-Semi-sweet-white-wine', 865, 331, 5, 'no', 2, 0),
(599, 584, '356707672', '92.51.84.98', 1454497090, 0, 3, '', 'Saperavi', 'n.pailodzebbd6b2f4266823f94c8f3176f57db45e.jpg', '1419', '', '114', '152', '24 Months ', 'Glass bottle, 750 ml ', 'IWSC (bronze medal) IWC (recommended)', '500000', '', '', '', '', '', 'on', '', '', 'Table red dry wine &ldquo;Saperavi&rdquo; is made from the Saperavi grape variety grown in Kakheti. It has dark-ruby colour, characterized by a sharp, harmonious flavour and pleasant aftertaste. Grape variety &ndash; 100% Saperavi Appellation &ndash; Kakheti region', 'bbd6b2f4266823f94c8f3176f57db45e.jpg', '', '', 'view/356707672/Saperavi', 861, 332, 5, 'no', 2, 0),
(600, 585, '178018135', '212.72.128.130', 1454497738, 0, 3, '', 'Mukuzani ', '', '1419', '', '114', '152', '24 Monthes', 'Glass bottle, 750 ML', 'N/A', 'N/A', '', '', '', '', '', 'on', '', '', 'Appellation controlled red dry wine “Mukuzani ”is made from the Saperavi grape\nvariety grown in Mukuzani specific viticulture district of Kakheti. This outstanding\nwine  is  aged  in  oak  barrels  for  twelve  month.  It  has  a  dark-ruby  color  and  is\ncharacterized by a gentle bouquet and a smooth aroma.\n', '', '', '', 'view/178018135/Mukuzani-', 861, 333, 5, 'no', 1, 1),
(601, 586, '272326075', '212.72.128.130', 1454497772, 0, 3, '', 'Mukuzani', 'n.pailodzebdff1b87b4fa101569fb0ea15067bb07.jpg', '1419', '', '114', '152', '24 Monthes', 'Glass bottle, 750 ML', 'N/A', 'N/A', '', '', '', '', '', 'on', '', '', 'Appellation controlled red dry wine &ldquo;Mukuzani &rdquo;is made from the Saperavi grape variety grown in Mukuzani specific viticulture district of Kakheti. This outstanding wine is aged in oak barrels for twelve month. It has a dark-ruby color and is characterized by a gentle bouquet and a smooth aroma.', 'af40496e86f40d78b78c4b4219bee9bb.jpg', '', '', 'view/272326075/Mukuzani', 861, 333, 5, 'no', 1, 1),
(602, 587, '042718415', '212.72.139.22', 1454498125, 0, 3, '', 'Château Mukhrani - Goruli Mtsvane Dry white wine', 'chmukhranice0fef6d58c3e4f7644b78b93e0f15b5.jpg', '1419', '', '376', '383', 'Unlimited', 'Glass Bottle , 0.75L', 'Jerusalem Terravino 2011- Medal : Gold', '50000', '', '', '', '', '', 'on', '', '', 'Colour is green to light yellow straw. Goruli Mtsvane is Georgia&rsquo;s endemic and unique white varietal which has proven itself through the centuries.This wine is best enjoyed with poultry and fish. It is charming with crisp salads. It is also excellent as an aperitif.', '', '', '', 'view/042718415/Château-Mukhrani---Goruli-Mtsvane-Dry-white-wine', 869, 333, 5, 'no', 2, 0),
(603, 588, '973412830', '212.72.139.22', 1454498454, 0, 3, '', 'Château Mukhrani - Tavkveri Dry Rose', 'chmukhrani1c6c8a97f43ce6068f6a9b063c62460d.jpg', '1419', '', '376', '383', 'Unlimited', 'Glass Bottle , 0.75L', 'HKIWSC - Hong Kong International Wine and Spirits - Medal : Bronze', '30000', '', '', '', '', '', 'on', '', '', 'The wine is bright pink with a crimson hue. A fragrant nose of strawberry and cranberry. Tavkveri is one of Georgia&rsquo;s best known endemic varietals, which makes structured red and excellent fruity, crisp rose wines. It is perfect with Asian food as well as with food made of white meat and sea fish.', '', '', '', 'view/973412830/Château-Mukhrani---Tavkveri-Dry-Rose', 869, 334, 5, 'no', 2, 0),
(604, 589, '297667369', '212.72.139.22', 1454498584, 0, 3, '', 'Château Mukhrani - Reserve Du Prince Goruli Mtsvane', 'chmukhrani15e5c3cc78fe1d4a4be9df3ae9488347.jpg', '1419', '', '376', '383', 'Unlimited', 'Glass Bottle, 0.75 L', 'Concours Mondial de Bruxelles - Medal : Gold', '15000', '', '', '', '', '', 'on', '', '', 'Reserve Du Prince Goruli Mtsvane is Georgia&rsquo;s endemic and unique white varietal which has proven itself through the centuries and has always been delivering refreshing and memorable wines.Through thousands of years the soil, the sun, the wine varietals, the winemakers and vignerons have combined to deliver the juice for wine of such elegance.', '', '', '', 'view/297667369/Château-Mukhrani---Reserve-Du-Prince-Goruli-Mtsvane', 869, 335, 5, 'no', 2, 0),
(605, 590, '570028640', '212.72.139.22', 1454498766, 0, 3, '', 'Château Mukhrani - Reserve Du Prince Saperavi', 'chmukhrani7a6c5646a788a95094112313d25f1225.jpg', '1419', '', '376', '383', 'Unlimited', 'Glass Bottle , 0.75L', 'CWSA Best Value 2014 - Medal : Gold', '15000', '', '', '', '', '', 'on', '', '', 'Aromas of mulberry, blackberry,mixed with cherry.An excellent texture and well balanced palate offers a combined sensation of the varietal fruit and tannins , still to reach their final maturity.Once matured,it will reveal a character of oak aged Saperavi loved by all who have had the pleasure to taste this truly magnificent varietal of wine.', '', '', '', 'view/570028640/Château-Mukhrani---Reserve-Du-Prince-Saperavi', 869, 336, 5, 'no', 2, 0),
(606, 591, '430245387', '212.72.139.22', 1454498835, 0, 3, '', 'Château Mukhrani -  Saperavi Dry red wine', 'chmukhrani77050aa2ef0d736fdb2dc416832b5bc6.jpg', '1419', '', '376', '383', 'Unlimited', 'Glass Bottle , 0.75L', 'Mundus Vini 2015 - Medal:Gold', '70000', '', '', '', '', '', 'on', '', '', 'Colour of opulent ruby. Bouquet of black mulberry, blackberry and cherry. Palate echoes with soft oak. Exuberant, yet velvety tannins are well balanced within the entire structure. The wine has excellent expressed vinosity. With age it may develop diamond-crystalline deposits, further showing its noble origin and revered handling.', '', '', '', 'view/430245387/Château-Mukhrani----Saperavi-Dry-red-wine', 869, 337, 5, 'no', 2, 0),
