(609, 594, '998185490', '212.72.128.130', 1454505367, 0, 3, '', 'Saperavi Unfiltered ', 'n.pailodze7ed49886227e3dccaca0bae5c18f379d.jpg', '1419', '', '114', '152', '24 Months', 'Glass bottle 750 ml ', 'Wine for Asia  (Silver medal), Decanter (Recommended) ', '100000', '', '', '', '', '', 'on', '', '', 'Unfiltered red dry wine Saperavi made from hand-selected premium Saperavi grapes variety grown in Tsinandali vineyards. Classic aromatic display of roasted coffee, black plumps, ripe cherries and hint of vanilla. The oak is beautifully rated into elegant, young Saperavi having full body.', '', '', '', 'view/998185490/Saperavi', 861, 339, 5, 'no', 2, 0),
