(611, 596, '754764537', '92.51.84.98', 1454505438, 0, 3, '', 'Tsinandali', 'n.pailodzeeff85f048927e022354c80de560aa43d.jpg', '1419', '', '114', '152', '24 Months ', 'Glass bottle 750 ml ', 'Mondial /France(Silver medal), IWC (Silver medal), Wine Spectator (88 points), IWSC (Bronze medal)Wine for Asia (Bronze medal)', '500000', '', '', '', '', '', 'on', '', '', 'Appellation controlled white dry wine &ldquo;Tsinandali&rdquo; Is made from Rkatsiteli and Mtsvane grape varieties grown in the Tsinandali specific viticulture district of Kakheti. The wine has a pale-straw color, a fine bouquet and a mild exquisite taste. Grape variety &ndash; Rkatsiteli, Mtsvane', '', '', '', 'view/754764537/Tsinandali', 861, 341, 5, 'no', 2, 0),
(612, 597, '295588269', '178.134.73.98', 1454509148, 0, 3, '', 'Cognac "Zurab Tsereteli" V.S', 'akaki08e1eb936248d4941011ebfc99b90632.jpg', '6302', '', '114', '152', 'Unlimited', 'Glass bottle', 'N/A', '500 ML', '', '', '', '', '', 'on', '', '', 'Cognac &ldquo;Zurab Tsereteli&rdquo; V.S is made of the high-quality cognac distillates sustained in oak barrels not less than 5 years, from the various wine-making micro zones of Georgia. Cognac is characterized by the light-straw color, distinctive fruit bouquet with oak tones and pleasant taste.', '', '', '', 'view/295588269/Tsereteli-VS', 489, 342, 5, 'no', 2, 0),
(613, 598, '007460378', '178.134.73.98', 1454509217, 0, 3, '', 'Cognac "Zurab Tsereteli" V.S.O.P', 'akakie647947cafd78ebf04b93ff01efa191a.jpg', '6302', '', '114', '152', 'Unlimited', 'Glass', 'N/A', '500 ML', '', '', '', '', '', 'on', '', '', 'Cognac &ldquo;Zurab Tsereteli&rdquo; V.S.O.P is made of the high-quality cognac distillates sustained in oak barrels not less than 7 years, from the various wine-making micro zones of Georgia. Cognac has a dark-honey color, distinctive fruit bouquet with oak tones and pleasant taste.', '', '', '', 'view/007460378/Zurab-Tsereteli-VSOP', 489, 343, 5, 'no', 2, 0),
(614, 599, '714553135', '212.72.128.130', 1454584511, 0, 3, '', 'Lovely Woman', 'madamvino18a3160a7cca6000a27f49c789d6daa13.jpg', '1418', '', '114', '152', 'Unlilited', 'Glass bottle 0.75L', 'N/A', 'N/A', '', '', '', '', '', 'on', '', '', 'Lovely woman&ndash; A semi-sweet red wine made from Saperavi, and other red grape varieties cultivated in the Eastern and Western Georgia. The wine has a dark pomegranate color and full velvety taste.', '', '', '', 'view/714553135/Lovely-Woman', 881, 344, 5, 'no', 2, 0),
(615, 600, '324230993', '212.72.128.130', 1454584755, 0, 3, '', 'Kakhuri', 'madamvino106883be672c09928ca2be61b2f5e336e.jpg', '1418', '', '114', '152', 'Unlimited', 'Glass bottle, 0.75L', 'N/A', 'N/A', '', '', '', '', '', 'on', '', '', 'A semi-sweet red wine made from Saperavi, and other red grape varieties cultivated in the Eastern and Western Georgia. The wine has a dark pomegranate color and full velvety taste. Best served with desert and fruits at +14-150C', '', '', '', 'view/324230993/Kakhuri', 881, 345, 5, 'no', 2, 0),
(616, 601, '627136197', '212.72.128.130', 1454585032, 0, 3, '', 'COQUETTE', 'madamvino1322dd2734730f84c8e8a34560dda7815.jpg', '1418', '', '114', '152', 'Unlimited', 'Glass bottle, 0.75 L', 'N/A', 'N/A', '', '', '', '', '', 'on', '', '', 'COQUETTE- A semi-dry red wine made from Saperavi, Tavkveri and Cabernet grape varieties, which are cultivated in Kakheti region, East Georgia. It has dark pomegranate color. The wine characterized by rich bouquet with harmonious, velvety taste. Best served with various type of meat and cheese at + 14-150C', '', '', '', 'view/627136197/COQUETTE', 881, 346, 5, 'no', 2, 0),
