(625, 610, '777203582', '178.134.73.98', 1454654685, 0, 3, '', 'Chacha "Zurab Tsereteli"', 'akaki8734593c0374a376d7a5e3f0673a6933.jpg', '6302', '', '114', '152', 'Unlimited', 'Glass', 'N/A', '500 ML', '', '', '', '', '', 'on', '', '', 'Chacha is one of the oldest Georgian brandy made from the grape (residue left after making wine) with ancient traditions, mostly from Kakheti Region. Chacha is estimated by a chain which is formed during shaking. The chain appears over 48% of the strength. It has typical aroma and taste inherent only to Chacha.', '', '', '', 'view/777203582/Chacha-Zurab-Tsereteli', 489, 352, 5, 'no', 2, 0),
(626, 611, '121155419', '178.134.73.98', 1454654778, 0, 3, '', 'Chacha "Zurab Tsereteli" (Made in Oak Barrel)', 'akaki10f616402f307e9141f480fd91c88969.jpg', '6302', '', '114', '152', 'Unlimited', 'Glass', 'N/A', '500 ML', '', '', '', '', '', 'on', '', '', 'Chacha is one of the oldest Georgian brandy made from the grape (residue left after making wine) with ancient traditions, mostly from Kakheti Region. Chacha is estimated by a chain which is formed during shaking. The chain appears over 48% of the strength. It has typical aroma, taste and color inherent only to Chacha kept in the oak barrel.', '', '', '', 'view/121155419/Chacha-Zurab-Tsereteli-Made-in-Oak-Barrel', 489, 353, 5, 'no', 2, 0),
(627, 612, '122923447', '212.72.128.130', 1454658943, 0, 3, '', 'Kindzmarauli', '', '1418', '', '114', '152', '12 Months', 'Glass bottle 0.75 L', 'N/A', '800000 Bottles', '', '', '', '', '', 'on', '', '', 'Kindzmarauli', '', '', '', 'view/122923447/Kindzmarauli', 909, 354, 5, 'no', 1, 1),
(628, 613, '970704943', '212.72.128.130', 1454659243, 0, 3, '', 'Kindzmarauli', 'marketing5f3bc51996efeacc4fcddefdc1117d21.jpg', '1418', '', '114', '152', '12 Months', 'Glass bottle, 0.75 L', 'N/A', '500000 Bottles', '', '', '', '', '', 'on', '', '', 'Controlled appellation of origin, naturally semi&shy; sweet red wine. It is produced from Saperavi grape variety, cultivated in Eastern Georgia, in Kvareli Administrative district, on the left bank of the river Alazani. The wine is characterized by a dark, pomegranate sweetness, with fruit tones, and species-specific aroma.', '', '', '', 'view/970704943/Kindzmarauli', 909, 354, 5, 'no', 2, 0),
(629, 614, '900200292', '212.72.128.130', 1454659758, 0, 3, '', 'Akhasheni', 'marketingcee4b762e21dadae3120c2ce535ec975.jpg', '1418', '', '114', '152', '12 Months', 'Glass bottle, 0.75 L', 'N/A', '25000 Bottles', '', '', '', '', '', 'on', '', '', 'Controlled appellation of origin, naturally semi-sweet red wine, produced in a particular area of its origin. The wine is produced from Saperavi grape variety, cultivated in Akhasheni micro-zone.', '', '', '', 'view/900200292/Akhasheni', 909, 355, 5, 'no', 2, 0),
(630, 615, '484433476', '212.72.128.130', 1454660040, 0, 3, '', 'Alaznis veli', 'marketinga1197abdc58e31531b7b88685884ec4f.jpg', '1418', '', '114', '152', '12 Months', 'Glass bottle, 0.75 L', 'N/A', '350000 Bottles', '', '', '', '', '', 'on', '', '', 'Naturally semi-sweet red wine, produced from Saperavi and other red grape varieties, cultivated in Western and Eastern Georgia. It is characterized by a pleasant harmonious aroma. Drink as an aperitif with sweet-stuff, chilled at 8&deg;C-10&deg;C.', '', '', '', 'view/484433476/Alaznis-veli', 909, 356, 5, 'no', 2, 0),
(631, 616, '432346135', '212.72.128.130', 1454660147, 0, 3, '', 'Vaziani', 'marketinge95609b5d01d6145a9ca01bebf146f4b.jpg', '1418', '', '114', '152', '12 Months', 'Glass bottle, 0.75 L', 'N/A', '20000 Bottles', '', '', '', '', '', 'on', '', '', 'Naturally semi-sweet red wine, produced from Saperavi and other red grape varieties, cultivated in Kakheti. The wine has dark red color. It has pleasant aroma and harmonious velvety sweetness. Drink as an aperitif with sweet-stuff chilled at 8&deg;C-10&deg;C.', '', '', '', 'view/432346135/Vaziani', 909, 357, 5, 'no', 2, 0),
(632, 617, '546657577', '212.72.128.130', 1454660263, 0, 3, '', 'Pirosmani', 'marketingbc42a727609386174a3af9dc483ef3b8.jpg', '1418', '', '114', '152', '12 Months', 'Glass bottle, 0.75 L', 'N/A', '20000 Bottles', '', '', '', '', '', 'on', '', '', 'Naturally semi-dry red wine, produced from Saperavi grape variety, cultivated on the right bank of the river Alazani, Kakheti region, Georgia. The wine is shiny garnet red in color with notes of crushed strawberry and red plums And sprinkle of spice. The medium-bodied ruby wine with a hint of sweetness has a soft supple palate.', '', '', '', 'view/546657577/Pirosmani', 909, 358, 5, 'no', 2, 0),
(633, 618, '708779694', '212.72.128.130', 1454660392, 0, 3, '', 'Mukuzani', 'marketingcd6bf00062ca468e878da586bc1dd943.jpg', '1418', '', '114', '152', '12 Months', 'Glass bottle, 0.75 L', 'N/A', '50000 Bottles', '', '', '', '', '', 'on', '', '', 'Naturally dry red wine, produced from Saperavi grape variety, cultivated in Mukuzani micro-zone, in Kakheti region. A dry dark red wine that is characterized by a fruity aroma with a well balanced taste and pleasant tannins, exhibits a rich distinctive aroma of cherry and black currant and an exquisite, pleasantly tannic taste.', '', '', '', 'view/708779694/Mukuzani', 909, 359, 5, 'no', 2, 0),
(634, 619, '648343480', '212.72.128.130', 1454660495, 0, 3, '', 'Saperavi', 'marketing4c1715e0026c11d5b7d0a7245600bb20.jpg', '1418', '', '114', '152', '12 Months', 'Glass bottle, 0.75 L', 'N/A', '150000 Bottles', '', '', '', '', '', 'on', '', '', 'Naturally dry red wine. It is produced from Saperavi grape variety, cultivated in Kakheti region. The wine has been produced since 1886. The wine has dark red color. It is rather extractive and characterized by rich aroma and pleasant astringent flavor. Serve with poultry, pork, meat and cheese, chilled at 16&deg;C-18&deg;C.', '', '', '', 'view/648343480/Saperavi', 909, 360, 5, 'no', 2, 0),
(635, 620, '451918139', '212.72.128.130', 1454661854, 0, 3, '', 'Tsinandali', 'marketing0fe3c7196a6c551ed3401930b2242e91.jpg', '1418', '', '114', '152', '12 Months', 'Glass bottle, 0.75 L', 'N/A', '80000 Bottles', '', '', '', '', '', 'on', '', '', 'Controlled appellation of origin, naturally dry white wine. Wine matures in oak barrels. It is produced from Rkatsiteli and Mtsvane grape varieties, cultivated in Tsinandali micro-zone, in Kakheti region. It has been produced since 1892. In 1960 it was awarded with a golden medal in Budapest. It has light hay color, fruit bouquet, delicate flavorand rich aroma. Drink with different kinds of fresh vegetables and fruit, chilled at 12&deg;C.', '', '', '', 'view/451918139/Tsinandali', 909, 361, 5, 'no', 2, 0),
(636, 621, '849812220', '212.72.128.130', 1454661969, 0, 3, '', 'Rkatsiteli', 'marketing26d5c52cf79e874c19e85a7de6a5ab20.jpg', '1418', '', '114', '152', '12 Months', 'Glass bottle, 0.75 L', 'N/A', '50000 Bottles', '', '', '', '', '', 'on', '', '', 'Naturally dry white table wine, produced from Rkatsiteli grape variety, cultivated in Kakheti region. It is characterized by distinctive bouquet, delicate harmonious flavor. Serve with different kinds of fish, vegetables and fruit, chilled at 12&deg;C.', '', '', '', 'view/849812220/Rkatsiteli', 909, 362, 5, 'no', 2, 0),
(637, 622, '762714341', '212.72.128.130', 1454662101, 0, 3, '', 'Alaznis veli', 'marketingefcda19c82740f334523b3a1b6dd8140.jpg', '1418', '', '114', '152', '12 Months', 'Glass bottle, 0.75 L', 'N/A', '250000 Bottles', '', '', '', '', '', 'on', '', '', 'Naturally semi-sweet white wine, produced from Rkatsiteli and other white grape\r\nvarieties, cultivated in Western and Eastern Georgia. It is characterized by a pleasant flavor.\r\nDrink as an aperitif with sweet-stuff, chilled at\r\n8&deg;C-10&deg;C.', '', '', '', 'view/762714341/Alaznis-veli', 909, 363, 5, 'no', 2, 0),
(638, 623, '310098959', '212.72.128.130', 1454662231, 0, 3, '', 'Vaziani Rose', 'marketingd576d656bdb75eae26aa70fe6a2b310e.jpg', '1418', '', '114', '152', '12 Months', 'Glass bottle, 0.75 L', 'N/A', '3000 bottles', '', '', '', '', '', 'on', '', '', 'Naturally semi-dry rose wine, produced from Syrah, Cabernet Sauvignon, Montepulciano grape varieties, cultivated in Eastern Georgia.\r\nThe wine has a harmonious taste bouquet, without extraneous tones. Serve with cheese dishes, baked ham and pasta with tomato sauce,\r\nchilled at 12&deg;C.', '', '', '', 'view/310098959/Vaziani-Rose', 909, 364, 5, 'no', 2, 0);
