(744, 729, '628877352', '212.72.128.130', 1455537258, 0, 3, '', 'Lemon', 'beer17445521496f8158f8eae748c2c6b10be.jpg', '1415', '', '114', '154', '3 Months', 'Glass Bottle', 'N/A', 'N/A', '', '', '', '', '', 'on', '', '', 'LEMON&rdquo; lemonade quenches thirst swiftly and properly. It has a transparent neutral color and strong flavor. Among the citrus sodas lemon is the obvious leader. Best fit for the lengthy and cordial parties.', '', '', '', 'view/628877352/Cream', 1025, 460, 5, 'no', 2, 0),
(745, 730, '346621070', '212.72.128.130', 1455537623, 0, 3, '', 'Cream', 'beer1fe304a5984eeacc47014e36246e7e935.jpg', '1414', '', '114', '154', '3 Months', 'Glass Bottle', 'N/A', 'N/A', '', '', '', '', '', 'on', '', '', 'CREAM&rdquo; is the most elegant representative of a large group of Georgian lemonades. It has incomparable and unique taste. Goes especially well with chocolate and desserts.', '', '', '', 'view/346621070/Cream', 1025, 461, 5, 'no', 2, 0),
(746, 731, '345219983', '212.72.128.130', 1455539825, 0, 3, '', 'Wilder', 'beer18cf8f7e025a974269f41e549ca82e95b.jpg', '5431', '', '135', '266', '3 Months', 'Pet bottle', 'N/A', 'N/A', '', '', '', '', '', 'on', '', '', 'WILDER is the first Georgian energy drink. Using the best ingredients, along with the water we\'re proud of, taking advantage of the most modern technical capabilities of brewery "Zedazeni" and the recipe developed together with European professionals - we&rsquo;ve created the Georgian analogue of the world\'s best energy drinks and called it WILDER', '', '', '', 'view/345219983/Wilder', 1025, 462, 5, 'no', 2, 0),
