(751, 736, '223639706', '212.72.128.130', 1455611139, 0, 3, '', 'PSYCHOSTABILE', 'gamaltd9d202ddace26b1323a18c010cccb2c54.jpg', '6316', '', '124', '191', 'N/A', 'Cardboard Boxes', 'N/A', 'N/A', '', '', '', '', '', 'on', '', '', 'Herbal sedative remedy 1 tablet of Psychostabile contains pronounced sedative action of medicinal herbs: dry extracts valerian, Melissa and hops. The unique formula has been developed according to the recommendations of FDA da Rx List of the USA.', '', '', '', 'view/223639706/PSYCHOSTABILE', 1065, 467, 5, 'no', 2, 0),
(752, 737, '777964932', '212.72.128.130', 1455611346, 0, 3, '', 'Green coffee', 'gamaltd27357025ff86c304357fe56645851f15.jpg', '6316', '', '124', '191', 'N/A', '500 mg of Green Coffee Extract contains 250 mg chlorogenic acid and multiple antioxidants.Cardboard Boxes', 'N/A', 'N/A', '', '', '', '', '', 'on', '', '', 'Studies have shown that the chlorogenic acid helps sugar processing in blood, blocks the release of glucose from glycogen and lipid normalization. Regulates the metabolism in the human body, thus contributing to the weight loss. Green Coffee Extract reduces appetite.', '', '', '', 'view/777964932/Green-coffee', 1065, 468, 5, 'no', 2, 0),
(753, 738, '717907714', '212.72.128.130', 1455611460, 0, 3, '', 'Graviola', 'gamaltd792b17ef590788071536af56a3a511ea.jpg', '6316', '', '124', '191', 'N/A', 'Cardboard Boxes', 'N/A', 'N/A', '', '', '', '', '', 'on', '', '', 'Tropical fruit Graviola (Guanabana) contains a substance &ndash; acetogenin (Amonaceous acetogenin), polyunsaturated fatty acids, trace elements: K, Na, Ca, Mg, Fe, group B and A, D, C vitamins. It is used in the treatment of many diseases: liver diseases, diarrhea, dysentery, arthritis, bronchitis, abscess, skin diseases, colds, flu, cough and fever.', '', '', '', 'view/717907714/Graviola', 1065, 469, 5, 'no', 2, 0),
(754, 739, '210117441', '212.72.128.130', 1455611624, 0, 3, '', 'Duo-Lax', 'gamaltd536684fe922cab4024618a9232445bf8.jpg', '6316', '', '124', '191', 'N/A', 'Cardboard Boxes', 'N/A', 'N/A', '', '', '', '', '', 'on', '', '', 'Description: Round shaped, brownish-colored tablets with dividing line with slightly bitter taste typical for aloe. Senna leaves contain anthraglycosides: majorly Raynaud diantrones (dimeric compounds), which are known as sennosides a and b (stereoisomers) as well as monoglycoisides - glucorein, glucoaloe-emodin, Rein glycosides.', '', '', '', 'view/210117441/Duo-Lax', 1065, 470, 5, 'no', 2, 0);
