(770, 755, '071173919', '212.72.128.130', 1455711095, 0, 3, '', 'Roasted and Salted Inshell Hazelnuts', 'gpr3fc715a0e9f6e28018d3402033b5400e.jpg', '1042', '', '113', '6305', 'N/A', 'Jute Bags, Big bags, Polypropylene Bags, Vacuum Bags', 'N/A', 'N/A', '', '', '', '', '', 'on', '', '', 'GPR started to launch a new salty snack product for Georgian and Foreign markets. Under the Brand Name "Bonuts" the company manufactures roasted and salted hazelnuts with shell. The product is delicious, useful and are immense in size (17-19mm, 19-21mm, 21+mm.).', '', '', '', 'view/071173919/Roasted-and-Salted-Inshell-Hazelnuts', 1085, 484, 5, 'no', 2, 0),
(771, 756, '708601771', '212.72.128.130', 1455711303, 0, 3, '', 'Hazelnuts in Shell', 'gprdd2864988eb29c69c27cd539b61ab319.jpg', '1042', '', '113', '6305', 'N/A', 'Jute Bags, Big bags, Polypropylene Bags, Vacuum Bags', 'N/A', 'N/A', '', '', '', '', '', 'on', '', '', 'Whole and sound kernels, normally developed. Dry purchechisa and without foreign matters Taste and flavor Dense, characteristic hazelnut flavor and aroma, without taste and odor Humidity no more than 6%.', '', '', '', 'view/708601771/Hazelnuts-in-Shell', 1085, 485, 5, 'no', 2, 0),
(772, 757, '040289383', '212.72.128.130', 1455711549, 0, 3, '', 'Roasted Hazelnuts Kernel', 'gprd561f66f757237332e70745ae3091a99.jpg', '1040', '', '113', '6305', 'N/A', 'Jute Bags, Big bags, Polypropylene Bags, Vacuum Bags', 'N/A', 'N/A', '', '', '', '', '', 'on', '', '', 'Taste and flavor Taste and aroma characteristic of roasted hazelnuts, without taste and odor Humidity no more than 2,5% Sheath core (by weight) of not more than 10% The presence of the shell and foreign bodies There are no The presence of live insects and worms There are no Calories / 100 gr. 655 proteins 14,1 fats 70-75% carbohydrates 6,0% The composition of the free acid (max) 1,0% Composition peroxide (not more than) 1,0% vitamins E, B1, B2, B6, C minerals Iron, calcium, zinc, potassium, sodium, magnesium, copper, manganese,', '', '', '', 'view/040289383/Roasted-Hazelnuts-Kernel', 1085, 486, 5, 'no', 2, 0),
(773, 758, '121191860', '212.72.128.130', 1455777331, 0, 3, '', 'Bay leaves', 'sorta9b6385a6681340942fb01b051d1733e8.jpg', '1112', '', '113', '6305', '2 Years', '1st grade carton box 10 kg, with delivery FCA', 'N/A', '5 Tons', '', '', '', '', '', 'on', '', '', 'Laurus nobilis is an aromatic evergreen tree or large shrub with green, glossy leaves, native to the Mediterranean region. It is one of the plants used for bay leaf seasoning in cooking. It is known as bay laurel, sweet bay, bay tree (esp. United Kingdom), true laurel, Grecian laurel,[1] laurel tree or simply laurel. Laurus nobilis figures prominently in classical Greek, Roman, and Biblical culture. Worldwide, many other kinds of plants in diverse families are also called "bay" or "laurel", generally due to similarity of foliage or aroma to Laurus nobilis, and the full name is used for the California bay laurel (Umbellularia), also in the family Lauraceae.', '', '', '', 'view/121191860/ax', 1089, 487, 5, 'no', 2, 0),
(774, 759, '879101709', '212.72.128.130', 1455777942, 0, 3, '', 'Bay leaves natural', 'sorta21a2720629b133959053f625250a93f7.jpg', '1112', '', '113', '6305', '2 Years', '1st grade carton box 10 kg, with delivery FCA', 'N/A', '5 Tons', '', '', '', '', '', 'on', '', '', 'An early Chinese etiological myth for the phases of the moon involved a great forest or tree which quickly grew and lost its leaves and flowers every month. After the Sui and Tang dynasties, this was sometimes connected to a woodsman named Wu Gang, sentenced to cut at a self-repairing tree as a punishment for varying offenses. The tree was originally identified as a 桂 (gu&igrave;) and described in the terms of the osmanthus (Osmanthus fragrans, now known in Chinese as the 桂花 or "gui flower"), whose blossoms are still used to flavor wine and confections for the Mid-Autumn Festival.', '', '', '', 'view/879101709/Bay-leaves-natural', 1089, 488, 5, 'no', 2, 0),
(775, 760, '637707554', '212.72.128.130', 1455778056, 0, 3, '', 'Geodaphna', 'sortab20904c6ac39ff852a5f1e4492b8eb92.jpg', '1112', '', '113', '6305', '2 Years', '1st grade Carton box 10 kg., with delivery FCA', 'N/A', '5 Tons', '', '', '', '', '', 'on', '', '', 'The laurel is dioecious (unisexual), with male and female flowers on separate plants.[2] Each flower is pale yellow-green, about 1 cm diameter, and they are borne in pairs beside a leaf. The leaves are 6-12 cm long and 2-4 cm broad, with an entire (untoothed) margin. On some leaves the margin undulates.[2] The fruit is a small, shiny black berry-like drupe about 1 cm long[2] that contains one seed.[3]', '', '', '', 'view/637707554/Geodaphna', 1089, 489, 5, 'no', 2, 0),
