(779, 764, '565457432', '212.72.128.130', 1455800316, 0, 3, '', 'Kolkhuri', 'firmcardue091bafa2e2b91be8d00a1546901b82fd.jpg', '6316', '', '124', '191', 'N/A', 'Ointment Kolkhuri', 'N/A', 'N/A', '', '', '', '', '', 'on', '', '', 'Kolkhuri ointment is the main Cardue product. It is a pleasant smelling petrolatum-based ointment enriched with natural plant extracts and essential oils. Due to its universal and versatile spectrum of effects, Eastern Europeans have been using this ointment for generations. Its timely usage significantly speeds up the healing process.', '', '', '', 'view/565457432/Kolkhuri', 1097, 492, 5, 'no', 2, 0),
