(790, 775, '799695050', '212.72.128.130', 1455887125, 0, 3, '', 'Akhasheni ', 'saamo8a42775ef33a58f20942278f99f33a46.jpg', '1419', '', '114', '152', '24 Months', 'Ceramics', 'N/A', '250000 Bottles', '', '', '', '', '', 'on', '', '', 'Naturally semi-sweet red wine made from the Saperavi grape variety grown in the vineyards of the Gurgjaani district in Kakheti. The wine of dark-pomegranate color has a harmonious velvety taste with chocolate flavor. It contains 10.5-12.0% alcohol, 3-5 % sugar and has 5-7 gr/l titrated acidity. The wine has been manufactured since 1958. At international exhibits it was awarded six gold and five silver medals.', '', '', '', 'view/799695050/Akhasheni-', 1117, 503, 5, 'no', 2, 0),
(791, 776, '134462948', '212.72.128.130', 1455887449, 0, 3, '', 'Kindzmarauli', 'saamobaa340adc1c48f3ef392ecd8844f191f.jpg', '1419', '', '114', '152', '24 Months', 'Ceramics', 'N/A', '100000 Bottles', '', '', '', '', '', 'on', '', '', 'KINDZMARAULI Naturally semi-sweet red wine, controlled by the appellation of origin. Made from Saperavi grape variety cultivated in Kindzmarauli micro-zone (Kakheti region, Eastern Georgia). Wine has rich garnet color, elegant bouquet with pleasant fruity freshness. The taste is harmonious, balanced, with aroma of blackberries and blackcurrant. Best match with: grilled meat, cheese, fruits, fruit salads, desserts and other sweets.', '', '', '', 'view/134462948/Kindzmarauli', 1117, 504, 5, 'no', 2, 0),
(792, 777, '072280851', '212.72.128.130', 1455888539, 0, 3, '', 'Sagarejo', 'saamo00b532ab54657b9ebc8dc2e280f7ca8d.jpg', '1419', '', '114', '152', '24 Months', 'Glass bottle', 'N/A', '200000 Bottles', '', '', '', '', '', 'on', '', '', 'SAAMO Company branded dry white vintage wine made from the Rkatsiteli grapes grown in Sagarejo district. It wine has a pleasing aroma and lightly aged taste. The wine contains 10.5-12.5% of alcohol. It takes the wine 1.5 year to mature in the SAAMO cellars.', '', '', '', 'view/072280851/Sagarejo', 1117, 505, 5, 'no', 2, 0),
(793, 778, '919381407', '212.72.128.130', 1455889775, 0, 3, '', 'Saamo white semi sweet', 'saamoce0574a3ad90fb2fa0435557fdfa15ed.jpg', '1419', '', '114', '152', '24 Months', 'Glass bottle', 'N/A', '200000 Bottles', '', '', '', '', '', 'on', '', '', 'SAAMO (white semi- sweet) Company branded vintage semi-sweet white wine, made from Rkatsiteli and Mtsvane grape varieties grown in Sagarejo sub region of Georgia. The wine is of straw color and has a harmonious taste and pleasant varietal aroma, contains 10.5-12.0% of alcohol at the titrated acidity of 5.5-7.0 gr/l. It takes 1.5 year to mature in the SAAMO cellars.', '', '', '', 'view/919381407/Saamo-white-semi-sweet', 1117, 506, 5, 'no', 2, 0),
(794, 779, '617158829', '212.72.128.130', 1456121379, 0, 3, '', 'Chestnut Honey 750 gr & 350 gr', 'machakhela67495b6217d459010de5dece31401307.jpg', '945', '', '113', '149', 'Unlimited', 'Plastic Containers, Cistern', 'N/A', 'N/A', '', '', '', '', '', 'on', '', '', 'Dark color with bitter and sweet taste and special chestnut flower smell. Chestnut honey taste and aroma varies due to location of extraction, weather, and chestnut tree species. The product is crystallized slowly.', '', '', '', 'view/617158829/Chestnut-Honey-750-gr--350-gr', 1109, 507, 5, 'no', 2, 0),
