(799, 784, '690535020', '212.72.128.130', 1456227559, 0, 3, '', 'Muffins', 'bakehousefb6949d3a8b0ffdf729d6473abe434ef.jpg', '1350', '', '113', '144', '3 Days', 'Polypropylene, Polypropylene with foil, carton box', 'N/A', 'N/A', '', '', '', '', '', 'on', '', '', 'Confectionery is related to the food items that are rich in sugar and often referred to as a confection. Confectionery refers to the art of creating sugar based dessert forms, or subtleties (subtlety or sotelty), often with pastillage. From the Old French confection, origin of Latin confectio(n-), from conficere, to "put together". The confectionery industry also includes specialized training schools and extensive historical records.Traditional confectionery goes back to ancient times, and continued to be eaten through the Middle Ages into the modern era. Confections include sweet foods, sweetmeats, digestive aids that are sweet, elaborate creations, and something amusing and frivolous.', '', '', '', 'view/690535020/Muffins', 1133, 512, 5, 'no', 2, 0),
