(951, 936, '588284523', '212.72.128.130', 1460976815, 0, 4, '', ' Air ticket booking, hotels and accommodation booking, train and ship tickets, insurance, transfer.', '', '', '', '460', '473', '', '', '', '', '', '', '', '', '', 'on', '', '', 'Inex Travel offers tours not only in Georgia, but in Armenia, in Azerbaijan and in East Turkey as well. Company\'s management has at least 20 years experience in the field of tourism. The Company has a sub-agency network on the entire territory of Georgia. 7 offices of Inex Travel are located in Tbilisi, Batumi, Rustavi, Tbilisi International Airport and Athens.', '', '', '', 'view/588284523/473', 1198, 1, 5, 'no', 2, 0),
