(10, 10, 3, 3, 1436046360, 1436046360, 'sub', 'textpage', 'Doing bussiness in Georgia', 'Doing bussiness in Georgia', '<p>Doing bussiness in Georgia</p>', '<p style="text-align: justify;"><strong>T</strong><strong>O</strong><strong>P REASONS TO DO BUSINESS IN GEORGIA</strong></p>\r\n<p style="text-align: justify;">GEORGIA is consistently ranked as the TOP performer in country policy and institutional assessments (CPIA) complied by international financial institutions (WB, ADB, ETC.)</p>\r\n<p style="text-align: justify;">Standard &amp; Poor&rsquo;s: BB- Stable (Affirmed in May 2014)</p>\r\n<p style="text-align: justify;">Moody&rsquo;s: Ba3 Positive (Affirmed in August 2014)</p>\r\n<p style="text-align: justify;">Fitch Rating: BB- Positive (Affirmed in October 2014)</p>\r\n<p style="text-align: justify;">The Heritage Foundation ranked Georgia the 22nd among 178 countries Economic Freedom Ranking.</p>\r\n<p><strong>Corruption Free</strong> - According to the Transparency International Glob- al Corruption Barometer Georgia is perceived as a corruption free destination.</p>\r\n<p style="text-align: justify;"><strong>Best Place to Start a Business -</strong> Georgia is in top 15 best Doing Business Destinations in according to World Bank</p>\r\n<p style="text-align: justify;"><strong>Reasonable Tax Policy</strong> - According to 2009 Tax Misery &amp; Reform Index, released by Forbes Business &amp; Financial News, Georgia is the fourth least tax burden country after Qatar, UAE and Hong Kong.</p>\r\n<p style="text-align: justify;"><strong>Strategic location</strong> - Located at the crossroads of Europe, Central Asia, Middle East and Africa Georgia is a key link in the shortest transit route between Western Europe and Central Asia for transportation of oil and gas as well as dry cargo.</p>\r\n<p style="text-align: justify;"><strong>Stable macroeconomic environment -</strong> In recent years, Georgian GDP has growth tendency.</p>\r\n<p style="text-align: justify;"><strong>Liberal and free market oriented economic policy -</strong> The Government of Georgia implemented reforms in tariff policy as well as in technical regulations sphere. As a result, nowadays Georgia has one of the most liberal foreign trade policies in the world, which implies the facilitated foreign trade regimes and customs procedures, low import tariffs and minimal non-tariff regulations.</p>\r\n<p style="text-align: justify;"><strong>Developed infrastructure -</strong> One of the top priorities for the Government of Georgia is coordinated functioning of transport fields, modernization-construction of transport infrastructure in accordance with international standards. The Government of Georgia is being implementing important infrastructure projects, which shall facilitate new cargo volumes through Georgia and increase effectiveness of functioning of transport systems.</p>\r\n<p style="text-align: justify;">Enhanced Economic Prospects following signing of the AA with European Union. Agreement incorporates elements which will encourage improvements in the rule of law and in effective governance, as well as further moves towards a well-functioning market economy through the removal of tariff and non-tariff barriers.</p>\r\n<p style="text-align: justify;">&nbsp;</p>', 'false', '', '', '', 'country-profile/doing-bussiness-in-Georgia', 1, 5, 0, 2, 1, 1),
