(13, 13, 6, 6, 1436052840, 1436052840, 'sub', 'textpage', 'How to Export From Georgia ', 'How to Export From Georgia', '<p>How to export from Georgia</p>', '<p style="text-align: justify;">Georgia has dramatically simplified&nbsp;licensing and permitting requirements to ease constraints on business. The &nbsp;total number &nbsp;of &nbsp;licenses &nbsp;and &nbsp;permits was reduced&nbsp;by 84% in reforms that eliminated 756 licenses and permits and streamlined procedures. Currently, licenses and permits are only used for the&nbsp;production of highly risky goods and services, along with&nbsp;usage of natural resources and specific activities. The procedures of issuing licenses and permits were significantly simplified to the &ldquo;one-stop shop&rdquo; and &ldquo;silence is consent&rdquo; principles.</p>\r\n<p style="text-align: justify;">Georgian legislation concerning export tariffs states that export or re-export of goods from Georgia is duty-free. Moreover, from 1 September 1997, Georgia applied the country of destination principle in VAT taxation and therefore, exports from Georgia are VAT-exempt.</p>\r\n<p style="text-align: justify;">From January 1, 2011 the new Tax Code of Georgia took effect which also includes the provisions regulating customs. Tax Code established business friendly customs procedures. Customs Tariffs Reform significantly eased and sharply reduced the costs connected to the foreign trade.</p>\r\n<p><span style="text-decoration: underline; color: #0278c1;"><strong>Customs Clearance</strong></span></p>\r\n<p style="text-align: justify;">Certificate of origin of a product is required to export goods. Certificate of origin allows exporter to enjoy relevant benefits in a recipient country.</p>\r\n<p style="text-align: justify;">When removing goods from customs territory of Georgia, a certificate of origin shall be issued by an authorized body of the Ministry of Economy and Sustainable Development of Georgia or the legal entity of public law of the Ministry of Finance of Georgia, Revenue Service, or Chamber of Commerce and Industry of Georgia or authorized bodies in the autonomous republics of Georgia, identified by Ministry of Economy and Sustainable Development of Georgia and Ministry of Finance of Georgia. Certificate of origin for products made of grapes is issued by National Wine Agency, a legal entity of public law of the Ministry of Agriculture of Georgia, in accordance with the rule defined by the Ministry of Agriculture.</p>\r\n<p><span style="color: #0278c1;"><span style="text-decoration: underline;"><strong>Certificates of Origin</strong></span>&nbsp;</span></p>\r\n<p><span style="color: #fea100;"><span style="color: #0278c1;"><strong>The Certificates of Origin</strong></span>&nbsp;</span>is issued by two&nbsp;different entities in Georgia:&nbsp;</p>\r\n<ul>\r\n<li style="text-align: justify;">Revenue Service of Georgia:&nbsp;<a href="http://rs.ge/default.aspx?sec_id=4846&amp;lang=2&amp;newsid=3104" target="_blank">http://rs.ge/certificate of origin</a>&nbsp; &nbsp; &nbsp;</li>\r\n<li style="text-align: justify;">Georgian&nbsp;Chamber of Commerce and Industry:&nbsp;<a title="http://www.gcci.ge/" href="http://www.gcci.ge/" target="_blank">http://www.gcci.ge/</a></li>\r\n</ul>\r\n<p><span style="color: #0278c1;"><strong>&nbsp;</strong></span><span style="color: #0278c1;"><strong>Types of Certificates of Origin:</strong></span></p>\r\n<ul>\r\n<li style="text-align: justify;">Certificate Form A<strong>&nbsp;</strong>is issued on specific goods originating in Georgia exported to the countries (USA, Canada, Japan, Switzerland, and Norway), from which Generalized System of Preferences (GSP) is granted.</li>\r\n<li style="text-align: justify;">Certificate CT-1<strong>&nbsp;</strong>is issued on goods originating in Georgia exported to the CIS countries</li>\r\n<li style="text-align: justify;">Certificate EUR1 is issued on goods originating in Georgia exported to Turkey and the European Union. Rules of Origin:&nbsp;European Union,&nbsp;Turkey (issued by Revenue Service of Georgia)</li>\r\n<li style="text-align: justify;">Non-Preferential Certificate of Origin (Certificate of Origin)<strong>&nbsp;</strong>is issued on goods exported to all other countries as well as to the above mentioned countries, while products do not meet&nbsp;the criteria of preferential rules of origin. Besides, this Certificate is also granted to goods produced in another country and exported from Georgia.</li>\r\n</ul>\r\n<p>&nbsp;<span style="text-decoration: underline; color: #0278c1;"><strong>Necessary documents for obtaining certificate of origin of the product:</strong></span></p>\r\n<ul>\r\n<li><span style="color: #000000;">Application of an exporter</span></li>\r\n<li style="text-align: justify;">Declaration of Origin of Goods and its Possession</li>\r\n<li style="text-align: justify;">Contract (Agreement)</li>\r\n<li style="text-align: justify;">Invoice</li>\r\n</ul>\r\n<p><strong><span style="color: #0278c1;">More info:</span></strong> <a href="http://www.economy.ge/en/our-services/trade" target="_blank">http://www.economy.ge/en/our-services/trade</a></p>\r\n<p><span style="text-decoration: underline; color: #0278c1;"><strong>Customs Regime for Export</strong></span></p>\r\n<p><strong><span style="color: #0278c1;">Georgian exports are exempt from customs duties:</span></strong></p>\r\n<ul>\r\n<li style="text-align: justify;">Export duties mean: customs fee or/and duty payable for the removal of goods from the customs territory of Georgia.</li>\r\n<li style="text-align: justify;">Export operations are VAT-exempt</li>\r\n<li style="text-align: justify;">Export or re-export of goods from Georgia is duty-free</li>\r\n<li style="text-align: justify;">Exports from Georgia are VAT-exempt</li>\r\n</ul>\r\n<p><strong><span style="color: #0278c1;">More info:</span></strong> <a href="http://www.rs.ge/en/5267" target="_blank">http://www.rs.ge/en/5267</a><br /> <br /> <span style="text-decoration: underline; color: #0278c1;"><strong>Preferential Trade Regimes</strong></span></p>\r\n<ul>\r\n<li style="text-align: justify;">Most Favored Nation</li>\r\n</ul>\r\n<p style="text-align: justify;">Most Favored Nation (MFN) regime is one of the fundamental principles of the World Trade Organization (WTO) and an important element of non-discriminative treatment in trade. It means that countries eligible for this regime must receive equal trade advantages when entering the market and may not be treated less advantageously than any other country with MFN status (with certain exceptions).</p>\r\n<p><strong><span style="color: #0278c1;">More info:</span></strong> <a title="https://www.wto.org/english/thewto_e/whatis_e/tif_e/fact2_e.htm" href="https://www.wto.org/english/thewto_e/whatis_e/tif_e/fact2_e.htm" target="_blank">https://www.wto.org/english/thewto_e/whatis_e/tif_e/fact2_e.htm</a></p>\r\n<ul>\r\n<li style="text-align: justify;">Free Trade Agreement</li>\r\n</ul>\r\n<p style="text-align: justify;">Free Trade Agreement (FTA) is an agreement where two countries do not use customs duties in bilateral trade. Georgia has FTAs&nbsp;with European Union, CIS countries (Azerbaijan, Moldova, Ukraine, Uzbekistan, Kazakhstan, Turkmenistan, Russia, Armenia) and Turkey.</p>\r\n<p style="text-align: justify;"><span style="color: #0278c1;"><strong>More info:</strong></span> <a href="http://www.investingeorgia.org/en/georgia/free-trade-regimes" target="_blank">http://www.investingeorgia.org/en/georgia/free-trade-regimes</a></p>\r\n<p style="text-align: justify;">Note: Currently Georgia has an ongoing negotiations on Free Trade Agreement with European Free Trade Association (Republic of Iceland; Principality of Lichtenstein; Kingdom of Norway; Swiss Confederation)</p>\r\n<ul style="text-align: justify;">\r\n<li style="text-align: justify;">Generalized System of Preferences</li>\r\n</ul>\r\n<p style="text-align: justify;">The idea behind the&nbsp;Generalized System of Preferences (GSP) is that developed countries assist less developed countries in promoting their exports. To this end, developed countries unilaterally grant (without demanding reciprocal concessions) certain preferences in foreign trade to GSP beneficiaries. In particular, they set lower (or zero-rated) tariffs for imports from GSP recipient countries in order to facilitate the access of products from developing countries to developed markets.</p>\r\n<p style="text-align: justify;">Georgia has been granted the GSP treatment by the following countries: the USA, Japan, Canada, Switzerland and Norway.</p>\r\n<p style="text-align: justify;"><strong><span style="color: #0278c1;">More info:</span></strong> <a href="http://www.investingeorgia.org/en/georgia/free-trade-regimes" target="_blank">http://www.investingeorgia.org/en/georgia/free-trade-regimes</a></p>\r\n<p style="text-align: justify;"><span style="text-decoration: underline;"><strong><span style="color: #0278c1; text-decoration: underline;">Certificates and Licenses</span></strong></span></p>\r\n<ul>\r\n<li style="text-align: justify;">Phitosanitary Certificate-The phytosanitary certificate is an official declaration stating that plants and plant material exporting are free from pests and diseases, so as to prevent introduction and spread of any pests in the importing countries</li>\r\n</ul>\r\n<ul>\r\n<li style="text-align: justify;">Veterinary Certificate-The Veterinary Certificate is required by importing country when live Animals or products of animal origin are imported in the country. Veterinary Certificate is issued by&nbsp;Legal Entity of Public Law &ndash; National Food Agency or in&nbsp;&nbsp;the control zones defined&nbsp;&nbsp; by the&nbsp; Tax Code of Georgia&nbsp; Legal Entity of Public Law &ndash; Georgia&nbsp; Revenue Service, except for the &nbsp;cases when&nbsp;&nbsp; for &nbsp;issuance of the certificate It is necessary to :&nbsp;Place animals in the quarantine or/and&nbsp;Take samples for analyses&nbsp;</li>\r\n</ul>\r\n<ul>\r\n<li style="text-align: justify;">Higienic Certificate-Hygiene certificate Is the document which certifies that food&ndash;stuff/tare is in accordance with the hygiene safety requirements. The Higienic Certificate is by &nbsp;the control zones defined&nbsp;&nbsp; by the&nbsp; Tax Code of Georgia&nbsp; Legal Entity of Public Law &ndash; Georgia&nbsp; Revenue Service,Legal Entity of Public Law &ndash; National Food Agency</li>\r\n</ul>\r\n<p><strong><span style="color: #0278c1;">More info:&nbsp;</span></strong><span style="color: #0278c1;"><a title="http://nfa.gov.ge/ge/mcenareta-dacva-42" href="http://nfa.gov.ge/ge/mcenareta-dacva-42" target="_blank">http://nfa.gov.ge/ge/mcenareta-dacva-42&nbsp;</a></span></p>\r\n<p><strong><span style="color: #0278c1;">More info:&nbsp;</span></strong><span style="color: #0278c1;"><a title="http://www.rs.ge/Default.aspx?sec_id=5267&amp;lang=2" href="http://www.rs.ge/Default.aspx?sec_id=5267&amp;lang=2" target="_blank">http://www.rs.ge/Default.aspx?sec_id=5267&amp;lang=2</a></span></p>\r\n<p>Information on the quality of product is necessary when exporting goods from Georgia, as well as the information on entities that can provide quality certification service in the country.&nbsp;Most countries apply the WTO Agreement on Sanitary and Phytosanitary Measures (SPS Agreement) to regulate requirements for food products and animal fodder. Therefore it is recommended to learn more information about these measures from the following WTO webpage: <a href="http://www.wto.org/english/tratop_e/sps_e/sps_e.htm" target="_blank">http://www.wto.org/english/tratop_e/sps_e/sps_e.htm</a></p>\r\n<p style="text-align: justify;"><span style="text-decoration: underline;"><span style="color: #0278c1;"><strong>Quality certification systems such as ISO; OHSAS; HACCP are widely applied in International Trade.</strong></span></span></p>\r\n<ul style="text-align: justify;">\r\n<li style="text-align: justify;">ISO catalogue includes 18000 standards that are classified in accordance with International Classification for Standards. These standards enable producers, sellers and consumers to set uniform requirements for the product. When a product is certified under this system, a country of its origin does not matter. Uniform international standards facilitate and simplify trade as sellers and buyers use a common international language in quality-related issues. ISO involves various series: 9000; 14000; 22000; 25000.</li>\r\n</ul>\r\n<ul style="text-align: justify;">\r\n<li style="text-align: justify;">OHSAS 18000 is an occupational health and safety management system. It consists of two series: 18001 and 18002.</li>\r\n</ul>\r\n<p style="text-align: justify;"><strong><span style="color: #0278c1;">More info:</span></strong> <a href="http://www.ohsas-18001-occupational-health-and-safety.com/what.htm" target="_blank">http://www.ohsas-18001-occupational-health-and-safety.com/what.htm</a></p>\r\n<p style="text-align: justify;">HACCP is a management system in which food safety is addressed through the analysis and control of biological, chemical, and physical hazards at any stage of production from raw Material procurement to manufacturing, distribution and consumption of the finished product.</p>\r\n<ul style="text-align: justify;">\r\n<li style="text-align: justify;">Quality Certificate</li>\r\n</ul>\r\n<p style="text-align: justify;">Quality certificates can be obtained from laboratories that operate in Georgia and are registered in the National Accreditation Body &ndash; Accreditation Center (GAC)</p>\r\n<p style="text-align: justify;">Quality testing and calibration/verification laboratories, certification bodies in Georgia:</p>\r\n<p style="text-align: justify;"><a href="http://gac.gov.ge/index.php?lang_id=ENG&amp;sec_id=16" target="_blank">http://gac.gov.ge/index.php?lang_id=ENG&amp;sec_id=16</a></p>\r\n<p style="text-align: justify;">Seekers of ISO; OHSAS; HACCP certificates should approach the following organizations: Georgian Quality Foundation, Georgian Employers Association and GDCI Management Systems.</p>\r\n<p style="text-align: justify;"><a href="http://employer.ge/Default.aspx?lang=en" target="_blank">http://employer.ge/Default.aspx?lang=en</a></p>\r\n<p style="text-align: justify;"><a href="http://www.tuv-georgia.ge/Default.aspx?lang=en" target="_blank">http://www.tuv-georgia.ge/Default.aspx?lang=en</a></p>\r\n<p style="text-align: justify;"><a href="http://www.gdci.ge/?lang=eng" target="_blank">http://www.gdci.ge/?lang=eng</a></p>\r\n<p style="text-align: justify;"><br /><strong> <span style="text-decoration: underline; color: #0278c1;">When is export license required?&nbsp;</span></strong></p>\r\n<p style="text-align: justify;">Georgia has one of the most liberal export regimes, however, some regulations apply to the following exports.</p>\r\n<ul style="text-align: justify;">\r\n<li>Objects of national heritage (cultural valuables) of Georgia (Ministry of Culture and Monument Protection of Georgia)Electronic surveillance facilities (Ministry of Internal Affairs of Georgia)</li>\r\n<li style="text-align: justify;">Products with limited turnover (Ministry of Environment Protection and Natural Resources of Georgia) (suspended until1July2011);</li>\r\n<li style="text-align: justify;">Weapons and ammunitions (Ministry of Defense of Georgia)</li>\r\n<li style="text-align: justify;">Products of dual use (Ministry of Economy and Sustainable Development of Georgia</li>\r\n<li style="text-align: justify;">Medicines that are subject to special control (Regulatory Agency of Medical Activity of Ministry of Labor, Health and Social Affairs of Georgia)</li>\r\n<li style="text-align: justify;">Flora and fauna on the verge of extinction (Ministry of Environment Protection and Natural Resources)</li>\r\n</ul>\r\n<p style="text-align: justify;">&nbsp;</p>', 'false', '', '', '', 'trade-map/how-to-export-from-Georgia', 1, 5, 0, 2, 1, 0),
