(15, 15, 7, 7, 1436053800, 1436053800, 'sub', 'textpage', 'Our Services', 'Our Services', '<p><span style="color: #000000;">Our services</span></p>', '<p style="text-align: justify;"><span style="color: #0278c1;"><strong>A wide range of Georgian company products &amp; services:</strong></span></p>\r\n<p style="text-align: justify;">Tradewithgeorgia makes quick and easy access to information about Georgian export oriented companies operating in different industries. Through the page you can contact directly either Georgian companies or our export consultant to get specific information about Georgian products and services.</p>\r\n<p style="text-align: justify;"><span style="color: #0278c1;"><strong>The calendar of trade missions &amp; international trade fairs:</strong></span></p>\r\n<p style="text-align: justify;">Enterprise Georgia provides opportunity to Georgian companies to travel overseas and participate to trade shows and exhibitions and meet with perspective international business partners enhancing potential for business success. Through our website you can easily find upcoming and previously held trade fairs and trade events.</p>\r\n<p style="text-align: justify;"><span style="color: #0278c1;"><strong>Trade statistics &amp; analysis:</strong></span></p>\r\n<p style="text-align: justify;">Tradewithgeorgia makes quick and easy access to different market reports, trade maps and trade statistics. You always can contact our export consultant for more detailed information.</p>\r\n<p style="text-align: justify;"><span style="color: #0278c1;"><strong>Trade consulting:</strong></span></p>\r\n<p style="text-align: justify;">Enterprise Georgia provides trade consulting service through its service center and export consultants. Professional and competent staff will provide all necessary information based on reliable sources.&nbsp;</p>\r\n<p style="text-align: justify;"><span style="color: #0278c1;"><strong>Services:</strong></span></p>\r\n<ul>\r\n<li style="text-align: justify;"><span style="color: #0278c1;"><span style="color: #000000;">Identifying HS codes for specific products&nbsp;</span><strong><br /></strong></span></li>\r\n<li style="text-align: justify;"><span style="color: #0278c1;"><span style="color: #000000;">Registration on export and business portals</span></span></li>\r\n<li style="text-align: justify;"><span style="color: #0278c1;"><span style="color: #000000;">Information on export procedures, tariffs and certificates</span></span></li>\r\n<li style="text-align: justify;"><span style="color: #0278c1;"><span style="color: #000000;">Information on import Regulations on targeted markets</span></span></li>\r\n<li style="text-align: justify;"><span style="color: #0278c1;"><span style="color: #000000;">Information on education programs organized by Enterprise Georgia&nbsp;</span></span></li>\r\n</ul>\r\n<p style="text-align: justify;">&nbsp;</p>', 'false', '', '', '', 'about-us/our-services', 1, 5, 0, 2, 2, 0),
