(26, 26, 4, 4, 1436101620, 1436101620, 'sub', 'custompage', 'Service', 'Service', '', '<p><strong>A wide range of Georgia COMPANIES PRODUCTS &amp; SERVICES:</strong></p>\r\n<p>TRADEWITHGEORGIA makes quick and easy access to information about Georgian export oriented Companies operating in different industries. Through the page you can contact directly either Georgian companies or our export consultant to get specific information about Georgian products and services.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>The CALENDAR of trade missions &amp; international trade fairs:</strong></p>\r\n<p>Enterprise Georgia provides opportunity to Georgian Companies to travel overseas and participate to trade shows and exhibitions and meet with perspective international business partners enhancing potential for business success. Through our website you can easily find upcoming and previously held trade fairs and trade events.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Business Portal:</strong></p>\r\n<p>Establish new business contacts in our community. As a registered member, you can conduct comprehensive searches across the entire community, find potential business partners, and post your business inquiries. (amis rephrase mchirdeba)</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Trade STATISTICS &amp; ANALYSIS:</strong></p>\r\n<p>TRADEWITHGEORGIA makes quick and easy access to different market reports, trade maps and trade statistics. You always can contact our export consultant for more detailed information.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Trade Consulting:</strong></p>\r\n<p>Enterprise Georgia provides trade consulting service through its service center and export consultants. Professional and competent staff will provide all necessary information based on reliable sources.&nbsp;</p>\r\n<p>Services:</p>\r\n<ul>\r\n<li>Identifying HS Codes for specific products</li>\r\n<li>Registration on Export and Business Portals</li>\r\n<li>Information on Export Procedures, Tariffs and Certificates</li>\r\n<li>Information on import regulations on targeted markets</li>\r\n<li>Information on Education programs organized by Enterprise Georgia</li>\r\n<li>Information on Export Finance schemes supported by government of Georgia (Export Credit Agency)</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'false', '', '', '', 'export-catalog/service', 1, 5, 0, 1, 4, 1),
