(5403, 5206, 3, 3, 1446552300, 1446552300, 'sub', 'textpage', 'Country Profile', 'Country Profile', '', '<p style="text-align: justify;">Since regaining its independence in the early 1990s, Georgia has become the regional champion in terms of reform, economic development and progress regarding democratic institutions. Striving to succeed on its path of Euro-Atlantic integration, Georgia is positioning itself as a hub for doing business in the region and is developing an advanced international business environment and relations.</p>\r\n<p style="text-align: justify;">Located at the crossroads of Europe and Asia, and being the shortest transportation route between the two regions, Georgia is uniquely positioned to capitalize on increasing trade flows between Europe, the Caspian region, Central Asia and East Asia. It has one of the lowest and most manageable tax regimes in the world, an improving and more stable political and business climate, relatively low operating costs and an increasingly supportive government. These factors have made Georgia an attractive investment destination.</p>\r\n<p style="text-align: justify;">After signing the deep and comprehensive fee trade agreement with the EU (enacted on September 1, 2014), Georgia embarked on its journey towards European integration. &nbsp;</p>\r\n<h4 style="text-align: justify;"><span style="color: #fea100;"><strong>Key Economic Sectorial Overview</strong></span></h4>\r\n<p style="text-align: justify;"><span style="text-decoration: underline;"><span style="color: #0278c1;"><strong>Industrial manufacturing and processing</strong></span></span></p>\r\n<p style="text-align: justify;">Georgia provides significant investment opportunities in the manufacturing sector, which attracted more than USD 0.5 billion of foreign direct investment between 2010 and 2014. &nbsp;New opportunities are expected to be taken by greenfield investments in export-oriented manufacturing sectors, for which access to the European market would be attractive. The share of the industrial sector in Georgia&rsquo;s GDP was 17.1% in 2014.</p>\r\n<p style="text-align: justify;">There are significant business opportunities processing primary agricultural goods into higher value-added product and supplying equipment and services (greenhouses, storage, deep-freeze facilities, packaging, etc.). Georgian agriculture offers foreign businesses the opportunity to invest in areas with unmet market demand, significant cost efficiencies and strong profit potential.</p>\r\n<p style="text-align: justify;"><span style="text-decoration: underline;"><span style="color: #0278c1;"><strong>Tourism and retail sector</strong></span></span></p>\r\n<p style="text-align: justify;">Tourism is another field that has witnessed significant growth in recent years and is considered to be an important driver of economic development and job creation, as well as a revenue generator. The industry offers wide diversification in terms of its sub-industries: summer sea resorts, year-round mountain resorts (including skiing), spa-wellness, gaming and more. In fact, from 2003 to 2014, the number of international visitors to Georgia has increased from 300,000 to 5.5 million.</p>\r\n<p style="text-align: justify;">According to a hotel market report prepared by Colliers International, the highest average occupancy rates in Tbilisi are in international midrange brand hotels (75%) and in international upscale brand hotels (74%). In addition, the ADR (average daily rate) for international upscale hotels is 203 USD.</p>\r\n<p style="text-align: justify;">At 17.4% of national GDP in 2014, retail is one of the largest economic sectors in Georgia. Annual per capita retail expenditure has doubled over the past decade. More than 9% of the country&rsquo;s international visitors in 2013 stated that they were there for shopping purposes.&nbsp;</p>\r\n<p style="text-align: justify;"><span style="text-decoration: underline;"><span style="color: #0278c1;"><strong>Energy sector</strong></span></span></p>\r\n<p style="text-align: justify;">The energy sector is attractive from the perspective of both existing natural resources and developing infrastructure, as the country possesses huge hydro resources and offers untapped investment potential. In recent years, Georgia has become a net exporter of electricity and currently utilizes only 18% of its vast hydro resources. The Georgian power grid is connected to the grids of all of its neighboring countries, which are faced with either a structural power deficit or expensive power generation. From 2010 to 2014, the Georgian energy sector attracted almost USD 750 million.&nbsp;</p>\r\n<p style="text-align: justify;"><span style="text-decoration: underline;"><span style="color: #0278c1;"><strong>Transport and logistics</strong></span></span></p>\r\n<p style="text-align: justify;">Georgia is in a highly strategic location: It serves as a gateway to the Caucasus and Central Asia. Going through the country is the shortest route between the Black Sea and the Caspian Sea region. Construction of the new Baku-Tbilisi-Kars railway line is in the final stages and will further advance trading in the whole region. The government is investing heavily in the development of road infrastructure, mainly highways, as well as local roads. It is also currently negotiating with potential investors to build a new deep sea port in Anaklia on the Black Sea, with the ability to receive vessels with a capacity of at least 6,500 TEU. The new port will bring Georgia&rsquo;s logistical capabilities to a new level. Therefore, Georgia strives and has the potential to be the best place for regional offices , and to become part of various value chains.</p>\r\n<table style="width: 100%;">\r\n<tbody>\r\n<tr>\r\n<td width="319">\r\n<p><strong>Area:</strong></p>\r\n</td>\r\n<td width="319">\r\n<p>69,700 sq. km</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="319">\r\n<p><strong>Population(2015)</strong></p>\r\n</td>\r\n<td width="319">\r\n<p>4.5mln</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="319">\r\n<p>Life expectancy:</p>\r\n</td>\r\n<td width="319">\r\n<p>76 years</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="319">\r\n<p>Official language:</p>\r\n</td>\r\n<td width="319">\r\n<p>Georgian</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="319">\r\n<p>Literacy:&nbsp;</p>\r\n</td>\r\n<td width="319">\r\n<p>99.7%</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="319">\r\n<p>Capital:</p>\r\n</td>\r\n<td width="319">\r\n<p>Tbilisi</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="319">\r\n<p>Currency (code)</p>\r\n</td>\r\n<td width="319">\r\n<p>Lari (GEL)</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="319">\r\n<p>GDP (2014*)&nbsp;</p>\r\n</td>\r\n<td width="319">\r\n<p>US $ 16.5 b.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="319">\r\n<p>GDP real growth rate (2014*)</p>\r\n</td>\r\n<td width="319">\r\n<p>4.7%&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="319">\r\n<p>GDP per capita (2014*)</p>\r\n</td>\r\n<td width="319">\r\n<p>USD 3 680.8</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="319">\r\n<p>FDI Inflows (2014*)&nbsp;&nbsp;</p>\r\n</td>\r\n<td width="319">\r\n<p>USD&nbsp; $1 272.5 mln</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="319">\r\n<p>Unemployment Rate 2013</p>\r\n</td>\r\n<td width="319">\r\n<p>14.6%</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="319">\r\n<p>External Trade Turnover Growth in 2014</p>\r\n</td>\r\n<td width="319">\r\n<p>5 %</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'false', '', '', '', 'About-georgia/Country-profile', 1, 5, 0, 2, 1, 0),
(5402, 5205, 6, 6, 1442742360, 1442742360, 'sub', 'custompage', 'Trade Map', 'Trade Map', '', '', 'false', '', '', '', 'trade-map/loadmap', 1, 5, 0, 2, 3, 0),
(5404, 5207, 3, 3, 1446552840, 1446552840, 'sub', 'textpage', 'Doing Business in Georgia', 'Doing Business in Georgia', '', '<p style="text-align: justify;">Georgia is consistently ranked as the top performer in country policy and institutional assessments (CPIA) complied by international financial institutions (WB, ADB, ETC.)</p>\r\n<ul>\r\n<li><span style="color: #000000;">Standard &amp; Poor&rsquo;s: BB- Stable (Affirmed in May 2014)</span></li>\r\n<li><span style="color: #000000;">Moody&rsquo;s: Ba3 Positive (Affirmed in August 2014)</span></li>\r\n<li><span style="color: #000000;">Fitch Rating: BB- Positive (Affirmed in October 2014)</span></li>\r\n<li><span style="color: #000000;">The Heritage Foundation ranked Georgia the 22nd among 178 countries Economic Freedom Ranking</span></li>\r\n</ul>\r\n<p style="text-align: justify;"><span style="text-decoration: underline; color: #0278c1;"><strong>Corruption free</strong></span></p>\r\n<p style="text-align: justify;">According to the transparency international global corruption barometer Georgia is perceived as a corruption free destination.</p>\r\n<p><span style="text-decoration: underline;"><span style="color: #0278c1; text-decoration: underline;"><strong>Best place to start a business</strong></span></span></p>\r\n<p style="text-align: justify;">Georgia is in top 15 best doing business destinations according to world bank.</p>\r\n<p style="text-align: justify;"><span style="text-decoration: underline;"><span style="color: #0278c1; text-decoration: underline;"><strong>Reasonable tax policy&nbsp;</strong></span></span></p>\r\n<p style="text-align: justify;">&nbsp;According to 2009 Tax Misery &amp; Reform Index, released by Forbes Business &amp; Financial News, Georgia is the fourth least tax burden country after Qatar, UAE and Hong Kong.</p>\r\n<p style="text-align: justify;"><span style="text-decoration: underline;"><span style="color: #0278c1; text-decoration: underline;"><strong>Strategic location</strong></span></span></p>\r\n<p style="text-align: justify;">Located at the crossroads of Europe, Central Asia, Middle East and Africa Georgia is a key link in the shortest transit route between Western Europe and Central Asia for transportation of oil and gas as well as dry cargo.</p>\r\n<p style="text-align: justify;"><span style="text-decoration: underline;"><span style="color: #0278c1; text-decoration: underline;"><strong>Stable macroeconomic environment</strong></span></span></p>\r\n<p style="text-align: justify;">In recent years, Georgian GDP has growth tendency.</p>\r\n<p style="text-align: justify;"><span style="text-decoration: underline;"><span style="color: #0278c1; text-decoration: underline;"><strong>Liberal and free market oriented economic policy</strong></span></span></p>\r\n<p style="text-align: justify;">The Government of Georgia implemented reforms in tariff policy as well as in technical regulations sphere. As a result, Georgia has one of the most liberal foreign trade policies in the world, which implies the facilitated foreign trade regimes and customs procedures, low import tariffs and minimal non-tariff regulations.</p>\r\n<p style="text-align: justify;"><span style="text-decoration: underline;"><span style="color: #0278c1; text-decoration: underline;"><strong>Developed infrastructure</strong></span></span></p>\r\n<p style="text-align: justify;">One of the top priorities for the Government of Georgia is coordinated functioning of transport fields, modernization-construction of transport infrastructure in accordance with international standards. The Government of Georgia is being implementing important infrastructure projects, which shall facilitate new cargo volumes through Georgia and increase effectiveness of functioning of transport systems.</p>\r\n<p style="text-align: justify;"><span style="text-decoration: underline;"><span style="color: #0278c1; text-decoration: underline;"><strong>Enhanced economic prospects</strong></span></span></p>\r\n<p style="text-align: justify;">Signing of the association agreement with European Union will encourage improvements in the rule of law and in effective governance, as well as further moves towards a well-functioning market economy through the removal of tariff and non-tariff barriers.</p>', 'false', '', '', '', 'About-georgia/Doing-Business-in-Georgia', 1, 5, 0, 2, 2, 0),
(5405, 5208, 3, 3, 1446553140, 1446553140, 'sub', 'textpage', 'Facts & Figures', 'Facts & Figures', '', '<p><u>Key Economic Sectorial Overview</u></p>\r\n<ul>\r\n<li>&nbsp;<strong>Industrial Manufacturing and Processing</strong></li>\r\n</ul>\r\n<p style="text-align: justify;">Georgia provides significant investment opportunities in manufacturing sector, which has attracted more than USD 0.5 billion foreign direct investments since 2010 &ndash; 2014*.&nbsp; New opportunities are expected to be grasped by Greenfield investments in export oriented manufacturing sectors, for which access to the European market would be attractive. The share of industry sector in Georgia&rsquo;s GDP is 17.1% in 2014*.</p>\r\n<p style="text-align: justify;">There are significant business opportunities in processing of the primary agricultural goods into a higher value added products and supplying equipment and services (greenhouses, storage, deep-freeze facilities, packaging, etc.). Georgian agriculture offers foreign businesses the opportunity to invest in areas of unmet market demand, significant cost efficiencies and strong profit potential.</p>\r\n<ul>\r\n<li><strong>Tourism and Retail Sector</strong></li>\r\n</ul>\r\n<p style="text-align: justify;">Tourism is another field, which witnessed significant growth in recent years and is considered to be an important driver of economic development and the creator of jobs as well as generator of revenues. The industry offers a wide diversification in terms of its sub-industries: summer sea resorts, four season mountain resorts (including skiing), spa-wellness, gaming and more. In fact From 2003 year to 2014 the number of international visitors to Georgia has increased from 300 thousand to 5,5 million.</p>\r\n<p style="text-align: justify;">According to Hotel Market Report, prepared by Colliers International, the highest average occupancy rates in Tbilisi are in international midscale brand hotels 75% and in international upscale brand hotels 74%. In addition, the ADR (Average Daily Rate) for International upscale hotels is - 203 USD.</p>\r\n<p style="text-align: justify;">With 17.4% of National GDP in 2014, trade is one of the largest economic sectors in Georgia. Annual per capita retail expenditure has doubled over the past decade. More than 9% out of total international visitors visited Georgia for shopping purposes in 2013 year.</p>\r\n<ul>\r\n<li><strong>Energy Sector</strong></li>\r\n</ul>\r\n<p style="text-align: justify;">Energy sector is attractive from the perspective of both existing natural resources and developing infrastructure, as the country possesses huge hydro resources and offers untapped potential for investment. For the last years, Georgian has become net exporter of electricity and currently utilizes only 18% of its vast hydro resources. Georgian power grid is connected to the grids of all of neighboring countries, which are faced with either a structural power deficit or expensive power generation. From 2010 to 2014* Georgian energy sector has attracted almost USD 750 mln.</p>\r\n<ul>\r\n<li><strong>Transport and Logistics</strong></li>\r\n</ul>\r\n<p style="text-align: justify;">Georgia is in a highly strategic location: It serves as an entry gate to the Caucasus and Central Asia as well as a stepping stone to the region. The country is the shortest route between the Black Sea and the Caspian Sea region. Construction of Baku-Tbilisi-Kars new railway line is on the final stage and it will further advance trade of goods in the whole region. The government is investing heavily in the development of road infrastructure-highways as well as local roads. At this stage, the government has negotiations with potential investors to build a new deep sea port in Anaklia on Black sea, with an ability to receive vessels of at least 6,500 TEU capacity. The new port will bring Georgia\'s logistical capabilities to a new level. Therefore, Georgia wants and can be the best place for regional offices, regional stocks, and a part of various value chains.</p>\r\n<table style="width: 100%;">\r\n<tbody>\r\n<tr>\r\n<td width="319">\r\n<p><strong>Area:</strong></p>\r\n</td>\r\n<td width="319">\r\n<p>69,700 sq. km</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="319">\r\n<p><strong>Population(2015)</strong></p>\r\n</td>\r\n<td width="319">\r\n<p>4.5mln</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="319">\r\n<p>Life expectancy:</p>\r\n</td>\r\n<td width="319">\r\n<p>76 years</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="319">\r\n<p>Official language:</p>\r\n</td>\r\n<td width="319">\r\n<p>Georgian</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="319">\r\n<p>Literacy:&nbsp;</p>\r\n</td>\r\n<td width="319">\r\n<p>99.7%</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="319">\r\n<p>Capital:</p>\r\n</td>\r\n<td width="319">\r\n<p>Tbilisi</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="319">\r\n<p>Currency (code)</p>\r\n</td>\r\n<td width="319">\r\n<p>Lari (GEL)</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="319">\r\n<p>GDP (2014*)&nbsp;</p>\r\n</td>\r\n<td width="319">\r\n<p>US $ 16.5 b.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="319">\r\n<p>GDP real growth rate (2014*)</p>\r\n</td>\r\n<td width="319">\r\n<p>4.7%&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="319">\r\n<p>GDP per capita (2014*)</p>\r\n</td>\r\n<td width="319">\r\n<p>USD 3 680.8</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="319">\r\n<p>FDI Inflows (2014*)&nbsp;&nbsp;</p>\r\n</td>\r\n<td width="319">\r\n<p>USD&nbsp; $1 272.5 mln</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="319">\r\n<p>Unemployment Rate 2013</p>\r\n</td>\r\n<td width="319">\r\n<p>14.6%</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="319">\r\n<p>External Trade Turnover Growth in 2014</p>\r\n</td>\r\n<td width="319">\r\n<p>5 %</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', 'false', '', '', '', 'About-georgia/Facts-and-Figures', 1, 5, 0, 1, 3, 0),
(5412, 5215, 7, 7, 1447622700, 1447622700, 'sub', 'textpage', 'Enterprise Georgia', 'Enterprise Georgia', '', '<p style="text-align: justify;">Entrepreneurship Development Agency (Enterprise Georgia) was established in March 2014 under the Ministry of Economy and Sustainable Development.</p>\r\n<p style="text-align: justify;">Enterprise Georgia is the first government institution in Georgia mandated to facilitate private sector (and in particular SME) development through a variety of financial and technical support mechanisms, as well as export support. At the same time the Agency is an integral part of the new governmental program &ldquo;Produce in Georgia&rdquo;, initiated by the Prime Minister Irakli Gharibashvili to encourage domestic production and increase productivity and competitiveness of SMEs.&nbsp;</p>\r\n<p style="text-align: justify;"><img src="http://tradewithgeorgia.com/files/manager/website/vission_1.png" alt="" width="814" height="143" /></p>\r\n<p style="text-align: justify;">&nbsp;<img src="http://tradewithgeorgia.com/files/manager/website/we%20know.png" alt="" width="816" height="29" /></p>\r\n<p style="text-align: justify;">Put in place schemes enabling easy start-up and long-term solvency of local enterprises&nbsp;Encourage high entrepreneurial culture among Georgian small and medium enterprises via training, consultations, business linkages &amp; matchmaking&nbsp;</p>\r\n<ul>\r\n<li>Put in place schemes enabling easy start-up and long-term solvency of local enterprises&nbsp;</li>\r\n<li>Encourage high entrepreneurial culture among Georgian small and medium enterprises via training, consultations, business linkages &amp; matchmaking&nbsp;</li>\r\n<li>Help SMEs access information regarding the financial instruments available locally and internationally&nbsp;</li>\r\n<li>Provide SMEs with access to finance via different schemes (interest rate financing, collateral insurance, grants, etc.)&nbsp;</li>\r\n<li>Facilitate support mechanisms for technical assistance to local enterprises for improving the production process, operations management &amp; business cycle&nbsp;</li>\r\n<li>Promote Georgian products internationally on targeted markets via: Product exhibitions, inbound and outbound trade missions, online marketing, product completions&nbsp;</li>\r\n<li>Help export oriented companies access business intelligence (market reports, access guides to targeted markets)</li>\r\n</ul>\r\n<p style="text-align: justify;">&nbsp;</p>', 'false', '', '', '', 'about-us/Enterprise-Georgia', 1, 5, 0, 2, 1, 0),
(5406, 5209, 1, 1, 1446553860, 1446553860, 'sub', 'textpage', 'Useful information', 'Useful information', '', '<ul>\r\n<li><strong>Climate and Weather</strong></li>\r\n</ul>\r\n<p>Climate in Georgia is extremely diverse, considering the country&rsquo;s small size. The Greater Caucasus Mountain Range plays an important role in moderating Georgia&rsquo;s climate, protecting the territory against extremely cold air from the north, while the Lesser Caucasus Mountains protects it against the very dry, hot air from the south. Average temperatures in summer range from 19 &deg;C to 22 &deg;C, and in winter from 1.5&deg;C to 3 &deg;C.</p>\r\n<ul>\r\n<li><strong>Currency</strong></li>\r\n</ul>\r\n<p>The official currency in Georgia is the Georgian Lari (code: GEL). The Lari is divided into 100 Tetri.&nbsp;</p>\r\n<p>There are exchange offices in many areas of Tbilisi. Most of the hotels accept credit cards transactions and ATM machines are available throughout major towns and cities.</p>\r\n<p>Official exchange rates of GEL against foreign currencies can be found at the following link:&nbsp;<a href="https://www.nbg.gov.ge/index.php?m=582&amp;lng=eng">https://www.nbg.gov.ge/index.php?m=582&amp;lng=eng</a></p>\r\n<ul>\r\n<li><strong>Communications</strong></li>\r\n</ul>\r\n<p>Georgia&rsquo;s country code is +995 and the area code for Tbilisi is 322. Georgian mobile operators (Geocell, MagtiCom and Beeline) have almost full coverage around the country and there are many free WI-FI zones available for the visitors.</p>\r\n<ul>\r\n<li><strong>Healthcare and Medical Services</strong></li>\r\n</ul>\r\n<p>When undertaking any form of travel, adequate insurance is strongly advised. Georgia has excellent medical facilities. For the emergency services please call 112, you will be connected to the 24 hour emergency response center, operating under the Georgian Ministry of Internal Affairs.</p>\r\n<p>&ldquo;112&rdquo; receives emergency calls from all over Georgia via single emergency number: 1-1-2 and it unites three following emergency response centers:</p>\r\n<ul>\r\n<li>Fire / Rescue</li>\r\n<li>Patrol Police</li>\r\n<li>Emergency Department</li>\r\n</ul>\r\n<p>1-1-2 can be reached free of charge from both mobile and landline phones, even without a SIM-card or with negative balance on the phone.&nbsp;</p>', 'false', '', '', '', 'Useful-information', 1, 5, 0, 2, 7, 1),
(5407, 5210, 3, 3, 1446554100, 1446554100, 'sub', 'textpage', 'Useful Information', 'Useful Information', '', '<p><span style="text-decoration: underline; color: #0278c1;"><strong>Climate and weather</strong></span></p>\r\n<p style="text-align: justify;">Climate in Georgia is extremely diverse, considering the country&rsquo;s small size. The greater caucasus mountain range plays an important role in moderating Georgia&rsquo;s climate, protecting the territory against extremely cold air from the north, while the Lesser Caucasus Mountains protects it against the very dry, hot air from the south. Average temperatures in summer range from 19 &deg;C to 22 &deg;C, and in winter from 1.5&deg;C to 3 &deg;C.</p>\r\n<p style="text-align: justify;"><span style="text-decoration: underline; color: #0278c1;"><strong>Currency</strong></span></p>\r\n<p style="text-align: justify;">The official currency in Georgia is the Georgian Lari (code: GEL). The Lari is divided into 100 Tetri.&nbsp;There are exchange offices in many areas of Tbilisi. Most of the hotels accept credit cards transactions and ATM machines are available throughout major towns and cities.&nbsp;</p>\r\n<p style="text-align: left;">Official exchange rates of GEL against foreign currencies can be found at the following link:&nbsp;<a href="https://www.nbg.gov.ge/index.php?m=582&amp;lng=eng">https://www.nbg.gov.ge/index.php?m=582&amp;lng=eng</a></p>\r\n<p style="text-align: justify;"><span style="text-decoration: underline;"><span style="color: #0278c1;"><strong>Communications</strong></span></span></p>\r\n<p>Georgia&rsquo;s country code is +995 and the area code for Tbilisi is 322. Georgian mobile operators (Geocell, MagtiCom and Beeline) have almost full coverage around the country and there are many free WI-FI zones available for the visitors.</p>\r\n<p><span style="text-decoration: underline;"><span style="color: #0278c1;"><strong>Healthcare and medical services</strong></span></span></p>\r\n<p style="text-align: justify;">When undertaking any form of travel, adequate insurance is strongly advised. Georgia has excellent medical facilities. For the emergency services please call 112, you will be connected to the 24 hour emergency response center, operating under the Georgian Ministry of Internal Affairs.&ldquo;112&rdquo; receives emergency calls from all over Georgia via single emergency number:</p>\r\n<ul>\r\n<li style="text-align: justify;"><span style="color: #000000;">1-1-2 and it unites three following emergency response centers:</span></li>\r\n<li style="text-align: justify;"><span style="color: #000000;">Fire / Rescue</span></li>\r\n<li style="text-align: justify;"><span style="color: #000000;">Patrol Police</span></li>\r\n<li style="text-align: justify;"><span style="color: #000000;">Emergency Department</span></li>\r\n<li style="text-align: justify;"><span style="color: #000000;">1-1-2 can be reached free of charge from both mobile and landline phones, even without a SIM-card or with negative balance on the phone.&nbsp;</span></li>\r\n</ul>', 'false', '', '', '', 'About-georgia/useful-information', 1, 5, 0, 2, 4, 0),
